INSERT INTO `blog_post` VALUES (38,'测试公开度','<p>只是个测试</p>\r\n\r\n<h3>testss</h3>\r\n\r\n<h3>&nbsp;</h3>','2018-07-08 07:18:25.800410','2018-07-08 07:18:25.811788',2,4,2,41),(39,'rails配置环境时的LoadError解决方法','<p><span style=\"font-size:14px\">最近看ruby，在看ruby on rails的时候，搭建本地环境，对已有的Gemfile使用bundle install来安装相关环境，但是出现了mysql2的错误：</span></p>\r\n\r\n<p>cannot load such file -- mysql2/mysql2 (LoadError)</p>\r\n\r\n<p><span style=\"font-size:14px\">搜索了多种方法，发现可以修改Gemfile来重新bundle install。</span></p>\r\n\r\n<p><span style=\"font-size:14px\">把gem &#39;mysql2&#39;, &#39;0.4.5&#39; 改为 gem &#39;mysql2&#39;, &#39;~&gt; 0.4.5&#39;，之后再运行bundle install。</span></p>\r\n\r\n<p><span style=\"font-size:14px\">参考url：<a href=\"https://stackoverflow.com/questions/13701287/ruby-gem-loaderror-mysql2-mysql2-required\">https://stackoverflow.com/questions/13701287/ruby-gem-loaderror-mysql2-mysql2-required</a></span></p>\r\n\r\n<p><span style=\"font-size:14px\">其他gem安装报错的时候可以使用的命令样例：</span></p>\r\n\r\n<pre>\r\n<code>gem install libv8 -v \'3.16.14.13\' -- --with-system-v8\r\n\r\nPKG_CONFIG_PATH=/usr/local/opt/imagemagick@6/lib/pkgconfig gem install rmagick:2.16.0\r\n\r\ngem install puma -v \'3.6.2\' -- --with-opt-dir=/usr/local/opt/openssl\r\n\r\ngem install mysql2 -v \'0.4.5\' -- --srcdir=/usr/local/Cellar/mysql/8.0.11/include</code></pre>\r\n\r\n<p><!--5f39ae17-8c62-4a45-bc43-b32064c9388a:--></p>','2018-08-20 09:59:00.000000','2018-08-20 09:59:00.000000',2,1,1,308),(40,'以阿里云为例，申请建立自己的域名和网站','<p><span style=\"font-size:14px\">以阿里云为例。（如果域名和服务器是申请的国外的，比如godaddy，可以省略通信管理局和公安机关审核的步骤，当然也需要考虑访问的速度，国内的还是选择阿里云）</span></p>\r\n\r\n<p><span style=\"font-size:18px\"><strong>- 申请虚拟主机</strong></span><br />\r\n<span style=\"font-size:14px\">在https://dev.aliyun.com/注册用户。</span></p>\r\n\r\n<p><span style=\"font-size:14px\">创建实例，选择地域，配置，网络等，购买。比如在https://ecs-buy.aliyun.com/wizard/#/prepay/cn-shenzhen。一般个人用的选个两核和1g内存就够了,一个月几十块。</span></p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2018/08/20/aliyun-1.png\" style=\"height:244px; width:600px\" /><br />\r\n<span style=\"font-size:18px\"><strong>- 购买域名</strong></span><br />\r\n<span style=\"font-size:14px\">在类似万网的地方搜索你想要的名字，https://wanwang.aliyun.com/，只要无人使用，就可以购买，当然有的会特别贵。普通的一年几十块。<br />\r\n一般不要选择.cn的，具体原因可以搜索一下，这里不详述了。</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-size:18px\"><strong>- 搭建网站</strong></span></p>\r\n\r\n<p><span style=\"font-size:14px\">申请了虚拟主机后，能远程连接到你的主机，然后配置搭建你的网站，比如本站用了wordpress、django，这个自选，复杂度不定，该文不详述。<br />\r\n搭建好了后，可以用ip访问到你的网站。此时还不可以用域名直接访问。需要域名绑定，并备案你的网站和主体信息。</span></p>\r\n\r\n<p><br />\r\n<span style=\"font-size:18px\"><strong>- 网站备案</strong></span></p>\r\n\r\n<p><span style=\"font-size:14px\">在这里https://beian.aliyun.com/，可以备案你的网站，以及你的一些信息，会提交到通信管理局审核。一般需要20天左右。此时就可以用域名访问你的网站了。需要将备案号放在你的网站主页上，备案号并链接至&quot;http://www.miitbeian.gov.cn/&quot;。</span></p>\r\n\r\n<p><span style=\"font-size:14px\">在国内的网站，还需要在公安机关备案。可以参考https://help.aliyun.com/knowledge_detail/36983.html。备案成功后也有个备案号，需要放在网站主页。如果只是个人博客之类的，可以选择非交互性网站，这样不用自己本人去公安机关去，在网上处理即可了。</span></p>\r\n\r\n<p><span style=\"font-size:14px\">&nbsp;</span></p>','2018-08-19 10:30:00.000000','2018-08-19 10:30:00.000000',2,1,1,304),(41,'django上传文件500错误但本地server不出现错误的问题','<p><span style=\"font-size:14px\">最近改了django，遇到一个问题，在用域名访问时，提示上传错误http500。但是登录上去，用python manage.py runserver来启动再上传文件则不出现问题。</span></p>\r\n\r\n<p><span style=\"font-size:14px\">检查了nginx的access和error的log，均无消息。后头在uwsgi的log中发现是permission denied的提示。看来是没有权限提交。</span></p>\r\n\r\n<p><span style=\"font-size:14px\">检查了nginx.conf，发现user与django目录的user不一样，于是用chown命令修改用户，之后上传成功。</span></p>','2018-08-20 14:20:00.000000','2018-08-20 14:20:00.000000',2,1,1,446),(43,'Mac上配置appium环境','<p>需要对iphone和android同时做自动化测试，于是选择了appium。虽然慢，不过可以跨平台。</p>\r\n\r\n<p>在mac上先保证HomeBrew是安装了的，如果没有安装，可以运行下面的命令：&nbsp;</p>\r\n\r\n<p>ruby -e &quot;$(curl -fsSL https://raw.githubusercontent.com/Homebrew/install/master/install)&quot;</p>\r\n\r\n<p>然后运行如下的命令来安装相应环境：</p>\r\n\r\n<pre>\r\n<code>brew install libimobiledevice\r\nbrew install ideviceinstaller\r\nbrew install ios-webkit-debug-proxy\r\nbrew install ios-deploy\r\nbrew install carthage\r\nbrew install node</code></pre>\r\n\r\n<p>此时再安装appium，并检查环境是否正常：</p>\r\n\r\n<pre>\r\n<code>npm install -g appium\r\nnpm install -g appium-doctor\r\nAppium-doctor --ios</code></pre>\r\n\r\n<p>如果需要做iphone上的自动化测试，记得安装xcode。</p>\r\n\r\n<p>在appium的目录下有webdriveragent，需要build和test，可以参考这个链接的内容：https://testerhome.com/topics/7220。</p>\r\n\r\n<p>如果出现了这个错误：Module parse failed: /usr/local/lib/node_modules/appium/node_modules/appium-xcuitest-driver/WebDriverAgent/Inspector/js/app.js Unexpected token (67:6)，那么修改Inspector下webpack.config.js文件，去掉babel-loader配置后的，&ldquo;exclude: /node_modules/&rdquo;，&nbsp;删除Inspector下node_modules文件夹，再执行 &ldquo;sh ./Scripts/bootstrap.sh&rdquo;。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>当环境准备好了后，比如用iphone时，用数据线插上手机，运行：ios_webkit_debug_proxy -c &lt;iphone udid&gt;:27753 -d; 再运行appium来启动appium server，就可以开始编写你的脚本啦。</p>\r\n\r\n<p>如果是想对safari做自动化测试，还需要安装SafariLauncher。</p>\r\n\r\n<p>当需要指定bundleId时，可以用ideviceinstaller -l来获取手机安装app的bundleId。</p>\r\n\r\n<p>需要注意的是，真机需要有效的开发分发证书和开发的 Provisioning Profile。</p>\r\n\r\n<p><!--5f39ae17-8c62-4a45-bc43-b32064c9388a:--></p>\r\n\r\n<p><!--5f39ae17-8c62-4a45-bc43-b32064c9388a:--></p>','2018-08-27 11:09:00.000000','2018-08-27 11:09:00.000000',2,1,1,349),(45,'Selenium Webdriver做自动化时一些有用的js操作','<p>selenium webdriver算是做web相关的自动化用得最多的了。</p>\r\n\r\n<p>除了源生操作，还可以执行javascript来达到某些操作，非常方便。</p>\r\n\r\n<p>下面列出了一些常用的js操作：</p>\r\n\r\n<p>滑动到某个元素</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">script = \"arguments[0].scrollIntoView(true);\"\r\ndriver.execute_script(script, web_element)</code></pre>\r\n\r\n<p>打开新窗口</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">script = \"window.open(\'%s\')\" %url\r\ndriver.execute_script(script)</code></pre>\r\n\r\n<p>获取页面加载状态</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">driver.execute_script(\"return document.readyState;\")\r\n</code></pre>\r\n\r\n<p>滑动到顶端</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">driver.execute_script(\"window.scrollTo(0, 0)\")</code></pre>\r\n\r\n<p>滑动到底端</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">driver.execute_script(\"window.scrollBy(0,document.body.scrollHeight)\",\"\")</code></pre>\r\n\r\n<p>水平滚动</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">driver.execute_script(\"document.documentElement.scrollLeft=\" + \"x\"; )</code></pre>\r\n\r\n<p>操作文本</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">text = \"teststring\"\r\ndriver.execute_script(\"var sum=document.getElementById(\'id\'); sum.value=\'\" + text + \"\';\";)</code></pre>\r\n\r\n<p>播放视频</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">driver.execute_script(\"return arguments[0].play()\", video);</code></pre>\r\n\r\n<p>想到其他的再来加。。</p>','2018-09-13 18:24:00.000000','2018-09-13 18:24:00.000000',2,1,1,221),(46,'APP自动化的元素定位','<p>app自动化和web自动化比较类似 （指UI自动化，非api），不过web自动化时inspect元素比较方便，使用chrome或者firefox无论自写元素定位或者直接获取xpath都很简单。</p>\r\n\r\n<p>做app自动化时，各类元素则显得没有那么直观。下面列出一些元素定位可以使用的工具和方式。（个人推荐webdriveragent和source）</p>\r\n\r\n<p>1. 使用appium自带的inspector，但是得下载桌面版，如果只是命令行式的则没有。</p>\r\n\r\n<p>2. 使用macaca的inspector，可以参照https://macacajs.github.io/app-inspector/cn/。据说用起来不错，不过我尝试了后总是提示internal server error，便没有再试。</p>\r\n\r\n<p>3. 对应ios，appium也有ios-inspector，可以参考https://github.com/mykola-mokhnach/Appium-iOS-Inspector。</p>\r\n\r\n<p>4. 使用webdriveragent的inspector，前一篇文章有介绍如何在mac上配置appium的环境，在配置过程中，会build webdriveragent，在build和test的过程中，其实就能看到一个server url，这个url就能用于inspect元素。</p>\r\n\r\n<p>如下图，连上手机后再xcode中test webdriveragent</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2018/09/18/xcode-webdriveragent.png\" style=\"height:348px; width:600px\" /></p>\r\n\r\n<p>打开红框中的url可以看到session，在url后加上inspector，比如http://169.254.85.134:8100/inspector，则可以看到各元素的情况，如下图：</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2018/09/18/webdriveragent-inspector.png\" style=\"height:302px; width:600px\" /></p>\r\n\r\n<p>5. 对于android可以用UI automator view。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/03/01/ui_automator_view_calculator.png\" style=\"height:477px; width:800px\" /></p>\r\n\r\n<p>6. 通过page source来自己查看，这个方式不是很直观，但比较详细。比如python用print(driver.page_source)，是把当前页面的所有内容抓出来，保存到一个xml文件里，可以找需要的内容。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2018/09/18/appium-page-source.png\" style=\"height:222px; width:600px\" /></p>\r\n\r\n<p>有遇到其他的再来补充。</p>','2018-09-18 10:41:00.000000','2018-09-18 10:41:00.000000',2,1,1,626),(52,'markdown','# 一级标题\r\n\r\n## 二级标题\r\n\r\n### 三级标题\r\n\r\n- 列表项1\r\n- 列表项2\r\n- 列表项3\r\n\r\n> 这是一段引用\r\n\r\n```python\r\ndef detail(request, pk):\r\n    post = get_object_or_404(Post, pk=pk)\r\n    post.body = markdown.markdown(post.body,\r\n                                  extensions=[\r\n                                      \'markdown.extensions.extra\',\r\n                                      \'markdown.extensions.codehilite\',\r\n                                      \'markdown.extensions.toc\',\r\n                                  ])\r\n    return render(request, \'blog/detail.html\', context={\'post\': post})\r\n```','2018-09-25 15:49:50.644032','2018-09-25 15:49:50.654677',2,4,2,23),(53,'看西航动力研究所张小平事件有感','<p>知乎链接： <a href=\"https://www.zhihu.com/question/295927388\">https://www.zhihu.com/question/295927388</a></p>\r\n\r\n<p>国内向来不重视技术，都想做管理，总觉得管理有前途更风光。</p>\r\n\r\n<p>技术发展不起来，大多用国外的轮子，有几个人懂原理，多少人就是调用接口而已。</p>\r\n\r\n<p>工作圈子里往往充斥着技术做到30多就得转行什么的，事多待遇又差还不受尊重，难以沉淀。如何出成果。各行各业若长此以往，难以想象。</p>\r\n\r\n<p>管理的多，都想做管理，什么都不懂的外行也来领导内行，这种也不是没有。做事的少，摘桃子的人多，估计国企里这种多些。有本事的谁也受不了。</p>\r\n\r\n<p>我小时候老师让谈未来理想的时候，还有人说科学家之类，现在的小朋友有几个有这想法。</p>\r\n\r\n<p>可惜。若能有个好的技术氛围，好好发展，我们国家也不用像中兴事件受制于人。</p>','2018-09-27 09:57:00.000000','2018-09-27 09:57:00.000000',2,5,1,227),(54,'python的经典类和新式类','<p>python里的class存在着经典类和新式类的区别。class() 为经典类，class(object) 为新式类。普通的使用差别也不大，但对类的使用多一点，则会有些注意事项。</p>\r\n\r\n<p>1. 在class里继承于object的方式是python2系列中的，因为在python3中默认会加载object，所有的类都是新式类。但在维护更改遗留的python2项目时，需要注意两者区别。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. 多重继承时，对于父类中的方法则有个遍历方式的不同。经典类是深度优先，新式类是广度优先（有的也有说是c3算法，在有些结果下和广度优先的结果一样）。</p>\r\n\r\n<p>比如class D继承与B和C，B和C是A的子类，C有重写A中的方法。用经典类时，则会从D-B-A，找到A中的方法，而使用不到C中重写的方法。如果是新式类，则会是D-B-C-A的顺序，会调用到C中的方法。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3.&nbsp;在经典类中，所有的类都是classobj类型，类的实例是instance类型。类与实例只有通过__class__属性进行关联。这样在判断实例类型时，就会造成不便：所有的实例都是instance类型，会出现两个不一样的类比较结果为真的情况。</p>\r\n\r\n<p>经典类的实例是instance类型，而内置类的实例却不是，无法统一。也会造成麻烦。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4. 在python2中如果不指定object时，则没有__class__的方法可以使用。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>因此在使用python2时，最好是加上object，使用python3则可以忽略。</p>','2018-11-11 18:06:00.000000','2018-11-11 18:06:00.000000',2,1,1,240),(55,'iOS自动化使用appium关于gesture的更新','<p>最近几天在修改ruby的自动化测试框架，需要加上appium的相关支持。</p>\r\n\r\n<p>于是参照了自己以前在python自动化框架中实现的部分，但是发现TouchAction无法执行，Tap或者swipe等均不生效，提示&ldquo;unknown server-side error occurred while processing the command&rdquo;。一度怀疑是测试环境出了问题。多次调试后未成功，去搜索了官方资料，发现iOS的手势操作有些变化。</p>\r\n\r\n<p>参照下面官方链接的说明：</p>\r\n\r\n<p><a href=\"https://appium.io/docs/en/writing-running-appium/ios/ios-xctest-mobile-gestures/#automating-mobile-gestures-for-ios-with-webdriveragentxctest-backend\">https://appium.io/docs/en/writing-running-appium/ios/ios-xctest-mobile-gestures/#automating-mobile-gestures-for-ios-with-webdriveragentxctest-backend</a></p>\r\n\r\n<p>Unfortunately Apple&#39;s XCTest framework does not natively support W3C standards for TouchAction interface implementation. Although, it provides rich set of gestures, inluding these, that are unique for iOS platform. It is possible to directly invoke these gestures in Appium starting from version 1.6.4-beta.</p>\r\n\r\n<p>It is important to rememeber that XCTest and WDA are being constantly changed. This means all &quot;mobile: *&quot; commands can be also subject of change in Appium without any preliminary notice.</p>\r\n\r\n<p>将操作替换为类似下面的语句则可以成功操作手势，使用更简洁方便。</p>\r\n\r\n<pre>\r\n<code class=\"language-ruby\">@driver.execute_script \'mobile: tap\', :x =&gt; 200, :y =&gt; 10, :fingers =&gt; 1, :tapCount =&gt; 1, :duration =&gt; 0.5, :element =&gt; login_button.ref</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><!--5f39ae17-8c62-4a45-bc43-b32064c9388a:--></p>','2018-11-16 15:20:00.000000','2018-11-16 15:20:00.000000',2,1,1,264),(56,'Django里根据不同设备展示不同内容','<p>现在访问网页除了pc端，手机端也是经常使用的类型。</p>\r\n\r\n<p>那么会有个需求，在pc端和mobile端展示不同的内容，毕竟pc浏览器里的布局显示不一定适合在手机浏览器上。</p>\r\n\r\n<p>一般会有两种方式：</p>\r\n\r\n<p>&nbsp;1. 响应式布局。比如bootstrap也有相关定义。通过查询媒介，针对不同的屏幕宽度来设置对应的css样式，可以实现在不同设备上对同一控件展示成不同的外观效果。</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 在html的head中首先定义：&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<pre>\r\n<code class=\"language-html\">&lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"&gt;</code></pre>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 在css定义中可以指明不同的宽度使用什么样式属性(从网上复制了下面的样例，因为自己没有使用这种方式)：</p>\r\n\r\n<pre>\r\n<code class=\"language-css\">/width &lt; 768px*/\r\n@media screen and (max-width: 768px){\r\n    .container{\r\n        width:100%;\r\n        background-color: green;\r\n    }\r\n}\r\n/width &gt;= 768 and width &lt; 992*/\r\n@media screen and (max-width: 992px) and (min-width: 768px) {\r\n    .container{\r\n        width:750px;\r\n        background-color: blue;\r\n    }\r\n}</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. 判断设备类型来加载不同的内容。目前自己采用的这种方式，因为需要的不是css样式不同，而是使用的元素类别都不一样了，响应式布局无法满足需要。</p>\r\n\r\n<p>判断设备可以检查user-agent里的关键词。</p>\r\n\r\n<p>比如电脑版的safari是：</p>\r\n\r\n<pre>\r\n<code class=\"language-html\">Mozilla/5.0 (Macintosh; Intel Mac OS X 10_13_6) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.1.2 Safari/605.1.15</code></pre>\r\n\r\n<p>iphone的safari则是：</p>\r\n\r\n<pre>\r\n<code class=\"language-html\">Mozilla/5.0 (iPhone; CPU iPhone OS 11_3 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/11.0 Mobile/15E148 Safari/604.1</code></pre>\r\n\r\n<p>在你的django app下面添加一个文件，比如device_agent.py, 添加如下内容：</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">def device(request):\r\n    \'\'\'from mobile browser or pc browser\'\'\'\r\n    user_agent = request.META[\'HTTP_USER_AGENT\'].lower()\r\n    mobile_re = [\'iphone\',\'android\',\'mobile\']\r\n\r\n    is_mobile = False\r\n    for keyword in mobile_re:\r\n        if user_agent.find(keyword) &gt;= 0:\r\n            is_mobile = True\r\n            break\r\n\r\n    if is_mobile:\r\n        return {\'device_type\': \'mobile\'}\r\n    else:\r\n        return {\'device_type\': \'pc\'}</code></pre>\r\n\r\n<p>在settings.py里更新如下内容：</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">TEMPLATES = [\r\n    {\r\n        \'BACKEND\': \'django.template.backends.django.DjangoTemplates\',\r\n        \'DIRS\': [os.path.join(BASE_DIR, \'templates\')],\r\n        \'APP_DIRS\': True,\r\n        \'OPTIONS\': {\r\n            \'context_processors\': [\r\n                \'django.template.context_processors.debug\',\r\n                \'django.template.context_processors.request\',\r\n                \'django.contrib.auth.context_processors.auth\',\r\n                \'django.contrib.messages.context_processors.messages\',\r\n                \'bobjiang.device_agent.device\' # add device_agent\r\n            ],\r\n        },\r\n    },\r\n]</code></pre>\r\n\r\n<p>在html模板中就可以使用device_type来判断设备类型并加载不同内容啦。</p>\r\n\r\n<pre>\r\n<code class=\"language-html\">{% if device_type != \'mobile\' %}\r\n    &lt;ul class=\"navbar-nav\"&gt;\r\n{% else %}\r\n    &lt;ul class=\"nav nav-pills justify-content-center\"&gt;\r\n{% endif %}</code></pre>\r\n\r\n<p>&nbsp;</p>','2018-12-03 10:09:00.000000','2018-12-03 10:09:00.000000',2,1,1,265),(57,'Mac卸载Java和安装openjdk','<p>卸载java：</p>\r\n\r\n<p>https://blog.csdn.net/haozhugogo/article/details/54809545</p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:\'Microsoft YaHei\'\">在&ldquo;终端&rdquo;窗口中，复制和粘贴命令：<br />\r\n<code>sudo rm -fr /Library/Internet\\ Plug-Ins/JavaAppletPlugin.plugin</code><br />\r\n<code>sudo rm -fr /Library/PreferencesPanes/JavaControlPanel.prefPane</code><br />\r\n<code>sudo rm -fr ~/Library/Application\\ Support/Java</code></span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:\'Microsoft YaHei\'\">请勿尝试通过从&nbsp;<code>/usr/bin</code>&nbsp;删除 Java 工具来卸载 Java。此目录是系统软件的一部分，下次对操作系统执行更新时，Apple 会重置所有更改。</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:\'Microsoft YaHei\'\">注意：上面是官网的卸载步骤，按照上面的卸载完后，要从finder中进入 /Library/Java/JavaVirtualMachines，然后删除jdk1.8.xxx，这样才算彻底卸载完成</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:\'Microsoft YaHei\'\">windows的openjdk的下载：</span></span></p>\r\n\r\n<p>https://stackoverflow.com/questions/5991508/openjdk-availability-for-windows-os</p>\r\n\r\n<p>https://github.com/ojdkbuild/ojdkbuild</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>mac上openjdk：</p>\r\n\r\n<p>特定版本的github的下载，但是是source：</p>\r\n\r\n<p>https://github.com/AdoptOpenJDK/openjdk8-binaries/releases/download/jdk8u192-b12/OpenJDK8U-jdk_x64_mac_hotspot_8u192b12.tar.gz</p>\r\n\r\n<p>https://stackoverflow.com/questions/29456149/build-openjdk-on-mac-java-home-is-not-defined-correctly</p>\r\n\r\n<pre>\r\n<code>brew tap AdoptOpenJDK/openjdk\r\nbrew cask install adoptopenjdk8</code></pre>\r\n\r\n<p>==========================================================</p>\r\n\r\n<p>ML000606689:test bojiang$ java -version<br />\r\njava version &quot;1.8.0_172&quot;<br />\r\nJava(TM) SE Runtime Environment (build 1.8.0_172-b11)<br />\r\nJava HotSpot(TM) 64-Bit Server VM (build 25.172-b11, mixed mode)</p>\r\n\r\n<p>ML000606689:build_openjdk8 bojiang$ java -version<br />\r\nopenjdk version &quot;1.8.0_192&quot;<br />\r\nOpenJDK Runtime Environment (AdoptOpenJDK)(build 1.8.0_192-b12)<br />\r\nOpenJDK 64-Bit Server VM (AdoptOpenJDK)(build 25.192-b12, mixed mode)</p>','2018-12-17 14:56:16.644993','2018-12-17 14:56:16.654898',2,4,2,28),(58,'关于活着的意义','<p>收养的小猫有一只这几天突然不舒服，今天就走了。心里有些难过。<br />\r\n其实到了中年，总会面临着生老病死。身边亲人长辈的离去，或者身边听说的朋友病逝。我跟着妈妈做了几年公益，微薄之力去救助流浪动物，也见过很多伤痛和死亡。相对来说，人还是幸运的，不会面临那么残酷的生存条件，也没有恶人的故意伤害。</p>\r\n\r\n<p><br />\r\n其实见得多了，也懂生老病死都是自然循环。只是当一条生命在面前离去，还是很感慨很难过。</p>\r\n\r\n<p>曾听说过，能遇见的都是有缘分的，而离去则代表你们这辈子的缘分断了，再也没有任何关系。很朴实的话，也字字入心的难过。我会遇见什么，又会经历面对什么，我又会是怎么样？也不得不想到，活着是为了什么？</p>\r\n\r\n<p>说得远一点，人都是会被社会准则所拘束，是为了儿时的成绩，还是成年后的金钱和权利，等等等等。最后又对我有什么用，我最想要什么。谁记得儿时的愿望，谁记得自己为什么开怀笑过？等等等等。活着是为了什么，就像我现在的年龄，为了家庭和生活，是拼搏个人价值加班加点，还是老婆热炕头的家庭温暖，真的看个人，也被社会大趋势所影响着。曾在知乎上看过一个回答很多的话题，就是关于活着。我们有些终究会失去，现在留着又有何意义。答案大多说的是没有意义应该活在当下体验现在的我。是啊，我也想不出还有什么好答案，每个年龄段想的也不一样。其实我到现在都还想不太明白，也只能大致觉得应该珍惜现在身边的人和事物，但行好事。</p>\r\n\r\n<p>乱七八糟写了一堆字，再附上知乎上一个答案，留作结尾吧。</p>\r\n\r\n<p><a href=\"https://www.zhihu.com/question/24329745/answer/27906463\">https://www.zhihu.com/question/24329745/answer/27906463</a></p>','2019-01-01 14:09:00.000000','2019-01-01 14:09:00.000000',2,5,1,313),(59,'修改Django中admin站点管理的主页跳转链接','<p>若使用默认的admin而不是xadmin之类的话，进入django admin时，右上角的查看站点的跳转会是指向到根页面。比如以本站为例，会跳转到https://www.byincd.com/, 这对于网站是二级路径的话，则跳转错误了。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/01/06/django_admin_right_top.png\" style=\"height:50px; width:307px\" /></p>\r\n\r\n<p>这里可以去修改django的admin的模板内容。也很简单。</p>\r\n\r\n<p>路径样例是.../site-packages/django/contrib/admin/templates/admin/base.html。</p>\r\n\r\n<p>修改第40行：改为类似如下内容即可：</p>\r\n\r\n<pre>\r\n<code class=\"language-html\">base.html:40:     &lt;a href=\"{{ site_url }}bobjiang/\"&gt;{% trans \'View site\' %}&lt;/a&gt;</code></pre>\r\n\r\n<p>缺点是当移除django或者去其他地方配置环境时，需要重新修改一次。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>至于找site-packages路径，无论是否使用pyenv，用下面命令即可。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">import sys\r\nprint(sys.path)</code></pre>\r\n\r\n<p>&nbsp;</p>','2019-01-06 12:53:00.000000','2019-01-06 12:53:00.000000',2,1,1,308),(60,'手机app测试策略','<p>工作中整理总结了下手机app测试时需要测试的地方和需要关注的点，附上一个思维脑图。</p>\r\n\r\n<p>另正在整理一个详细点的文档，如果有人看有人有兴趣的话，可以一起讨论下细节。</p>\r\n\r\n<p>包含11个部分，可以写的太多就只在图里列了关键词。包含UI, Functionality, Automation, Performance, Security, Compatibility, Stability, Specility, Edge, Localization, Release&amp;Publish.</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/01/14/mobile_testing_strategy-2019011403.png\" style=\"height:882px; width:900px\" /></p>\r\n\r\n<p>如上图所示。</p>','2019-01-14 14:47:00.000000','2019-01-14 14:52:00.000000',2,1,1,269),(61,'Jupyter Notebook在nginx中无法被配置为二级页面的解决办法','<p>在网站刚建立的时候，就已经搭建了Jupyter Notebook的运行环境。不过之前只是开放为8888的端口，无法像博客那样有个正常点的名字。毕竟域名都有了，长时间输入端口访问实在是有点强迫症发作了，于是打算像本博客网址一样配置一个正常的url，就像现在的https://www.byincd.com/jupyter。</p>\r\n\r\n<p>自己弄的两个博客都是用的nginx，于是决定也把Jupyter配置在nginx里。但是配置时发现只能作为根目录来访问，否则就会报404的错误。哪怕改为location ~ /jupyter这种也不行。如下所示。</p>\r\n\r\n<pre>\r\n<code class=\"language-nginx\">location / {\r\n    proxy_pass http://127.0.0.1:8888;\r\n    proxy_set_header Host $host;\r\n}\r\n\r\nlocation ~ /api/kernels/ {\r\n    proxy_pass http://127.0.0.1:8888;\r\n    proxy_set_header Host $host;\r\n    proxy_http_version 1.1;\r\n    proxy_set_header Upgrade \"websocket\";\r\n    proxy_set_header Connection \"Upgrade\";\r\n    proxy_read_timeout 86400;\r\n}\r\n\r\nlocation ~ /terminals/ {\r\n    proxy_pass http://127.0.0.1:8888;\r\n    proxy_set_header Host $host;\r\n    proxy_http_version 1.1;\r\n    proxy_set_header Upgrade \"websocket\";\r\n    proxy_set_header Connection \"Upgrade\";\r\n    proxy_read_timeout 86400;\r\n}</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>我需要的是作为二级目录访问的啊，于是查阅了相关资料，找到了解决办法。</p>\r\n\r\n<p>先修改jupyter notebook的配置文件jupyter_notebook_config.py。增加下面两行并重启jupyter notebook。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">\r\nc.NotebookApp.notebook_dir = u\'/path/jupyter\'\r\nc.NotebookApp.base_url = \'/jupyter/\'</code></pre>\r\n\r\n<p>然后在nginx的site-available的default文件中增加如下内容，重启nginx，即可用https://www.byincd.com/jupyter访问jupyter notebook啦。</p>\r\n\r\n<pre>\r\n<code class=\"language-nginx\">location /jupyter/ {\r\n    proxy_pass http://127.0.0.1:8888;\r\n    proxy_set_header Host $host;\r\n    proxy_set_header X-Real-Scheme $scheme;\r\n    proxy_set_header X-Real-IP $remote_addr;\r\n    proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;\r\n\r\n    proxy_http_version 1.1;\r\n    proxy_set_header Upgrade $http_upgrade;\r\n    proxy_set_header Connection \"upgrade\";\r\n\r\n    proxy_read_timeout 120s;\r\n    proxy_next_upstream error;\r\n}</code></pre>\r\n\r\n<p>&nbsp;</p>','2019-01-30 19:13:00.000000','2019-01-30 19:13:00.000000',2,1,1,806),(62,'Python3与Python2的变化','<p>关于python3和python2的区别，实际已经有很多文章了，毕竟python3已经出来了很久了。</p>\r\n\r\n<p>我在这里记录一下平时自己会遇到的一些区别。</p>\r\n\r\n<p>1. print变成了函数需要加括号了。</p>\r\n\r\n<p>2. 用户输入没有raw_input了，只有input。而且input收集到的输入会被当做一个字符串str。</p>\r\n\r\n<p>3. 除法精确了。在几年前使用python2时用到除法还要from __future__ import division。现在不需要了，不会出现5除以2是2了，而是等于2.5。</p>\r\n\r\n<p>4. xrange不存在了，由range代替，range也会直接成为一个迭代器。</p>\r\n\r\n<p>5.&nbsp;Python3 中字符串默认为 Unicode，但是如果在 Python2 中需要使用 Unicode，必须要在字符串的前面加一个 u。（这个链接里关于字符的介绍有点意思：https://pycoders-weekly-chinese.readthedocs.io/en/latest/issue5/unipain.html）</p>\r\n\r\n<p>6. Python3是直接使用新式类，不用像python2里那样指定class xxx(object).</p>\r\n\r\n<p>&nbsp;</p>','2019-02-02 14:12:00.000000','2019-02-02 14:12:00.000000',2,1,2,4),(63,'mac配置android sdk环境','<p>&nbsp;</p>\r\n\r\n<p>目前用的mac。</p>\r\n\r\n<p>先下载sdk。刚好有vpn，就从官网下载了sdk tool：https://developer.android.com/studio/#downloads。（没必要一定下载android studio，当然下载android studio是最简单的方式）</p>\r\n\r\n<p>然后解压并运行./tools/bin/sdkmanager. 似乎我的电脑被公司杀毒软件限制，运行失败。</p>\r\n\r\n<p>然后用了brew。正如stackoverflow上这个链接里说的：https://stackoverflow.com/questions/2677431/where-to-install-android-sdk-on-mac-os-x。</p>\r\n\r\n<p>Now the <code>android-sdk</code> is migrated from <code>homebrew/core</code> to <code>caskroom/cask</code>.</p>\r\n\r\n<pre>\r\n<code>brew tap caskroom/cask</code></pre>\r\n\r\n<p>and install <code>android-sdk</code> using</p>\r\n\r\n<pre>\r\n<code>brew cask install android-sdk</code></pre>\r\n\r\n<p>You will have to add the <code>ANDROID_HOME</code> to profile (.zshrc or .bashrc) 注意路径</p>\r\n\r\n<pre>\r\n<code>export ANDROID_HOME=/usr/local/share/android-sdk</code></pre>\r\n\r\n<p>install adb</p>\r\n\r\n<pre>\r\n<code>brew install homebrew/cask/android-platform-tools</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>环境变量样例：</p>\r\n\r\n<p>test-macbookpro</p>\r\n\r\n<pre>\r\n<code>[[ -s \"$HOME/.profile\" ]] &amp;&amp; source \"$HOME/.profile\" # Load the default .profile\r\n\r\n[[ -s \"$HOME/.rvm/scripts/rvm\" ]] &amp;&amp; source \"$HOME/.rvm/scripts/rvm\" # Load RVM into a shell session *as a function*\r\n\r\nexport PATH=\"/usr/local/opt/icu4c/bin:$PATH\"\r\nexport PATH=\"/usr/local/opt/icu4c/sbin:$PATH\"\r\nPATH=$PATH:/Users/bjiang1/workspace/selenium_webdriver\r\nexport JAVA_HOME=/Library/Java/JavaVirtualMachines/adoptopenjdk-8.jdk/Contents/Home\r\nexport ANDROID_HOME=/usr/local/share/android-sdk\r\nexport PATH=$PATH:$ANDROID_HOME/tools\r\nexport PATH=$PATH:$JAVA_HOME/bin</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>my-macbookpro</p>\r\n\r\n<pre>\r\n<code>source /Users/bojiang/.rvm/scripts/rvm\r\nPATH=$PATH:/usr/local/mysql/bin\r\n#export PATH=/Users/bojiang/download/WebDriver:$PATH\r\nPATH=$PATH:/Users/bojiang/download/WebDriver\r\nif which pyenv &gt; /dev/null; then eval \"$(pyenv init -)\"; fi\r\nLDFLAGS=/usr/local/opt/curl/lib\r\nCPPFLAGS=/usr/local/opt/curl/include\r\nexport HOMEBREW_BOTTLE_DOMAIN=https://mirrors.ustc.edu.cn/homebrew-bottles\r\nexport JAVA_HOME=/Library/Java/JavaVirtualMachines/adoptopenjdk-8.jdk/Contents/Home\r\nexport CLASSPATH=.:$JAVA_HOME/jre/lib/rt.jar:$JAVA_HOME/lib/dt.jar:$JAVA_HOME/lib/tools.jar\r\nexport PATH=$PATH:$JAVA_HOME/bin\r\nexport ANDROID_HOME=/Users/bojiang/Library/Android/sdk\r\nexport PATH=$PATH:$ANDROID_HOME/tools:$ANDROID_HOME/platform-tools</code></pre>\r\n\r\n<p>&nbsp;</p>','2019-02-14 17:29:00.000000','2019-02-14 17:29:00.000000',2,1,2,15),(64,'openstf环境搭建和问题解决','<p>openstf是用于管理和控制Android设备，github地址是https://github.com/openstf/stf。不过ios的需要用上其他的，之后再更新ios相关。</p>\r\n\r\n<p>本文介绍: <strong>1) 本地环境搭建&nbsp; 2) 连接远程机器&nbsp; 3）nginx配置&nbsp; 4）问题解决</strong></p>\r\n\r\n<p>下图是一个配置好打开的stf页面。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/02/20/virtualbox_stf_site_available.png\" style=\"height:278px; width:600px\" /></p>\r\n\r\n<p><strong>1) 本地环境搭建&nbsp;</strong></p>\r\n\r\n<p><strong>如果是用的mac，那么不要用docker了，因为反正也识别不到设备。</strong>参考<a href=\"https://github.com/sorccu/docker-adb/issues/8\">https://github.com/sorccu/docker-adb/issues/8</a></p>\r\n\r\n<p>&quot;&quot;&quot;</p>\r\n\r\n<p>Unfortunately Docker on Mac does not support USB, since the underlying xhyve doesn&#39;t support it. The old boot2docker may have worked by tweaking VM settings.</p>\r\n\r\n<p>I think the easiest (perhaps only?) way to get it to work would be to use a Linux VM and run docker there instead.</p>\r\n\r\n<p>&quot;&quot;&quot;</p>\r\n\r\n<p>如果使用其他的比如ubuntu可以试试下面的。对于mac还会遇到stf的地址访问不了的情况，真是坑爹啊。。</p>\r\n\r\n<p>为了环境搭建方便，用了docker，接下来会做成docker compose。</p>\r\n\r\n<p>先是拉取docker images：</p>\r\n\r\n<pre>\r\n<code>\r\nsudo docker pull openstf/stf:latest\r\nsudo docker pull sorccu/adb:latest\r\nsudo docker pull rethinkdb:latest\r\nsudo docker pull openstf/ambassador:latest</code></pre>\r\n\r\n<p>然后启动对应的服务：</p>\r\n\r\n<pre>\r\n<code>\r\nsudo docker run -d --name rethinkdb -v /Users/bojiang/Android/srv/rethinkdb:/data --net host rethinkdb rethinkdb --bind all --cache-size 8192 --http-port 8090\r\n\r\nsudo docker run -d --name adbd --privileged -v /Users/bojiang/Android/dev/bus/usb:/dev/bus/usb --net host sorccu/adb:latest\r\n\r\nsudo docker run -d --name stf --net host openstf/stf stf local --public-ip my_pc_ip --allow-remote</code></pre>\r\n\r\n<p>对于Mac，对于/srv/rethinkdb这样的路径docker会提示path does not exist，所以在本地创建相应的文件夹并指向它，否则启动不了。</p>\r\n\r\n<p><strong>在Mac上可以直接配置环境，或者可以用虚拟机装一个ubuntu来尝试docker。</strong></p>\r\n\r\n<pre>\r\n<code>#install locally on mac\r\n#if run locally without docker, please start rethinkdb first (would be better to create a folder then launch rethinkdb)\r\n\r\nbrew update &amp;&amp; brew install rethinkdb graphicsmagick zeromq protobuf yasm pkg-config\r\nnpm install -g stf</code></pre>\r\n\r\n<p>我用virtualbox装了ubuntu18.04，但是在virtualbox时需要配置usb设置，用于虚拟机识别连接的设备，如下图。对于usb3.0可以在官网下载安装 VirtualBox_Extension_Pack。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/02/20/virtualbox_openstf_usb.png\" style=\"height:618px; width:800px\" /></p>\r\n\r\n<p>在虚拟机设置中，需要选择网络为NAT并且配置端口转发，如下图。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/02/20/virtualbox_network_nat_stf.png\" style=\"height:587px; width:800px\" /></p>\r\n\r\n<p><strong>2) 连接远程机器</strong></p>\r\n\r\n<p>对于一台主机就算用了集线器也插不了多少设备，而且也会有使用场景类似有设备在远程主机上连接。</p>\r\n\r\n<p>在这种情况，可以配置成master-slave这样的方式，由一台主机做master，其他主机上连接的设备也可以在master被访问使用到。</p>\r\n\r\n<p>比如我现在有两个mac，一台ip是10.109.1.65（master，装好stf），一台ip是10.109.11.64（slave，无所谓装不装stf）。在slave上启动adb server，master则用stf provider连接到adb host和port。</p>\r\n\r\n<pre>\r\n<code>#如果是32左右的老版本adb，用下面这个\r\nadb -a -P 5037 fork-server server\r\n\r\n#我用的是40，上面的命令不可用了，可以用下面这个\r\nadb nodaemon server -a\r\n\r\n#再到master上运行stf provider\r\nstf provider --name Mac-Bo.local --min-port 7400 --max-port 7700 --connect-sub tcp://127.0.0.1:7114 --connect-push tcp://127.0.0.1:7116 --group-timeout 20000 --public-ip http://10.109.1.65 --storage-url http://10.109.1.65:7100/ --adb-host 10.109.11.64 --adb-port 5037 --vnc-initial-size 600x800 --allow-remote --screen-ws-url-pattern \"ws://10.109.1.65:&lt;%= publicPort %&gt;/\"</code></pre>\r\n\r\n<p>此时就能看到多台主机上连接的设备，并可以操作。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/02/21/stf_multiple_device_master_slave.png\" style=\"height:231px; width:800px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/02/28/stf_operation_page.png\" style=\"height:390px; width:800px\" /></p>\r\n\r\n<p><strong>3）nginx配置</strong></p>\r\n\r\n<p><strong>使用nginx来代理</strong>，避免了输入端口号，nginx.conf里加入下面内容试过可行，直接访问ip或者域名就可以打开stf页面。</p>\r\n\r\n<pre>\r\n<code># part of nginx.conf\r\nserver {\r\n    listen       80;\r\n    server_name  10.109.1.65;\r\n    location /static/app/ {\r\n        root   /opt/nodejs/lib/node_modules/stf/res/app/;\r\n        proxy_pass      http://127.0.0.1:7100;\r\n        access_log      on;\r\n        expires 30d;\r\n    }\r\n    location /static/app/data/ {\r\n        root   /opt/nodejs/lib/node_modules/stf/res/data/;\r\n        proxy_pass      http://127.0.0.1:7100;\r\n        access_log      on;\r\n        expires 30d;\r\n    }\r\n    location /static/app/status/ {\r\n        root   /opt/nodejs/lib/node_modules/stf/res/common/status/;\r\n        proxy_pass      http://127.0.0.1:7100;\r\n        access_log      on;\r\n        expires 30d;\r\n    }\r\n\r\n    location /static/app/build/entry/ {\r\n        root   /opt/nodejs/lib/node_modules/stf/res/build/entry/;\r\n        proxy_pass      http://127.0.0.1:7100;\r\n        access_log      on;\r\n        expires 30d;\r\n    }\r\n    location /static/app/build/ {\r\n        root   /opt/nodejs/lib/node_modules/stf/res/build/;\r\n        proxy_pass      http://127.0.0.1:7100;\r\n        access_log      on;\r\n        expires 30d;\r\n    }\r\n    location /static/app/browsers/ {\r\n        root   /opt/nodejs/lib/node_modules/stf/node_modules/stf-browser-db/dist/;\r\n        proxy_pass      http://127.0.0.1:7100;\r\n        access_log      on;\r\n        expires 30d;\r\n    }\r\n\r\n    location /static/app/appstores/ {\r\n        root   /opt/nodejs/lib/node_modules/stf/node_modules/stf-appstore-db/dist/;\r\n        proxy_pass      http://127.0.0.1:7100;\r\n        access_log      on;\r\n        expires 30d;\r\n    }\r\n\r\n    location /static/app/devices/ {\r\n        root   /opt/nodejs/lib/node_modules/stf/node_modules/stf-device-db/dist/;\r\n        proxy_pass      http://127.0.0.1:7100;\r\n        access_log      on;\r\n        expires 30d;\r\n    }\r\n    location /static/app/custom/ {\r\n        root   /opt/nodejs/lib/node_modules/stf/static/;\r\n        proxy_pass      http://127.0.0.1:7100;\r\n        access_log      on;\r\n        expires 30d;\r\n    }\r\n\r\n    location /static/logo/ {\r\n        root   /opt/nodejs/lib/node_modules/stf/res/common/logo/;\r\n        proxy_pass      http://127.0.0.1:7100;\r\n        access_log      on;\r\n        expires 30d;\r\n    }\r\n\r\n    location /res/common/logo/exports/favicon.ico {\r\n        root   /opt/nodejs/lib/node_modules/stf/res/common/logo/exports/favicon.ico;\r\n        proxy_pass      http://127.0.0.1:7100;\r\n        access_log      on;\r\n        expires 30d;\r\n    }\r\n    location /robots.txt {\r\n        root           /var/www/link_check/link_check/static/;\r\n        access_log      on;\r\n        log_not_found   off;\r\n    }\r\n    location /favicon.ico {\r\n        root            /var/www/link_check/link_check/static/;\r\n        access_log      off;\r\n        log_not_found   off;\r\n    }\r\n    location / {\r\n        proxy_pass          http://127.0.0.1:7100/;\r\n        proxy_redirect      off;\r\n        proxy_set_header    x-Real-IP        $remote_addr;\r\n        proxy_set_header    x-Forwarded-For  $proxy_add_x_forwarded_for;\r\n    }\r\n}</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4）问题解决</strong></p>\r\n\r\n<p>4.1） 主机无法访问到虚拟机的stf页面，但虚拟机中可以打开stf页面。</p>\r\n\r\n<p>在虚拟机中用docker启动stf时public-ip需要用主机的ip而不是虚拟机的ip，这样虚拟机和主机才都能访问到stf网页。</p>\r\n\r\n<p>4.2） 打开stf页面并且已经连接了手机，却总是显示disconnect。</p>\r\n\r\n<p>手机需要安装stfservice.apk。https://github.com/openstf/STFService.apk</p>\r\n\r\n<p>4.3)&nbsp; 当用npm install -g stf出现nnode-gyp rebuild相关的错误。</p>\r\n\r\n<p>使用该命令sudo npm install --unsafe-perm --verbose -g stf。https://github.com/openstf/stf/issues/61;&nbsp;https://github.com/openstf/stf/issues/995.</p>\r\n\r\n<p>4.4) 使用stf provider连接了其他主机的设备，可以使用，但是屏幕确实灰色一片，能操作就是看不到。</p>\r\n\r\n<p>在stf provider启动命令中加入--screen-ws-url-pattern的参数。目前在网上的资料都没咋看到用这个，不知道其他人怎么看到远程机的屏幕的。我是加上后就正常了。如上面的命令所示。</p>\r\n\r\n<p>4.5) 如果npm install -g stf时出现pyenv的错误提示：&#39;python2: command not found&#39;，那就执行这句命令后再次安装: pyenv shell 3.6.5 2.7.14. (https://github.com/pyenv/pyenv/issues/1159)</p>','2019-02-18 18:15:00.000000','2019-02-18 18:15:00.000000',2,1,1,1620),(65,'django本地runserver出现css加载404的问题解决','<p>在服务器上工作正常，使用了uwsgi和nginx。</p>\r\n\r\n<p>但是打算在本地调试时，却出现了css加载提示404的错误，正要修改UI的我一脸懵逼。</p>\r\n\r\n<p>最后在stackoverflow上看到有用的解决方式：</p>\r\n\r\n<p>https://stackoverflow.com/questions/7574759/django-cant-get-static-css-files-to-load</p>\r\n\r\n<p>&quot;&quot;&quot;</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">With Django 1.11.x+, you have to configure static files in&nbsp;<code>settings.py</code>&nbsp;as,</p>\r\n\r\n<pre style=\"margin-left:0px; margin-right:0px; text-align:left\">\r\n<code><span style=\"color:#303336; font-family:inherit; font-size:13px\">STATIC_URL </span><span style=\"color:#303336; font-family:inherit; font-size:13px\">=</span><span style=\"color:#303336; font-family:inherit; font-size:13px\"> </span><span style=\"color:#7d2727; font-family:inherit; font-size:13px\">&#39;/static/&#39;</span><span style=\"color:#303336; font-family:inherit; font-size:13px\"> </span><span style=\"color:#858c93; font-family:inherit; font-size:13px\"># the path in url</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">\r\n\r\nSTATICFILES_DIRS </span><span style=\"color:#303336; font-family:inherit; font-size:13px\">=</span><span style=\"color:#303336; font-family:inherit; font-size:13px\"> </span><span style=\"color:#303336; font-family:inherit; font-size:13px\">[</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">\r\n    os</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">.</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">path</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">.</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">join</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">(</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">BASE_DIR</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">,</span><span style=\"color:#303336; font-family:inherit; font-size:13px\"> </span><span style=\"color:#7d2727; font-family:inherit; font-size:13px\">&quot;static&quot;</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">),</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">\r\n</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">]</span></code></pre>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px; text-align:left\">and use it with static template tag,</p>\r\n\r\n<pre style=\"margin-left:0px; margin-right:0px; text-align:left\">\r\n<code><span style=\"color:#303336; font-family:inherit; font-size:13px\">{%</span><span style=\"color:#303336; font-family:inherit; font-size:13px\"> load static </span><span style=\"color:#303336; font-family:inherit; font-size:13px\">%}</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">\r\n</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">&lt;</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">link rel</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">=</span><span style=\"color:#7d2727; font-family:inherit; font-size:13px\">&quot;stylesheet&quot;</span><span style=\"color:#303336; font-family:inherit; font-size:13px\"> href</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">=</span><span style=\"color:#7d2727; font-family:inherit; font-size:13px\">&quot;{% static &#39;css/bootstrap.css&#39; %}&quot;</span><span style=\"color:#303336; font-family:inherit; font-size:13px\">&gt;</span></code></pre>\r\n\r\n<p>&quot;&quot;&quot;</p>\r\n\r\n<p>在settings中把STATIC_ROOT改成了上面的STATIFILES_DIRS，在base.html中{% load staticfiles %}改成了{% load static %}，debug改为true。然后再运行runserver就正常了，可以在本地调试UI了。</p>\r\n\r\n<p>file diff:</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">ML000606689:django-blog bojiang$ git diff bobjiang/settings.py\r\ndiff --git a/bobjiang/settings.py b/bobjiang/settings.py\r\nindex 2c341fd..5692175 100644\r\n--- a/bobjiang/settings.py\r\n+++ b/bobjiang/settings.py\r\n@@ -23,8 +23,8 @@ BASE_DIR = os.path.dirname(os.path.dirname(os.path.abspath(__file__)))\r\n SECRET_KEY = \'o30=mn+6+^s!*96$!*0nq6r-i0+_s)uw-+kz%&amp;-fdcw30pkfoj\'\r\n\r\n # SECURITY WARNING: don\'t run with debug turned on in production!\r\n-#DEBUG = True\r\n-DEBUG = False\r\n+DEBUG = True\r\n+#DEBUG = False\r\n\r\n ALLOWED_HOSTS = [\'*\',]\r\n\r\n@@ -137,7 +137,10 @@ USE_TZ = False\r\n # https://docs.djangoproject.com/en/2.0/howto/static-files/\r\n\r\n STATIC_URL = \'/static/\'\r\n-STATIC_ROOT = os.path.join(BASE_DIR, \'static\')\r\n+#STATIC_ROOT = os.path.join(BASE_DIR, \'static\')\r\n+STATICFILES_DIRS = [\r\n+    os.path.join(BASE_DIR, \"static\"),\r\n+]\r\n #STATIC_ROOT = \'/xxx/bobjiang/blog/static/\'\r\n\r\n MEDIA_ROOT = os.path.join(BASE_DIR, \'media\')</code></pre>\r\n\r\n<p>可用的settings.py:</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">\"\"\"\r\nDjango settings for bobjiang project.\r\n\r\nGenerated by \'django-admin startproject\' using Django 2.0.6.\r\n\r\nFor more information on this file, see\r\nhttps://docs.djangoproject.com/en/2.0/topics/settings/\r\n\r\nFor the full list of settings and their values, see\r\nhttps://docs.djangoproject.com/en/2.0/ref/settings/\r\n\"\"\"\r\n\r\nimport os\r\n\r\n# Build paths inside the project like this: os.path.join(BASE_DIR, ...)\r\nBASE_DIR = os.path.dirname(os.path.dirname(os.path.abspath(__file__)))\r\n\r\n\r\n# Quick-start development settings - unsuitable for production\r\n# See https://docs.djangoproject.com/en/2.0/howto/deployment/checklist/\r\n\r\n# SECURITY WARNING: keep the secret key used in production secret!\r\nSECRET_KEY = \'o30=mn+6+^s!*96$!*0nq6r-i0+_s)uw-+kz%&amp;-fdcw30pkfoj\'\r\n\r\n# SECURITY WARNING: don\'t run with debug turned on in production!\r\nDEBUG = True\r\n#DEBUG = False\r\n\r\nALLOWED_HOSTS = [\'*\',]\r\n\r\nAPPEND_SLASH = True\r\n\r\n# Application definition\r\n\r\nINSTALLED_APPS = [\r\n    \'haystack\',\r\n    \'blog.apps.BlogConfig\',\r\n    \'django.contrib.admin\',\r\n    \'django.contrib.auth\',\r\n    \'django.contrib.contenttypes\',\r\n    \'django.contrib.sessions\',\r\n    \'django.contrib.messages\',\r\n    \'django.contrib.staticfiles\',\r\n    \'comments\',\r\n    \'ckeditor\',\r\n    \'ckeditor_uploader\',\r\n    #\'xadmin\',\r\n    #\'crispy_forms\',\r\n]\r\n\r\nMIDDLEWARE = [\r\n    \'django.middleware.security.SecurityMiddleware\',\r\n    \'django.contrib.sessions.middleware.SessionMiddleware\',\r\n    \'django.middleware.common.CommonMiddleware\',\r\n    \'django.middleware.csrf.CsrfViewMiddleware\',\r\n    \'django.contrib.auth.middleware.AuthenticationMiddleware\',\r\n    \'django.contrib.messages.middleware.MessageMiddleware\',\r\n    \'django.middleware.clickjacking.XFrameOptionsMiddleware\',\r\n]\r\n\r\nROOT_URLCONF = \'bobjiang.urls\'\r\n\r\nTEMPLATES = [\r\n    {\r\n        \'BACKEND\': \'django.template.backends.django.DjangoTemplates\',\r\n        \'DIRS\': [os.path.join(BASE_DIR, \'templates\')],\r\n        \'APP_DIRS\': True,\r\n        \'OPTIONS\': {\r\n            \'context_processors\': [\r\n                \'django.template.context_processors.debug\',\r\n                \'django.template.context_processors.request\',\r\n                \'django.contrib.auth.context_processors.auth\',\r\n                \'django.contrib.messages.context_processors.messages\',\r\n                \'bobjiang.context_processors.device\'\r\n            ],\r\n        },\r\n    },\r\n]\r\n\r\nWSGI_APPLICATION = \'bobjiang.wsgi.application\'\r\n\r\n\r\n# Database\r\n# https://docs.djangoproject.com/en/2.0/ref/settings/#databases\r\n\r\nDATABASES = {\r\n    \'default\': {\r\n        \'ENGINE\': \'django.db.backends.mysql\',\r\n        \'NAME\': \'\',\r\n        \'USER\': \'\',\r\n        \'PASSWORD\': \'\',\r\n        \'HOST\': \'127.0.0.1\',\r\n        \'PORT\': 3306,\r\n        \'OPTIONS\': {\r\n            \'autocommit\': True,\r\n        },\r\n    }\r\n\r\n}\r\n\r\n\r\n# Password validation\r\n# https://docs.djangoproject.com/en/2.0/ref/settings/#auth-password-validators\r\n\r\nAUTH_PASSWORD_VALIDATORS = [\r\n    {\r\n        \'NAME\': \'django.contrib.auth.password_validation.UserAttributeSimilarityValidator\',\r\n    },\r\n    {\r\n        \'NAME\': \'django.contrib.auth.password_validation.MinimumLengthValidator\',\r\n    },\r\n    {\r\n        \'NAME\': \'django.contrib.auth.password_validation.CommonPasswordValidator\',\r\n    },\r\n    {\r\n        \'NAME\': \'django.contrib.auth.password_validation.NumericPasswordValidator\',\r\n    },\r\n]\r\n\r\n\r\n# Internationalization\r\n# https://docs.djangoproject.com/en/2.0/topics/i18n/\r\n\r\n#LANGUAGE_CODE = \'en-us\'\r\nLANGUAGE_CODE = \'zh-hans\'\r\n\r\nTIME_ZONE = \'Asia/Shanghai\'\r\n\r\nUSE_I18N = True\r\n\r\nUSE_L10N = True\r\n\r\nUSE_TZ = False\r\n\r\n\r\n# Static files (CSS, JavaScript, Images)\r\n# https://docs.djangoproject.com/en/2.0/howto/static-files/\r\n\r\nSTATIC_URL = \'/static/\'\r\n#STATIC_ROOT = os.path.join(BASE_DIR, \'static\')\r\nSTATICFILES_DIRS = [\r\n    os.path.join(BASE_DIR, \"static\"),\r\n]\r\n#STATIC_ROOT = \'/xxx/bobjiang/blog/static/\'\r\n\r\nMEDIA_ROOT = os.path.join(BASE_DIR, \'media\')\r\nMEDIA_URL = \'/media/\'\r\nCKEDITOR_UPLOAD_PATH = \'upload/\'\r\nCKEDITOR_IMAGE_BACKEND = \'pillow\'\r\nCKEDITOR_BROWSE_SHOW_DIRS = True\r\nCKEDITOR_RESTRICT_BY_USER = True\r\n\r\nCKEDITOR_CONFIGS = {\r\n    \'default\': {\r\n         \'toolbar\': ([\'div\', \'Source\', \'-\', \'Save\', \'NewPage\', \'Preview\', \'-\', \'Templates\'],\r\n                    [\'Cut\', \'Copy\', \'Paste\', \'PasteText\', \'PasteFromWord\', \'-\',\'Print\',\'SpellChecker\',\'Scayt\'],\r\n                    [\'Undo\', \'Redo\', \'-\', \'Find\', \'Replace\', \'-\', \'SelectAll\', \'RemoveFormat\',\'-\',\'Maximize\', \'ShowBlocks\', \'-\',\"CodeSnippet\", \'Subscript\', \'Superscript\'],\r\n                    [\'Form\', \'Checkbox\', \'Radio\', \'TextField\', \'Textarea\', \'Select\', \'Button\', \'ImageButton\',\r\n                     \'HiddenField\'],\r\n                    [\'Bold\', \'Italic\', \'Underline\', \'Strike\', \'-\'],\r\n                    [\'NumberedList\', \'BulletedList\', \'-\', \'Outdent\', \'Indent\', \'Blockquote\'],\r\n                    [\'JustifyLeft\', \'JustifyCenter\', \'JustifyRight\', \'JustifyBlock\'],\r\n                    [\'Link\', \'Unlink\', \'Anchor\'],\r\n                    [\'Image\', \'Flash\', \'Table\', \'HorizontalRule\', \'Smiley\', \'SpecialChar\', \'PageBreak\'],\r\n                    [\'Styles\', \'Format\', \'Font\', \'FontSize\'],\r\n                    [\'TextColor\', \'BGColor\'],\r\n \r\n                    ),\r\n        \'extraPlugins\': \'codesnippet\',\r\n    }\r\n}\r\n\r\n# haystack\r\nHAYSTACK_CONNECTIONS = {\r\n    \'default\': {\r\n        \'ENGINE\': \'blog.whoosh_cn_backend.WhooshEngine\',\r\n        \'PATH\': os.path.join(BASE_DIR, \'whoosh_index\'),\r\n    },\r\n}\r\nHAYSTACK_SEARCH_RESULTS_PER_PAGE = 5\r\nHAYSTACK_SIGNAL_PROCESSOR = \'haystack.signals.RealtimeSignalProcessor\'\r\n\r\n</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>','2019-02-26 14:04:00.000000','2019-02-26 14:10:00.000000',2,1,1,54),(66,'Appium运行前获取Desired Capabilities','<p><strong>对于android：</strong></p>\r\n\r\n<p>devicename: &nbsp; &nbsp;adb devices&nbsp;</p>\r\n\r\n<p>platformversion : &nbsp; adb shell getprop ro.build.version.release</p>\r\n\r\n<p>appPackage: 1) aapt dump badging 安装包地址 ;&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2) 不过我试过用adb logcat &gt; path,然后打开这个保存的文件搜索&lsquo;pkg&rsquo;或者&lsquo;package&rsquo;之类的关键词;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;3) 用ui automator view识别了当前页面，选择按钮查看属性也能看到package的信息。</p>\r\n\r\n<p>appActivity ： 打开app，然后输入命令adb shell &quot;dumpsys window | grep mCurrentFocus&quot;&nbsp; 。其实package也可以看到，在一起。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>对于ios：</strong></p>\r\n\r\n<p>bundleId: ideviceinstaller -l来获取手机安装app的bundleId</p>\r\n\r\n<p>udid: 1) 可以访问url获取：<a href=\"http://fir.im/udid\"><u>http://fir.im/udid</u></a>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2) 如果装了libimobiledevice可以连接手机后运行 idevice_id -l</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>appium官方的一些说明：http://appium.io/docs/en/writing-running-appium/caps/</p>','2019-02-28 17:50:00.000000','2019-02-28 17:50:00.000000',2,1,1,61),(67,'ruby在gem list/install时提示编码等错误的解决方法','<p>有时候在windows上用gem list时都会提示如下错误，很少情况，有一个同事遇到：</p>\r\n\r\n<p>C:/Ruby24-x64/lib/ruby/2.4.0/win32/registry.rb:910:in `encode&#39;: U+6709 to IBM437 in conversion from UTF-16LE to UTF-8 to IBM437 (Encoding::UndefinedConversionError)</p>\r\n\r\n<p>这个在修改C:/Ruby24-x64/lib/ruby/2.4.0/win32/registry.rb里，修改如下内容：</p>\r\n\r\n<pre>\r\n<code class=\"language-ruby\">#注释下一行\r\n#LOCALE = Encoding.find(Encoding.locale_charmap)\r\n#新增下一行\r\nLOCALE = Encoding::UTF_8</code></pre>\r\n\r\n<p>但如果又遇到了无法gem install的错误的时候，比如错误提示是：</p>\r\n\r\n<p>install bundler:1.16.2&nbsp; ERROR:&nbsp; While executing gem ... (Encoding::CompatibilityError)&nbsp; incompatible character encodings: UTF-8 and ASCII-8BIT</p>\r\n\r\n<p>那么修改两个文件就解决了：</p>\r\n\r\n<pre>\r\n<code class=\"language-ruby\">#C:\\Ruby22-x64\\lib\\ruby\\2.2.0\\win32\\registry.rb\r\n#LOCALE = Encoding.find(Encoding.locale_charmap)\r\nLOCALE = Encoding::UTF_8\r\nEncoding.default_internal = Encoding::UTF_8\r\n\r\n#C:\\Ruby22-x64\\lib\\ruby\\2.2.0\\resolv.rb\r\n#request[0,2] = [id].pack(\'n\')\r\nrequest[0,2] = [id].pack(\'U\')\r\n</code></pre>\r\n\r\n<p>&nbsp;</p>','2019-03-01 18:07:00.000000','2019-03-01 18:07:00.000000',2,1,1,254),(68,'openstf与appium集成以自动化操作远程手机设备','<p>在本文中会介绍如何自动化操作远程手机设备，可以用于自动化测试或者其他用途。</p>\r\n\r\n<p>stf可以统一管理和控制许多的手机设备，这比公司里分散管理要好得多，就像一个图书馆一样，也可以提高设备的使用率，不用谁请假了他借的手机就只有他回来才能被别人用，晚上设备也可以用于自动化测试，挺好。在前一篇文章中，已经记录了openstf的环境搭建和一些问题的解决方式：<a href=\"https://www.byincd.com/bobjiang/article-0164/\">https://www.byincd.com/bobjiang/article-0164/</a>。</p>\r\n\r\n<p>同事们可以在stf上借手机和归还手机，要用于自动化测试总不能用人工借了手机再跑测试，这个对于个人调试脚本时没有问题，但是如果是自动触发回归的话就很尴尬了。其实也不然，因为stf也有一些restful api，可以通过api占用设备，并将设备连接，在使用完了后释放设备资源供其他脚本和其他人使用。</p>\r\n\r\n<p>通过stf和appium集成在一起，可以同时达到管理手机和自动化操作手机。</p>\r\n\r\n<p>基本流程是：</p>\r\n\r\n<p>1） stf已经识别和连接本机手机和远程手机，远程手机是用stf provider加上adb来连接，相当于连接到搭建stf的服务器。</p>\r\n\r\n<p>2） 自动化脚本通过api查询可用设备，并占用该设备和获取连接ip+port，通过adb把远程手机连接到本机。</p>\r\n\r\n<p>3） 脚本运行或者自定义操作。</p>\r\n\r\n<p>4） 通过api释放资源。</p>\r\n\r\n<p>差不多像下面这样的，画得丑别介意。。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/03/07/stf_processon.png\" style=\"height:402px; width:800px\" /></p>\r\n\r\n<p>stf搭建好了后用这个去访问能看到设备的各种数据：your_ip/api/v1/devices/ ，比如：</p>\r\n\r\n<pre>\r\n<code class=\"language-json\">{\r\n	\"success\": true,\r\n	\"devices\": [{\r\n		\"abi\": \"arm64-v8a\",\r\n		\"airplaneMode\": false,\r\n		\"battery\": {\r\n			\"health\": \"good\",\r\n			\"level\": 85,\r\n			\"scale\": 100,\r\n			\"source\": \"usb\",\r\n			\"status\": \"charging\",\r\n			\"temp\": 26.9,\r\n			\"voltage\": 4.26\r\n		},\r\n		\"browser\": {\r\n			\"apps\": [{\r\n				\"id\": \"com.android.chrome/com.google.android.apps.chrome.Main\",\r\n				\"name\": \"Chrome\",\r\n				\"selected\": true,\r\n				\"system\": true,\r\n				\"type\": \"chrome\",\r\n				\"developer\": \"Google Inc.\"\r\n			}],\r\n			\"selected\": true\r\n		},\r\n		\"channel\": \"u3Kg7gUkA3Qy6DmKpCsZoHWFwio=\",\r\n		\"cpuPlatform\": \"exynos5\",\r\n		\"createdAt\": \"2019-03-06T01:32:42.744Z\",\r\n		\"display\": {\r\n			\"density\": 4,\r\n			\"fps\": 59,\r\n			\"height\": 2560,\r\n			\"id\": 0,\r\n			\"rotation\": 0,\r\n			\"secure\": true,\r\n			\"size\": 5.503512859344482,\r\n			\"url\": \"ws://10.109.1.65:7452\",\r\n			\"width\": 1440,\r\n			\"xdpi\": 522.5139770507812,\r\n			\"ydpi\": 537.3880004882812\r\n		},\r\n		\"manufacturer\": \"SAMSUNG\",\r\n		\"model\": \"SM-G920V\",\r\n		\"network\": {\r\n			\"connected\": false,\r\n			\"failover\": false,\r\n			\"roaming\": false,\r\n			\"subtype\": null,\r\n			\"type\": null\r\n		},\r\n		\"openGLESVersion\": \"3.1\",\r\n		\"operator\": null,\r\n		\"owner\": {\r\n			\"email\": \"bo.jiang@activenetwork.com\",\r\n			\"group\": \"O3yiHfGuQJmwtd2lqpOasA==\",\r\n			\"name\": \"bojiang\"\r\n		},\r\n		\"phone\": {\r\n			\"iccid\": null,\r\n			\"imei\": \"990004861204448\",\r\n			\"imsi\": null,\r\n			\"network\": \"UNKNOWN\",\r\n			\"phoneNumber\": null\r\n		},\r\n		\"platform\": \"Android\",\r\n		\"presenceChangedAt\": \"2019-03-06T01:41:15.949Z\",\r\n		\"present\": true,\r\n		\"product\": \"zerofltevzw\",\r\n		\"provider\": {\r\n			\"channel\": \"WbFbnjfcTxOJKAxCTVfqew==\",\r\n			\"name\": \"Mac-mini.local\"\r\n		},\r\n		\"ready\": true,\r\n		\"remoteConnect\": false,\r\n		\"remoteConnectUrl\": null,\r\n		\"reverseForwards\": [],\r\n		\"sdk\": \"21\",\r\n		\"serial\": \"03157df36144d40d\",\r\n		\"status\": 3,\r\n		\"statusChangedAt\": \"2019-03-06T01:41:15.949Z\",\r\n		\"usage\": \"automation\",\r\n		\"usageChangedAt\": \"2019-03-06T01:41:24.385Z\",\r\n		\"version\": \"5.0.2\",\r\n		\"using\": true\r\n	}]\r\n}</code></pre>\r\n\r\n<p>当present为true和using为false时就可以确定设备可用，占用该设备后，再次取设备json可以看到remoteConnectUrl，这个地址就可以用于adb的连接。就是resetful api的get/post/put/delete行为，就可以满足我们的需要了。然后就可以指定对应设备的desired capability便可用appium来操作手机，和本机调试差不多了。</p>\r\n\r\n<p>api的作用可以参考官方的说明文档: <a href=\"https://github.com/openstf/stf/blob/master/doc/API.md\">https://github.com/openstf/stf/blob/master/doc/API.md</a></p>\r\n\r\n<p>api的一些使用可以参考我在github写过的python项目：<a href=\"https://github.com/bobjiangps/stf_appium_python_sample\">https://github.com/bobjiangps/stf_appium_python_sample</a></p>\r\n\r\n<p>比如：</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">class StfDevices:\r\n\r\n    def __init__(self, ip):\r\n        self.ip = ip\r\n        self.prefix = \"http://\"\r\n        self.device_suffix = \"/api/v1/devices\"\r\n        self.user_device_suffix = \"/api/v1/user/devices\"\r\n        self.token = \"951cfcdf4bc045849f55e810d863fbecaf01b07b54cf49879b573a77a8c389f4\"\r\n        self.device_url = self.prefix + self.ip + self.device_suffix\r\n        self.user_device_url = self.prefix + self.ip + self.user_device_suffix\r\n\r\n    def __get_all_devices_info(self):\r\n        headers = {\"Authorization\": \"Bearer \" + self.token}\r\n        result = requests.get(self.device_url, headers=headers)\r\n        return result\r\n\r\n    def count_available_devices(self):\r\n        all_devices = self.__get_all_devices_info()\r\n        available_devices = []\r\n        if all_devices.status_code == 200:\r\n            devices_json = json.loads(all_devices.text)\r\n            if devices_json[\"success\"]:\r\n                for d in devices_json[\"devices\"]:\r\n                    if d[\"present\"] == True and d[\"using\"] == False:\r\n                        available_devices.append(d)\r\n                print(\"%d devices available for you to use\" % len(available_devices))\r\n                return len(available_devices), available_devices\r\n            else:\r\n                print(\"failed to get devices info\")\r\n        else:\r\n            print(\"wrong status: %d\" % all_devices.status_code)</code></pre>\r\n\r\n<p>&nbsp;</p>','2019-03-07 15:05:00.000000','2019-03-07 15:05:00.000000',2,1,1,722),(69,'我认为的自动化测试的几个层次','<p>从下往上，从易到难的话，我觉得是：</p>\r\n\r\n<p>1. 自动化操作，按照预定的逻辑来检验期望的结果，操作网页元素或者软件控件。也可以分为录制和独立脚本，设计的脚本还可以根据封装重用数据驱动关键字驱动再分。</p>\r\n\r\n<p>2. 自动化流程。把整个流程都串起来，自动触发测试并进入下一阶段，比如devops，持续集成，持续交付。</p>\r\n\r\n<p>3. 自动设计脚本程序，减少人为介入。可以根据提供的一些信息自动生成测试脚本用于回归等用途，需要涉及到AI的部分了，或许爬虫也有用，虽然少但仍需要人的主观意识的介入。</p>\r\n\r\n<p>4. 自动根据产品类型，运行情况，代码提交修改情况等决定该跑哪些测试脚本、调整测试范围、更新测试内容、分析测试结果。AI的进阶，可以完全脱离人力。</p>','2019-03-20 10:23:00.000000','2019-03-20 10:23:00.000000',2,2,2,18),(72,'常用linux命令','<p>查找文件：find /etc -name &#39;*srm*&#39;&nbsp;</p>\r\n\r\n<p>查找包含关键词在内容中的文件：grep -rn &quot;django&quot; /usr/local</p>\r\n\r\n<p>cpu使用最高的前三个：ps aux|head -1;ps aux|grep -v PID|sort -rn -k +3|head -3</p>\r\n\r\n<p>mem使用最高的前三个：&nbsp;ps aux|head -1;ps aux|grep -v PID|sort -rn -k +4|head -3</p>\r\n\r\n<p>文件夹下按大小排序列出前5个：&nbsp;du -s /usr/* &nbsp;|sort -nr | head -5&nbsp; （du -h 会有排序问题）</p>\r\n\r\n<p>找出大于5G的文件：sudo find / -type f -size +5G</p>\r\n\r\n<p>找出大于5G的文件并排序：sudo find / -type f -size +5G -print0 | xargs -0 du -h | sort -nr</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>当前memory使用率(linux)：free -m | awk &#39;NR==2{printf &quot;Memory Usage: %s/%sMB (%.2f%%)\\n&quot;, $3,$2,$3*100/$2 }&#39;</p>\r\n\r\n<p>当前memory使用率(macos)：&nbsp;top -l 1 -s 0 | grep PhysMem</p>\r\n\r\n<p>当前cpu空闲比(linux)：&nbsp;top -bn1 | grep Cpu | awk &#39;{printf &quot;CPU Load: %.2f\\n&quot;, $5}&#39;</p>\r\n\r\n<p>当前cpu使用率(macos):&nbsp;top -l 1 -s 0 | grep usage | awk -F&quot; &quot; &#39;{printf &quot;CPU load: %.2f\\n&quot;, $7}&#39;</p>\r\n\r\n<p>当前磁盘使用率(linux)：&nbsp;df -h | awk &#39;$NF==&quot;/&quot;{printf &quot;Disk Usage: %d/%dGB (%s)\\n&quot;, $2,$1,$5}&#39;</p>\r\n\r\n<p>当前磁盘使用率(linux)：&nbsp;df -h | awk &#39;$NF==&quot;/&quot;{printf &quot;Disk Usage: %d/%dGB (%s)\\n&quot;, $3,$2,$5}&#39;</p>','2019-05-21 14:54:00.000000','2019-05-21 14:54:00.000000',2,1,1,103),(73,'windows上git push出现access denied的解决办法','<p>目前可以这样：<br />\r\n1. 在windows上用git bash执行命令：ssh-keygen -t rsa -C &quot;your.email@example.com&quot; -b 4096<br />\r\n2. 在提示中，可以使用默认的地址存储，比如c:/Users/bob/.ssh/id_rsa，提示输入密码，我输入了123456<br />\r\n3. 然后切换到路径c:/Users/bob/.ssh/，执行命令：cat id_rsa.pub | clip<br />\r\n4. 登录到gitlab，在个人设置页面的ssh key的tab下，按ctrl v粘贴刚才命令中复制的内容，编辑title，保存这个key<br />\r\n5. 重新打开一个cmd，选择一个路径，执行git clone &mdash;recursive git@gitlab.dev.xxx.com:bbb/ccc.git，提示输入密码的话，就用刚才的密码123456，可以成功pull和push了</p>\r\n\r\n<p>https://docs.gitlab.com/ce/ssh/README.html</p>','2019-05-30 15:34:00.000000','2019-05-30 15:34:00.000000',2,1,1,44),(74,'用safari跑web自动化','<p>做web自动化时，大部分是在chrome上运行，毕竟支持最好。不过偶尔也会有其他主流浏览器的需求(Firefox, IE, Edge, Safari)。</p>\r\n\r\n<p>safari其实用得很少，因为最近在重写测试框架，在web的部分需要调试多种浏览器，就在这里再记录一下以免忘记。</p>\r\n\r\n<p>其他浏览器就是把浏览器的driver配置在PATH里就可以运行了，对于IE需要修改下注册表：</p>\r\n\r\n<pre>\r\n<code>For IE 11 only, you will need to set a registry entry on the target computer so that the driver can maintain a connection to the instance of Internet Explorer it creates. \r\nFor 64-bit Windows installations, the key is HKEY_LOCAL_MACHINE\\SOFTWARE\\Wow6432Node\\Microsoft\\Internet Explorer\\Main\\FeatureControl\\FEATURE_BFCACHE. \r\nPlease note that the FEATURE_BFCACHE subkey may or may not be present, and should be created if it is not present. \r\nImportant: Inside this key, create a DWORD value named iexplore.exe with the value of 0.</code></pre>\r\n\r\n<p>对于safari，就需要一个mac。safaridriver的路径在/usr/bin/safaridriver，不需要单独下载。</p>\r\n\r\n<p>启动safaridriver：safaridriver --enable；然后打开safari，选择reference-&gt;advanced，勾选&ldquo;Show Develop menu in menu bar&rdquo;，然后在菜单Develop中勾选Allow Remote Automation。</p>\r\n\r\n<p>现在就可以启动safari运行web测试了。</p>\r\n\r\n<p>对于其他浏览器的driver，我在github上也放了一份能用的，毕竟有时候因为有墙没法下载chromedriver，还可以从github上拉一份，地址是<a href=\"https://github.com/bobjiangps/selenium_browser_drivers\">https://github.com/bobjiangps/selenium_browser_drivers</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>','2019-06-11 11:04:00.000000','2019-06-11 11:04:00.000000',2,1,1,240),(75,'webdriver中模拟mobile browser的两种方式','<p>在开发或测试时，有时需要检验一下手机上的效果，在非正式发布时，可以使用chrome来模拟mobile browser。</p>\r\n\r\n<p>第一种方式是使用mobile emulation。chrome已经预定义了多种手机的参数和大小，可以使用指定的device name来模拟对应的手机浏览器来检验效果。比如：</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">#python\r\nfrom selenium import webdriver\r\n\r\nmobileEmulation = {\'deviceName\': \'iPhone X\'}\r\noptions = webdriver.ChromeOptions()\r\noptions.add_experimental_option(\'mobileEmulation\', mobileEmulation)\r\ndriver = webdriver.Chrome(options=chrome_options)\r\ndriver.get(\'https://www.byincd.com\')\r\ndriver.quit()</code></pre>\r\n\r\n<p>那么有哪些设备可以让我选择呢？其实在chrome的设置里已经标明了，也可以自行添加自己需要的类型参数。如下图。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/06/12/mobileemulation_devicelist.png\" style=\"height:451px; width:600px\" /></p>\r\n\r\n<p>第二种方式是启动浏览器时指定user agent，各种类型设备的user agent可以在这里查询：<a href=\"https://developers.whatismybrowser.com/\">https://developers.whatismybrowser.com/</a>&nbsp;。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">#python\r\nfrom selenium import webdriver\r\n\r\nchrome_options = webdriver.ChromeOptions()\r\nchrome_options.add_argument(\'--user-agent=Mozilla/5.0 (Linux; Android 9; SM-G960F Build/PPR1.180610.011; wv) AppleWebKit/537.36 (KHTML, like Gecko) Version/4.0 Chrome/74.0.3729.157 Mobile Safari/537.36\')\r\ndriver = webdriver.Chrome(chrome_options=chrome_options)\r\ndriver.get(\"https://www.byincd.com/\")\r\ndriver.quit()</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>当然，这两种都差不多了，可以结合在一起传递给webdriver，比如下面的是我以前写的：</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">#python\r\nclass SimulateMobileBrowserDriver:\r\n\r\n    @classmethod\r\n    def create(cls, device_name):\r\n        user_agents = {\r\n            \"iPhone\": \"Mozilla/5.0 (iPhone; CPU iPhone OS 12_2 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/12.1 Mobile/15E148 Safari/604.1\",\r\n            \"Android\": \"Mozilla/5.0 (Linux; Android 9; SM-G960F Build/PPR1.180610.011; wv) AppleWebKit/537.36 (KHTML, like Gecko) Version/4.0 Chrome/74.0.3729.157 Mobile Safari/537.36\",\r\n            \"iPad\": \"Mozilla/5.0 (iPad; CPU OS 12_2 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/12.1 Mobile/15E148 Safari/604.1\"\r\n        }\r\n        device_metrics = {\r\n            \"iPhone\": {\"width\": 360, \"height\": 640},\r\n            \"Android\": {\"width\": 360, \"height\": 640},\r\n            \"iPad\": {\"width\": 768, \"height\": 1024},\r\n        }\r\n        if device_name in user_agents.keys():\r\n            mobile_emulation = {\"deviceMetrics\": device_metrics[device_name], \"userAgent\": user_agents[device_name]}\r\n            print(mobile_emulation)\r\n        else:\r\n            mobile_emulation = {\"deviceName\": device_name}\r\n        chrome_options = webdriver.ChromeOptions()\r\n        chrome_options.add_experimental_option(\"mobileEmulation\", mobile_emulation)\r\n        return webdriver.Chrome(options=chrome_options)</code></pre>\r\n\r\n<p>&nbsp;</p>','2019-06-12 15:11:00.000000','2019-06-12 15:11:00.000000',2,1,1,385),(76,'阿里云更新免费ssl证书用于https','<p>去年的ssl证书快过期了，这里会记录一下之后用到的更新操作。免费的都是1年的，于是需要每年更新一次。</p>\r\n\r\n<p>登录阿里云，选择左上角按钮 产品与服务 -&gt; 云盾 -&gt; SSL证书，点击购买证书，在新的页面中选择&ldquo;免费性DV SSL&rdquo;，这里能看到免费的一年期限的Symantec可供选择，其他的对于个人来说都很贵。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/07/01/aliyun_ssl_free.png\" style=\"height:321px; width:600px\" /></p>\r\n\r\n<p>部分收费的证书可以续费，对于免费型的证书则只能重新购买和部署。</p>\r\n\r\n<p>阿里云里也有续费相关的说明：<a href=\"https://help.aliyun.com/document_detail/28544.html?spm=5176.2020520163.cas.13.199056a786YNuj\">https://help.aliyun.com/document_detail/28544.html</a></p>\r\n\r\n<p>在拿到新证书后，可以放在服务器，并更新服务器配置，阿里云也有相应的文章，跟实际的差别不大。<a href=\"https://help.aliyun.com/knowledge_detail/95505.html?spm=5176.2020520163.cas.11.199056a786YNuj\">https://help.aliyun.com/knowledge_detail/95505.html</a></p>\r\n\r\n<p>我用的nginx，则在/etc/nginx/site-available/default中更新类似下面的内容：</p>\r\n\r\n<pre>\r\n<code class=\"language-nginx\"># part of nginx configuration\r\nserver {\r\n	listen 443 ssl default_server;\r\n\r\n	index index.html index.htm index.nginx-debian.html;\r\n\r\n	server_name byincd.com;\r\n       \r\n        ssl_certificate /your_path/xx.pem;  # the path of pem\r\n        ssl_certificate_key /your_path/xxx.key; # the path of key\r\n        ssl_session_timeout 5m;\r\n        ssl_protocols TLSv1 TLSv1.1 TLSv1.2;\r\n        ssl_ciphers AESGCM:ALL:!DH:!EXPORT:!RC4:+HIGH:!MEDIUM:!LOW:!aNULL:!eNULL;\r\n        ssl_prefer_server_ciphers on;         \r\n\r\n	location / {\r\n                index index.php index.html index.htm;\r\n                try_files $uri $uri/ /index.php index.php;\r\n	}\r\n    ....\r\n    ....\r\n}</code></pre>\r\n\r\n<p>&nbsp;</p>','2019-07-01 17:06:00.000000','2019-07-01 17:06:00.000000',2,1,1,287),(77,'机器学习(一)之KNN最近邻算法','<p>最近邻算法(k-Nearest Neighbor，KNN)或许是机器学习算法中最简单最容易理解的一种。它的思路是通过已被标注过的数据集，来判断新数据的类别，数据集的特征值是可以量化的，并且是有明确的标签，通过计算距离来选取K个跟新数据最近的数据，用最多的类型来确定新数据的类型。</p>\r\n\r\n<p>类似下面这张从bing搜索出来的图所示：</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/08/01/knn_explain_bing.png\" style=\"height:263px; width:300px\" /></p>\r\n\r\n<p>KNN是需要历史数据的，越多越详细那么判断就会越准确。数据集的特征值需要量化，或者可以转换(比如独热编码)。新数据会由它的特征值来计算它本身的位置，那么周围最近的已知数据则能描述它可能的类型。可以理解为物以类聚人以群分。(当然对于一些特殊数据，就像椰子树长在高纬度，虽然有可能，但是KNN对这种的就显得比较无力)</p>\r\n\r\n<p><var><span style=\"font-size:12px\">优点：精度高，对异常值不敏感，无数据输入假定。</span></var></p>\r\n\r\n<p><var><span style=\"font-size:12px\">缺点：计算复杂度高，空间复杂度高</span></var></p>\r\n\r\n<p><var><span style=\"font-size:12px\">适用数据范围：数值型和标称型</span></var></p>\r\n\r\n<p>比如我想判断一个程序运行后的错误类型。先载入数据：</p>\r\n\r\n<pre>\r\n<code># environment, browser, pass_rate, duration, error_type\r\nimport pandas as pd\r\nimport os\r\n\r\nfile_path = os.path.join(os.getcwd(), \"data\", \"execution_history.csv\")\r\nhistory_data = pd.read_csv(file_path)\r\nlabels = history_data[\"error_type\"]</code></pre>\r\n\r\n<p>对于environment, browser这种文本型数据，可以将其转换为数据型。对于互斥型，比如男性或者女性，这种可以用0和1来代替；对于有序关系的比如尺寸大小的，可以用1，2，3之类代替。对于平级的离散的数据，可以采用独热编码(on-hot encoding), 意思是使用N位状态寄存器来对N个状态进行编码。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\"># covert environment and browser\r\nhistory_data = pd.get_dummies(history_data, columns=[\'env\'], prefix_sep=\'_\')\r\nhistory_data = pd.get_dummies(history_data, columns=[\'browser\'], prefix_sep=\'_\')</code></pre>\r\n\r\n<p>这里又会出现另一个需要注意的地方。当browser之类被转换为数值，则会是0，1之类。对于duration这种数据，可能是几百秒甚至更大的数字，在计算距离时，duration就会起到决定性的作用，但是实际情况duration和其他条件是共同影响结果的，是平级的判断标准，因此这里需要将duration做归一化处理。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\"># normalize duration\r\n# (x-min)/(max-min)\r\nmin_duration = history_data[\"duration\"].min()\r\nmax_duration = history_data[\"duration\"].max()\r\nif min_duration == max_duration:\r\n    history_data[\"new_duration\"] = history_data[\"duration\"].apply(lambda x: 1)\r\nelse:\r\n    history_data[\"new_duration\"] = history_data[\"duration\"].apply(lambda x: (x-min_duration)/(max_duration - min_duration))</code></pre>\r\n\r\n<p>计算距离并选择K个最近目标出现次数最多的类型：</p>\r\n\r\n<pre>\r\n<code># load new data and compute\r\n# distance formula: ((x1-x2)**2+(y1-y2)**2+...)**0.5\r\n\r\nnew_data = pd.read_csv(os.path.join(os.getcwd(), \"data\", \"new_data.csv\"))\r\n# convert data as well\r\nnew_data = pd.get_dummies(new_data, columns=[\'env\'], prefix_sep=\'_\')\r\nnew_data = pd.get_dummies(new_data, columns=[\'browser\'], prefix_sep=\'_\')\r\nmin_duration = new_data[\"duration\"].min()\r\nmax_duration = new_data[\"duration\"].max()\r\nif min_duration == max_duration:\r\n    new_data[\"new_duration\"] = new_data[\"duration\"].apply(lambda x: 1)\r\nelse:\r\n    new_data[\"new_duration\"] = new_data[\"duration\"].apply(lambda x: (x-min_duration)/(max_duration - min_duration))\r\nnew_data.drop(columns=[\"duration\"], inplace=True)\r\n# check the nearest 3 data\r\nknn_columns = new_data.columns.values\r\nfor seq in range(len(new_data)):\r\n    error = new_data.iloc[seq]\r\n    for index, row in history_data.iterrows():\r\n        sum = 0\r\n        for column in knn_columns:\r\n            sum += math.pow(getattr(row, column) - error[column], 2)\r\n        distance.append(math.sqrt(sum))\r\n        history_data.loc[index, \"distance\"] = math.sqrt(sum)\r\n    history_data = history_data.sort_values(by=[\"distance\"])\r\n    predict_top = history_data.iloc[:3][\"error_type\"]\r\n    new_data.loc[seq, \"predict_error\"] = pd.value_counts(predict_top).index[0]\r\nnew_data.to_csv(os.path.join(os.getcwd(), \"data\", \"new_data_predict.csv\"))</code></pre>\r\n\r\n<p>然后在新文件new_data_predict.csv中就可以看到结果了。</p>','2019-08-01 16:56:00.000000','2019-08-01 16:56:00.000000',2,1,1,223),(78,'机器学习(二)之逻辑回归','<p>逻辑回归(Logistic Regression)是我看的书《机器学习实战》里讲解的第四种算法了，不过这是我在工作中尝试的第二种。因为knn有相当的计算复杂度，需要耗费一定时间，对我正在做的web服务来说会影响响应时间，于是尝试了新的算法。</p>\r\n\r\n<p>逻辑回归是一种比较经典的分类方法，可以看做二分法，将结果分为0/1或者是/否，在训练好回归系数后，则可以将当前数据转换为结果，而不需要大的计算量。可以将部分计算量做预处理比如训练，在实际数据中则只需要比较少的转换和计算代价。</p>\r\n\r\n<p><span style=\"font-size:12px\"><var>优点：计算代价不高</var></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><var>缺点：对特殊数据敏感；在不同的区间里分类精度可能不高</var></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><var>适用数据范围：数值型和标称型</var></span></p>\r\n\r\n<p>在逻辑回归中有几个比较重要的概念：</p>\r\n\r\n<p><strong>1）Sigmoid函数</strong></p>\r\n\r\n<p>在我理解来看，逻辑回归和线性回归有比较大的相似处，但由于逻辑回归是需要输出分类，那么在数值的处理上就需要一个转换，sigmoid就在这里产生作用。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/08/26/image.png\" style=\"height:128px; width:400px\" /></p>\r\n\r\n<p>由上图可见，数值始终在0和1之间，则两者之间就有分界线，并可以确定二分类的具体类别，大于0.5则为1类，小于0.5则为0类。（当然这个S曲线的坡度在靠近中间的位置起伏较大，这里的数据比较敏感，而在两段的位置，概率变化很小，变量的值的变化对其影响也很小）</p>\r\n\r\n<p><strong>2）梯度</strong></p>\r\n\r\n<p>逻辑回归是梯度上升。上升和下降的区别在于：最小化损失函数，用梯度下降；最大化似然函数，用梯度上升。</p>\r\n\r\n<p>对于一堆数据，谁也不知道极值在哪，那么就一点点的试探，每次调整方向和步长，直到满足条件。</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2019/08/26/image_yEQhD68.png\" style=\"height:392px; width:612px\" /></p>\r\n\r\n<p>我觉得如果不看值的话，可以这样理解：在一个小黑屋里，找一个门，那么我会一步一步的试探，碰壁就换个方向，或者下次小心点伸脚少一点，直到找到为止。</p>\r\n\r\n<p><strong>3）回归</strong></p>\r\n\r\n<p>毕竟名字里也有个回归嘛。。回归意味着我会重复的调整，通过梯度上升算法反复运算直到找到最佳参数。</p>\r\n\r\n<p>最佳参数的计算公式是：</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/08/26/image_DeE50Ga.png\" style=\"height:49px; width:250px\" /></p>\r\n\r\n<p>也可以看做：w = w + 调节因子*回归系数。</p>\r\n\r\n<p>在训练时，每次计算都会与实际的值做对比，以确定误差，那么这个误差会帮助我们调整每一次的回归系数（也可以看出pandas以及numpy里矩阵计算的重要性）。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/08/26/image_KK31Kz1.png\" style=\"height:108px; width:500px\" /></p>\r\n\r\n<p>比如我可以设定迭代1000次。（当然这种方式的值很难称为最佳系数，是否是极值或者是否已经过了都不确定）</p>\r\n\r\n<pre>\r\n<code class=\"language-python\"># set iteration\r\ndef asc(data_mat, label_mat, step_size=0.001, max_iter=1000):\r\n    data_mat_np = np.mat(data_mat)\r\n    label_mat_np = np.mat(label_mat).transpose()\r\n    m, n = np.shape(data_mat_np)\r\n    weights = np.ones((n, 1))\r\n    for _ in range(max_iter):\r\n        h = sigmoid(data_mat_np * weights)\r\n        error = label_mat_np - h\r\n        weights = weights + step_size * data_mat_np.transpose() * error\r\n    return weights.getA()</code></pre>\r\n\r\n<p>比较好的方式则是设定具体条件，在我看来，第一次最好人为的关注一下，否则可能一直无法停止循环；另外需要注意的是，当误差又变大时并不意味着前一个值就是极值，因为可能只是其中一个波峰，而下一个波峰或许更高。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\"># set target and timeout\r\ndef asc_with_target(data_mat, label_mat, step_size=0.001, target=0.9, timeout=3600):\r\n    data_mat_np = np.mat(data_mat)\r\n    label_mat_np = np.mat(label_mat).transpose()\r\n    m, n = np.shape(data_mat_np)\r\n    weights = np.ones((n, 1))\r\n    loop_count = 0\r\n    total = len(data_mat)\r\n    temp_match_rate = 0\r\n    interval = 0\r\n    start = time.time()\r\n    while True:\r\n        loop_count += 1\r\n        interval += 1\r\n        h = sigmoid(data_mat_np * weights)\r\n        error = label_mat_np - h\r\n        trained_result = []\r\n        for i in h:\r\n            trained_result.append(classify(i[0][0]))\r\n        compare_result = np.unique(np.array(trained_result) - np.array(label_mat), return_counts=True)\r\n        matched_index = compare_result[0].tolist().index(0)\r\n        matched_count = compare_result[1].tolist()[matched_index]\r\n        current_match_rate = matched_count / total\r\n        if current_match_rate &gt; target:\r\n            if temp_match_rate &gt; current_match_rate:\r\n                break\r\n        if interval &gt;= timeout:\r\n            interval = 0\r\n            end = time.time()\r\n            if end - start &gt;= timeout:\r\n                break\r\n        temp_match_rate = current_match_rate\r\n        weights = weights + step_size * data_mat_np.transpose() * error\r\n    return weights.getA()</code></pre>\r\n\r\n<p><strong>4）随机抽样</strong></p>\r\n\r\n<p>当数据的量级比较大时，比如亿，那么在训练时会消耗很大的计算量，这个可以用随机抽样来解决；而当新数据来时，可以采用增量的方式，不影响效果，也不会计算太多。</p>\r\n\r\n<p>---------------------------------------------------------</p>\r\n\r\n<p>在最终结果的计算时，往往会加上一个偏移量，比如设定X0=1，这是为了避免每次的回归都是从原点开始，而实际的数据类型分界线往往不会以原点出发来分隔。</p>\r\n\r\n<p>训练好回归系数后，最终结果的计算就变得比较简单了。不同的数据列分别乘以系数，再用sigmoid套一下即可。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/08/26/image_HyZwp87.png\" style=\"height:45px; width:400px\" /></p>','2019-08-26 15:56:00.000000','2019-08-26 15:56:00.000000',2,1,1,833),(79,'Levenshtein Distance编辑距离算法','<p>Levenshtein Distance又称编辑距离，是衡量两段字符的差异大小的一种方法，也可以看做从一个字符串转换到另一个字符串所需要的最少的操作数，并以此计算相似度。听说应用于拼写检查、论文查重、dna基因序列分析等，当然我没有这种用途，我在工作中因为需要预测bug，则需要匹配条件和匹配输出信息来确定是不是已有bug，于是用到了这种算法。之前也写过两篇关于机器学习的算法，就是用于预测错误类型的。</p>\r\n\r\n<p>对于字符串检查，则有三种操作：插入、删除、替换。每一种每一次代表了操作数加一。</p>\r\n\r\n<p>对于编辑距离算法，有个图描述了公式和条件。如下图。当然理解起来不方便，我也贴了其他图描述这个过程。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/10/21/levenstein_distance_formula.png\" style=\"height:147px; width:800px\" /></p>\r\n\r\n<p>比如比较cool和cold两个单词的相似程度和计算操作数。下图是初始化一个表，并给予每个字符一个序号。</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2019/10/21/image-20191021181647-1.png\" style=\"height:160px; width:121px\" /></p>\r\n\r\n<p>对于每一行每一列的一个位置，都会对应着两个字符串的两个字符，我们分别查看左边的值+1，上边的值+1，以及左上的值(相同则为加0，否则加1)。</p>\r\n\r\n<p>取这三个值的最小值。比如这个图可以演变为：</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2019/10/21/image.png\" style=\"height:209px; width:189px\" />&nbsp;&nbsp;<img src=\"/media/upload/Bo/2019/10/21/image_2fr6zAn.png\" style=\"height:208px; width:187px\" />&nbsp;&nbsp;<img src=\"/media/upload/Bo/2019/10/21/image_Vz6KMIc.png\" style=\"height:208px; width:189px\" />&nbsp;&nbsp;<img src=\"/media/upload/Bo/2019/10/21/image_0LfNMko.png\" style=\"height:209px; width:187px\" /></p>\r\n\r\n<p>每一个位置代表当前需要的操作数，比如&#39;coo&#39;与&#39;col&#39;的操作数为1。右下角的数字则为这两个字符串的操作数，即为2.</p>\r\n\r\n<p>相似度的计算公式则是1-(levenstein/max_length)或者(max_length-levenstein)/max_length，比如&#39;cool&#39;与&#39;cold&#39;的相似度为50%。</p>\r\n\r\n<p>肯定实际工作使用中不会有这么简单的情况，但原理差不多。对于python的话，还有个包可以帮助计算：fuzzywuzzy。</p>\r\n\r\n<p>以下是python代码，用于计算操作数的简单样例：</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">import numpy as np\r\n\r\ndef edit_distance(word1, word2):\r\n    len1 = len(word1)\r\n    len2 = len(word2)\r\n    dp = np.zeros((len1 + 1, len2 + 1))\r\n    for i in range(len1 + 1):\r\n        dp[i][0] = i\r\n    for j in range(len2 + 1):\r\n        dp[0][j] = j\r\n\r\n    for i in range(1, len1 + 1):\r\n        for j in range(1, len2 + 1):\r\n            delta = 0 if word1[i - 1] == word2[j - 1] else 1\r\n            dp[i][j] = min(dp[i - 1][j - 1] + delta, min(dp[i - 1][j] + 1, dp[i][j - 1] + 1))\r\n    print(dp)\r\n    return dp[len1][len2]\r\n\r\nprint(edit_distance(\"horse\", \"rose\"))</code></pre>\r\n\r\n<p>&nbsp;</p>','2019-10-21 18:31:00.000000','2019-10-21 18:31:00.000000',2,1,1,89),(80,'为Django网站增加访客记录功能','<p>搭建好自己的网站后呢，肯定会想要知道谁来看了，看了什么页面，看了多少次，还有限制各种条件查询。于是访客记录的功能对自己来说就显得比较重要了。</p>\r\n\r\n<p>也有现成的可以用，比如Google search console或者百度统计。不过百度统计这种并不能完全满足我的需求，少许访问没有记录，而且我想要的信息还差一点。于是打算自己做一个访客记录统计存入数据库。</p>\r\n\r\n<p>我打算记录的信息有：ip, 国家，城市，设备agent，访问页面，访问次数，当天第一次访问时间，当天最后一次访问时间，从哪里跳转过来。</p>\r\n\r\n<p>首先在models.py中新增visitor的类，如下：</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">class Visitor(models.Model):\r\n    ip = models.CharField(max_length=30)\r\n    region = models.CharField(max_length=1000, blank=True, null=True)\r\n    agent = models.CharField(max_length=1000)\r\n    page = models.CharField(max_length=100)\r\n    referer = models.CharField(max_length=500, blank=True, null=True)\r\n    views = models.PositiveIntegerField(default=0)\r\n    record_date = models.DateTimeField(default=timezone.now)\r\n    update_date = models.DateTimeField(default=timezone.now)\r\n\r\n    def increase_views(self):\r\n        self.update_date = timezone.now()\r\n        self.views += 1\r\n        self.save(update_fields=[\'views\', \'update_date\'])</code></pre>\r\n\r\n<p>然后需要执行python manage.py migrate来应用数据表的变动。这时查看数据库就能看到新的表包含了visitor类的信息作为列名。</p>\r\n\r\n<p>对于刚才上面列出的各种想记录的信息，其实在django传递的request里就有包含了。比如：</p>\r\n\r\n<p><span style=\"font-size:12px\">&nbsp;- request.META中的&#39;HTTP_X_FORWARDED_FOR&#39;或&#39;REMOTE_ADDR&#39;就包含了ip信息；</span></p>\r\n\r\n<p><span style=\"font-size:12px\">- request.META中的&#39;HTTP_REFERER&#39;就包含了从哪里跳转来的信息，当然直接访问就不存在这个key</span></p>\r\n\r\n<p><span style=\"font-size:12px\">- request.get_full_path()就是当前访问的页面。</span></p>\r\n\r\n<p><span style=\"font-size:12px\">- request.META中的&#39;HTTP_USER_AGENT&#39;就包含了设备agent的信息，可以看出访问者的设备、系统，以及查看是否爬虫。</span></p>\r\n\r\n<p><span style=\"font-size:12px\">- 访问量则是采用计数自增的方式更新值。</span></p>\r\n\r\n<p><span style=\"font-size:12px\">- 对于访问者国家和城市的定位，我采用了两种方式。一是自己配置maxmind的地理位置数据库，地址是http://dev.maxmind.com/geoip/geoip2/geolite2，需要下载相关数据文件到网站目录，然后下载一个python库用来查询数据： pip install geoip2, 这样本地处理地理位置会比较快，只是数据可能会过时需要偶尔更新一下数据文件。二是使用公共服务的api，比如我用了ipify(也可获取ip)，可以参考https://www.ipify.org/. 注册一个免费用户一个月可以有1000次免费查询。虽然数据不用自己更新，不过难免会慢一点。我是先本地查询，有异常再访问ipify的服务。</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>在了解了需要的信息从哪里获取后，就可以在views.py中添加相关的方法，并在需要记录的页面上调用这个方法即可。以下是我的代码：</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">def record_visit(request):\r\n    try:\r\n        if \'HTTP_X_FORWARDED_FOR\' in request.META:\r\n            current_ip = request.META.get(\'HTTP_X_FORWARDED_FOR\')\r\n        else:\r\n            current_ip = request.META.get(\'REMOTE_ADDR\')\r\n        if \"HTTP_USER_AGENT\" in request.META:\r\n            current_agent = request.META[\"HTTP_USER_AGENT\"]\r\n        else:\r\n            current_agent = \"no agent key in request\"\r\n        current_page = request.get_full_path()\r\n        today = timezone.now()\r\n\r\n        visitor_exist = Visitor.objects.filter(ip=str(current_ip), page=current_page, record_date__range=(today.date(), today.date() + timezone.timedelta(days=1)))\r\n        if visitor_exist:\r\n            current_visitor = visitor_exist[0]\r\n            current_visitor.increase_views()\r\n        else:\r\n            current_visitor = Visitor()\r\n            current_visitor.ip = current_ip\r\n            ip_exist = Visitor.objects.filter(ip=str(current_ip)).order_by(\'-id\')\r\n            generate_new_location = True\r\n            if ip_exist:\r\n                generate_new_location = False\r\n                temp_visitor = ip_exist[0]\r\n                if (today - temp_visitor.record_date).days &gt;= 7:\r\n                    generate_new_location = True\r\n                if temp_visitor.region:\r\n                    current_visitor.region = temp_visitor.region\r\n            if generate_new_location:\r\n                if current_ip not in [\"127.0.0.1\", \"localhost\"]:\r\n                    try:\r\n                        current_visitor.region = GeoIpHelper.get_location(current_ip)\r\n                    except Exception as e:\r\n                        print(\"error when get location from ipify, message: %s\" % str(e))\r\n            current_visitor.agent = current_agent\r\n            current_visitor.page = current_page\r\n            if \'HTTP_REFERER\' in request.META.keys():\r\n                temp_referer = request.META[\"HTTP_REFERER\"]\r\n                temp_host = request.get_host()\r\n                if temp_host not in temp_referer.split(\"/\"):\r\n                    current_visitor.referer = temp_referer\r\n            current_visitor.record_date = today\r\n            current_visitor.update_date = today\r\n            current_visitor.views = 1\r\n            current_visitor.save()\r\n    except Exception as e:\r\n        print(\"get error when record visitor, message: %s\" % str(e))</code></pre>\r\n\r\n<p>这里调用到了一个我自己定义的GeoIpHelper，代码如下：</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">class GeoIpHelper:\r\n\r\n    @classmethod\r\n    def get_ip(cls):\r\n        try:\r\n            ip = load(urlopen(\'https://api.ipify.org/?format=json\'))[\"ip\"]\r\n        except URLError:\r\n            ip = \"network error\"\r\n        return ip\r\n\r\n    @classmethod\r\n    def get_location(cls, ip=None):\r\n        if not ip:\r\n            ip = cls.get_ip()\r\n        try:\r\n            city_client = Reader(\"./utils/geoip2/GeoLite2-City.mmdb\")\r\n            response = city_client.city(ip)\r\n            if response.city.name:\r\n                location = \",\".join([response.country.iso_code, response.city.name])\r\n            else:\r\n                location = \",\".join([response.country.iso_code, \"\"])\r\n        except Exception as e:\r\n            print(\"fail to get location with geoip2: %s\" % str(e))\r\n            try:\r\n                api_key = \'replace your key here\'\r\n                api_url = \'https://geo.ipify.org/api/v1?\'\r\n                url = api_url + \'apiKey=\' + api_key + \'&amp;ipAddress=\' + ip\r\n                temp_region = loads(urlopen(url).read().decode(\'utf8\'))[\"location\"]\r\n                try:\r\n                    location = \",\".join([temp_region[\"country\"], temp_region[\"city\"]])\r\n                except [KeyError, ValueError]:\r\n                    location = temp_region\r\n            except URLError:\r\n                location = \"network error\"\r\n        return location</code></pre>\r\n\r\n<p>此时就已经完成了网站访客的记录啦。重新部署网站后每次打开页面，就能看到访客信息的更新了。</p>\r\n\r\n<p>后续可以用echarts或者highchart来画一些图表。</p>','2019-11-04 21:04:00.000000','2019-11-04 21:04:00.000000',2,1,1,99),(81,'openstf支持ios设备和问题解决','<p>(以下内容编辑中，未完成......)</p>\r\n\r\n<p>在这里主要介绍的是openstf支持ios设备。因为openstf原版是只支持Android设备，不过在实际工作中难免遇到有iOS设备的需求，因此需要做二次开发以达到两种平台设备的共同存在。</p>\r\n\r\n<p>本文介绍: <strong>1) 代码修改&nbsp; 2）问题解决</strong></p>\r\n\r\n<p>下图是支持了iphone8 Plus的截屏。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/11/08/openstf_iphone8p.png\" style=\"height:297px; width:400px\" /></p>\r\n\r\n<p><strong>1) 代码修改&nbsp;</strong></p>\r\n\r\n<p>已经写过两篇文章是介绍openstf了，包含了环境搭建和自动操作：<a href=\"https://www.byincd.com/bobjiang/article-0164/\">openstf环境搭建和问题解决</a>&nbsp;，<a href=\"https://www.byincd.com/bobjiang/article-0168/\">openstf与appium集成以自动化操作远程手机设备</a>&nbsp;。</p>\r\n\r\n<p>对于openstf的更改，之前已经有高手钻研过了并开放了源码：&nbsp;https://github.com/mrx1203/stf；他是修改了前端页面和后端逻辑，目前我只需要后端的支持，于是我在openstf原版最新代码(Sep 18, 2019)的基础上，按照这位高手的思路只修改了后端，提交到自己fork的代码中单独的分支里：https://github.com/bobjiangps/stf/tree/ios。</p>\r\n\r\n<p>目前可以启动，但是还是有点问题，我会一一解决并记录在这里；相关代码修改的说明会在之后更新。后续也会按照自己需要来修改前端。</p>\r\n\r\n<p><strong>2）问题解决</strong></p>\r\n\r\n<p>2.1）如果有二次开发本地编译时出现错误提示：&#39;Could not locate the bindings file ...&nbsp;zmp.node&#39; , 那么可以卸载stf所有并删除node_modules文件夹再重新安装：npm uninstall -g stf; rm -rf node_modules; npm install; npm link. 如果这样做还是出现了提示，我试过重新全局安装后再卸载，再本地安装就可以用了。</p>\r\n\r\n<p>2.2) 在连接了iphone并启动stf后，为iphone准备的过程中运行idevicescreenshot出现错误提示: &#39;Could not start screenshotr service! Remember that you have to mount the Developer disk image on your device if you want to use the screenshotr service.&#39; 那么可以检查iOS的版本是否在xcode的支持范围内，我有一个较新版本iOS的手机出现这种提示，换了较老版本的iOS的手机后不再出现错误提示，工作电脑上的xcode太老了还是版本9.2支持到iOS 11.2；另还有种方法，在&#39;/Applications/Xcode.app/Contents/Developer/Platforms/iPhoneOS.platform/DeviceSupport/&#39;中将最高能支持的版本文件夹复制出来，再命令为需要的iOS版本号，接着再运行类似&#39;ideviceimagemounter /Applications/Xcode.app/Contents/Developer/Platforms/iPhoneOS.platform/DeviceSupport/12.4.1/DeveloperDiskImage.dmg&nbsp; /Applications/Xcode.app/Contents/Developer/Platforms/iPhoneOS.platform/DeviceSupport/12.4.1/DeveloperDiskImage.dmg.signature&#39; 。</p>','2019-11-08 14:26:00.000000','2019-11-08 14:26:00.000000',2,1,1,58),(82,'python做web开发时uWSGI和nginx的作用和区别','<p>在web开发方面，我主要用python + django或者+ flask，在部署时我用到了uwsgi和nginx。</p>\r\n\r\n<p>为什么这两个一起用？为什么都在推荐这个组合？感觉有些重合啊。不过在查阅资料和实际使用中，也发现了两者的区别和公用的好处。</p>\r\n\r\n<p>uWSGI如其名，它是一个实现了uwsgi和WSGI协议的web服务器，可以响应python的web请求，处理request和response。</p>\r\n\r\n<p>nginx是一个高性能的http和反向代理的web服务器，类似apache。</p>\r\n\r\n<p>当然，像django之类的本身也带有一个http server，不过都是用来调试的，毕竟性能差。于是用uWSGI代替了django的内置server，在处理request时会有效得多。</p>\r\n\r\n<p>直接用uWSGI时也是可以访问的，但uWSGI在并发和资源处理上不太理想，于是nginx承担了这方面的责任。</p>\r\n\r\n<p>它们一起用就是双重保障，在性能功能安全上都能顾及。</p>\r\n\r\n<pre>\r\n<code>uWSGI：\r\n - 处理动态请求\r\n - 支持多进程，发挥多核效能\r\n - 提高并发请求的处理能力\r\n\r\nnginx:\r\n - 处理静态资源\r\n - 反向代理和负载均衡，提升安全性和性能表现\r\n\r\n\r\n若是uWSGI+django，uWSGI则是一个服务器；若是nginx+uWSGI+django，uWSGI则是一个中间件。\r\n如果有多台web服务器时，增加一个反向代理会比较有用；如果是单个web服务器，用不用nginx都可以，不过还是用上吧，没坏处。</code></pre>\r\n\r\n<p>整个过程可以是：通过反向代理服务器将http请求分发给web服务器，同时它也直接处理静态资源，web服务器关注在动态请求上，再由web服务器将请求发给web app处理。</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2019/11/15/image.png\" style=\"height:428px; width:251px\" /></p>\r\n\r\n<p><!--5f39ae17-8c62-4a45-bc43-b32064c9388a:--></p>','2019-11-15 17:01:00.000000','2019-11-15 17:01:00.000000',2,1,1,68),(83,'在centos上安装python3和配置虚拟环境','<p><strong>方法一：</strong></p>\r\n\r\n<p>下载python3.6.8:</p>\r\n\r\n<p>cd /tmp<br />\r\nwget https://www.python.org/ftp/python/3.6.8/Python-3.6.8.tar.xz</p>\r\n\r\n<p>解压python3.6.8:</p>\r\n\r\n<p>xz -d Python-3.6.8.tar.xz&nbsp;&nbsp;(if show command not found, run: yum install xz)<br />\r\ntar -xvf Python-3.6.8.tar</p>\r\n\r\n<p>编译:</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">cd Python-3.6.8\r\n./configure --prefix=/usr/local/python3.6 --enable-optimizations --with-ssl\r\nmake\r\nmake install  (if get error: \'zipimport.ZipImportError: can\'t decompress data; zlib not available\', run: yum install zlib-devel)</code></pre>\r\n\r\n<p>创建连接:&nbsp;</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">ln -s /usr/local/python3.6/bin/python3 /usr/bin/python3\r\nln -s /usr/local/python3.6/bin/pip3 /usr/bin/pip3\r\nnow you can run python3 in console. (if show error \'pip is configured with locations that require TLS/SSL, however the ssl module in Python is not available.\', run: yum install openssl-devel, then recompile)</code></pre>\r\n\r\n<p>安装virtualenv并创建虚拟环境&nbsp;</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">pip3 install virtualenv\r\nvirtualenv --no-site-packages venv  (if get error \'-bash: virtualenv: command not found\', run \'python3 -m virtualenv venv\' instead)</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>方法二：</strong></p>\r\n\r\n<p>安装相关的包</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">yum install zlib-devel bzip2-devel openssl-devel ncurses-devel sqlite-devel readline-devel tk-devel gcc make</code></pre>\r\n\r\n<p>下载python：</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">wget https://www.python.org/ftp/python/3.6.8/Python-3.6.8.tar.xz</code></pre>\r\n\r\n<p>解压和安装python3：</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">unxz Python-3.6.8.tar.xz\r\ntar -xvf Python-3.6.8.tar\r\ncd Python-3.6.8\r\n./configure prefix=/usr/local/python3\r\nmake &amp;&amp; make install</code></pre>\r\n\r\n<p>创建软链接：</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">ln -s /usr/local/python3/bin/python3 /usr/bin/python3</code></pre>\r\n\r\n<p>此时运行python3命令则是启动python 3.6.8</p>\r\n\r\n<p>安装pip3</p>\r\n\r\n<p>先安装一些环境：</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">yum -y install zlib-devel bzip2-devel openssl-devel ncurses-devel sqlite-devel readline-devel tk-devel gdbm-devel db4-devel libpcap-devel xz-devel</code></pre>\r\n\r\n<p>然后用setuptools安装pip并创建软链接：</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">wget --no-check-certificate  https://pypi.python.org/packages/source/s/setuptools/setuptools-19.6.tar.gz#md5=c607dd118eae682c44ed146367a17e26\r\ntar -zxvf setuptools-19.6.tar.gz\r\ncd setuptools-19.6\r\npython3 setup.py build\r\npython3 setup.py install</code></pre>\r\n\r\n<p>设置软链接</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">ln -s /usr/local/python3/bin/pip3 /usr/bin/pip3</code></pre>\r\n\r\n<p>此时可以用pip3 list命令</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>然后安装virtualenv，但这里需要多安装virtualenvwrapper以及配置.bashrc</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">pip3 install virtualenv \r\npip3 install virtualenvwrapper\r\nvim ~/.bashrc</code></pre>\r\n\r\n<p>在文末填入以下代码并保存</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">VIRTUALENVWRAPPER_PYTHON=/usr/local/python3/bin/python3 # 指定virtualenvwrapper执行的python版本 \r\nexport WORKON_HOME=$HOME/.virtualenvs # 指定虚拟环境存放目录，.virtualenvs目录名可自拟 \r\nsource /usr/local/python3/bin/virtualenvwrapper.sh # virtualenvwrapper.sh所在目录</code></pre>\r\n\r\n<p>保存文件，执行source ~/.bashrc</p>\r\n\r\n<p>当用virtualenv创建虚拟环境时，如果提示virtualenvwrapper could not find virtualenv in your path，那么再添加一个软链接:</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">ln -s /usr/local/python3/bin/virtualenv /usr/bin/virtualenv</code></pre>\r\n\r\n<p>然后就可以创建虚拟环境了</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">mkvirtualenv --python=/usr/bin/python3 venv --no-site-packages</code></pre>\r\n\r\n<p>需要注意的是venv不在当前路径下了，需要source /root/.virtualenvs/venv/bin/activate。当然也可以将整个虚拟环境的目录复制到某个地址然后直接执行source venv/bin/activate。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><!--5f39ae17-8c62-4a45-bc43-b32064c9388a:--></p>','2019-11-18 11:40:00.000000','2019-11-18 11:40:00.000000',2,1,1,50),(84,'解决github下载特别慢的方法','<p>在国内如果没有vpn，访问github简直慢得要了老命。每次clone和pull时就看着只有几k的速度欲哭无泪。</p>\r\n\r\n<p>不过也有办法可以提高下载速度。如下步骤：</p>\r\n\r\n<p>1. 用浏览器访问https://www.ipaddress.com/，分别检查github.com和github.global.ssl.fastly.net的IP地址。可以直接访问如下两个url：<a href=\"https://github.com.ipaddress.com/\">https://github.com.ipaddress.com/</a>&nbsp;，&nbsp;<a href=\"https://fastly.net.ipaddress.com/github.global.ssl.fastly.net\">https://fastly.net.ipaddress.com/github.global.ssl.fastly.net</a>&nbsp;.</p>\r\n\r\n<p>2. 记录下页面上的ip地址，比如：</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2019/11/20/image.png\" style=\"height:140px; width:238px\" /></p>\r\n\r\n<p>3. 打开hosts文件sudo vim /etc/hosts，添加刚才的IP地址和域名，比如：</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">\r\n140.82.114.4 github.com\r\n199.232.5.194 github.global.ssl.fastly.net</code></pre>\r\n\r\n<p>4. 刷新DNS(做不做都可以)</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">sudo killall -HUP mDNSResponder</code></pre>\r\n\r\n<p>此时git pull就看到速度达到了几百K，满足了。</p>\r\n\r\n<p>不过可能过段时间又不可用了，那么就重复上述步骤，在hosts文件中更新一下IP。</p>','2019-11-20 22:06:00.000000','2019-11-20 22:06:00.000000',2,2,1,191),(85,'python中的惰性计算','<p>惰性计算(Lazy Evaluation)是指仅在需要执行的时候才计算表达式的值，惰性计算是一种好的编码习惯，可以带来如下好处：</p>\r\n\r\n<p>1. 节省计算资源，可提升性能表现。</p>\r\n\r\n<p>比如a和b都是一个表达式(条件，计算，对比等)。在python中一个判断&#39;if a and b&#39;，当a为false时就不会再计算b的值；同理对于&#39;if a or b&#39;, 当a为true时则不会再计算b。</p>\r\n\r\n<p>那么对于or的情况我们应该把值很可能为真的表达式放在前面，对于and的情况我们应该把值很可能为假的情况放在前面，这样在大多数情况下，就只会计算前一个表达式，也就节省了计算资源。这在循环很多的时候会显得比较有效。</p>\r\n\r\n<p>下图是一个例子，我在jupyter里运行的，可以看出第二种耗时为第一种的85%。</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2019/11/26/image.png\" style=\"height:328px; width:400px\" /></p>\r\n\r\n<p>2. 使无限循环的数据结构成为可能。</p>\r\n\r\n<p>python中使用惰性计算比较经典的就是生成器(generator)，比如只有在需要时才会通过yield计算下一步，那么使用生成器对于超级多的循环数甚至无限循环都不会占用多少资源和空间。</p>\r\n\r\n<p>比如：</p>\r\n\r\n<pre>\r\n<code class=\"language-python\"># this is a list, create all 5000000 x/2 values immediately, uses []\r\nlis = [x/2 for x in range(5000000)]\r\n\r\n# this is a generator, creates each x/2 value only when it is needed, uses ()\r\ngen = (x/2 for x in range(5000000)) </code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<pre>\r\n<code class=\"language-python\"># with yield\r\n\r\ndef divide(n):\r\n    num = 0\r\n    while num &lt; n:\r\n        new_num = num / 2\r\n        yield new_num\r\n        num += 1\r\n        print(new_num)\r\n\r\nx=divide(5000000)\r\nprint(x)\r\nfor seq in range(5):\r\n    next(x)\r\n\r\n# output:\r\n# &lt;generator object divide at 0x7fe08078f0a0&gt;\r\n# 0.0\r\n# 0.5\r\n# 1.0\r\n# 1.5</code></pre>\r\n\r\n<p>&nbsp;</p>','2019-11-26 16:46:00.000000','2019-11-26 16:46:00.000000',2,1,1,54),(86,'Vue在做数字更新动画时增加逗号格式化','<p>在使用Vue时，刚好遇到需要一个数字更新的动画效果，比如刷新出页面了后，一些数字统计会呈现自增的动画效果，比直接显示一个数字好看。</p>\r\n\r\n<p>可以使用animated-number-vue来帮助我实现这个效果。github链接是https://github.com/Leocardoso94/animated-number-vue.</p>\r\n\r\n<p>(下面是个类似功能的截图，没有放gif)</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2019/12/04/image_Ik7Hvcv.png\" style=\"height:150px; width:300px\" /></p>\r\n\r\n<p>不过最后始终只是一个数字，如果想要格式化数字呢。比如小数点保留两位，保持float，而我目前想要的则是每隔三个数字就添加一个逗号，就像2345787 -&gt; 2,345,787.</p>\r\n\r\n<p>可以用上formatValue属性指定具体的javascript方法来实现。(类似这样的插件有好几种，对应的属性名不一样。)</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2019/12/04/image_IYdfcGi.png\" style=\"height:150px; width:300px\" /></p>\r\n\r\n<p>把它官方的代码改了下，附在下面:</p>\r\n\r\n<pre>\r\n<code class=\"language-javascript\"># App.vue\r\n\r\n&lt;template&gt;\r\n  &lt;div id=\"app\"&gt;\r\n    &lt;h2&gt;Vue animation counter&lt;/h2&gt;\r\n    &lt;div id=\"wrapper\"&gt;\r\n      &lt;number\r\n        class=\"bold transition\"\r\n        :class=\"{scaleBig: scaleClass}\"\r\n        ref=\"number2\"\r\n        :from=\"numberFrom\"\r\n        :format=\"theFormat\"\r\n        animationPaused\r\n        :to=\"numberTo\"\r\n        :duration=\"duration\"\r\n        easing=\"Power4.easeOut\"\r\n        @complete=\"completed\"\r\n      /&gt;\r\n    &lt;/div&gt;\r\n    &lt;label&gt;To:&lt;/label&gt;\r\n    &lt;input type=\"number\" v-model=\"numberTo\"&gt;\r\n    &lt;div&gt;\r\n      &lt;button class=\"btn green\" @click=\"playAnimation\"&gt;Start&lt;/button&gt;\r\n      &lt;button class=\"btn\" @click=\"$refs.number2.pause()\"&gt;Pause&lt;/button&gt;\r\n      &lt;button class=\"btn blue\" @click=\"$refs.number2.restart()\"&gt;Restart&lt;/button&gt;\r\n    &lt;/div&gt;\r\n  &lt;/div&gt;\r\n&lt;/template&gt;\r\n\r\n&lt;script&gt;\r\nexport default {\r\n  name: \"App\",\r\n  data() {\r\n    return {\r\n      numberFrom: 0,\r\n      numberTo: 5000,\r\n      duration: 5,\r\n      scaleClass: false\r\n    };\r\n  },\r\n  methods: {\r\n    theFormat(number) {\r\n      //return number.toFixed(2);\r\n      return (number || 0).toString().replace(/(\\d)(?=(?:\\d{3})+$)/g, \"$1,\");\r\n    },\r\n    completed() {\r\n      console.log(\"Animation ends!\");\r\n      this.scaleClass = true;\r\n    },\r\n    playAnimation() {\r\n      console.log(\"Animation starts!\");\r\n      this.scaleClass = false;\r\n      this.$refs.number2.play();\r\n    }\r\n  }\r\n};\r\n&lt;/script&gt;\r\n\r\n&lt;style&gt;\r\n#app {\r\n  font-family: \"Avenir\", Helvetica, Arial, sans-serif;\r\n  -webkit-font-smoothing: antialiased;\r\n  -moz-osx-font-smoothing: grayscale;\r\n  text-align: center;\r\n  color: #2c3e50;\r\n  margin-top: 60px;\r\n}\r\n.bold {\r\n  font-weight: bold;\r\n  font-size: 25px;\r\n}\r\n.transition {\r\n  transition: all 0.3s ease-in;\r\n}\r\nlabel {\r\n  width: 100px;\r\n  display: inline-block;\r\n}\r\n.scaleBig {\r\n  font-size: 35px;\r\n}\r\n#wrapper {\r\n  width: 150px;\r\n  display: inline-block;\r\n  padding: 20px 0;\r\n  border-radius: 15px;\r\n  box-shadow: 0 3px 8px 0 rgba(0, 0, 0, 0.18);\r\n}\r\ninput {\r\n  display: inline-block;\r\n  margin: 10px;\r\n  padding: 10px;\r\n}\r\n.btn {\r\n  outline: none;\r\n  cursor: pointer;\r\n  -moz-appearance: none;\r\n  appearance: none;\r\n  -webkit-appearance: none;\r\n  border-radius: 5px;\r\n  color: #fff;\r\n  background-color: #7b68ee;\r\n  box-shadow: 0 3px 8px 0 rgba(65, 105, 225, 0.18);\r\n  display: inline-block;\r\n  border: 0;\r\n  padding: 10px 14px;\r\n  font-size: 14px;\r\n  transition: all 0.1s ease-in;\r\n  margin: 15px;\r\n}\r\n.green {\r\n  background-color: mediumseagreen;\r\n}\r\n.blue {\r\n  background-color: royalblue;\r\n}\r\n&lt;/style&gt;\r\n</code></pre>\r\n\r\n<pre>\r\n<code class=\"language-javascript\"># main.js\r\n\r\nimport Vue from \"vue\";\r\nimport VueNumber from \"vue-number-animation\";\r\nimport App from \"./App\";\r\n\r\nVue.use(VueNumber);\r\nVue.config.productionTip = false;\r\n\r\n/* eslint-disable no-new */\r\nnew Vue({\r\n  el: \"#app\",\r\n  components: { App },\r\n  template: \"&lt;App/&gt;\"\r\n});</code></pre>\r\n\r\n<pre>\r\n<code class=\"language-html\"># index.html\r\n\r\n&lt;!DOCTYPE html&gt;\r\n&lt;html&gt;\r\n\r\n&lt;head&gt;\r\n	&lt;meta charset=\"utf-8\"&gt;\r\n	&lt;meta name=\"viewport\" content=\"width=device-width,initial-scale=1.0\"&gt;\r\n	&lt;title&gt;CodeSandbox Vue&lt;/title&gt;\r\n&lt;/head&gt;\r\n\r\n&lt;body&gt;\r\n	&lt;div id=\"app\"&gt;&lt;/div&gt;\r\n&lt;/body&gt;\r\n\r\n&lt;/html&gt;</code></pre>\r\n\r\n<p>&nbsp;</p>','2019-12-04 17:34:00.000000','2019-12-04 17:34:00.000000',2,1,1,48),(87,'MAC上安装Kali过程记录','<p>我用的是MacBook Pro加Parallels Desktop。</p>\r\n\r\n<p>先到kali官网下载镜像文件：https://www.kali.org/downloads/ 我下载的是2019.4的版本。</p>\r\n\r\n<p>选择文件菜单-&gt;新建-&gt;选择kali镜像文件，勾选上安装前设定，这个时候弹出了虚拟机设置页面。</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2019/12/07/image.png\" style=\"height:250px; width:300px\" /></p>\r\n\r\n<p>我设定的是2个处理器，4g内存，30g硬盘空间，网络为共享，其他的基本是默认。</p>\r\n\r\n<p>点击继续，然后选择graphical install，然后设置主机名，域名(可以不填选择默认)，root密码(因为kali都是用root账户，反而没有普通账户，毕竟很多工具都是需要root权限)。</p>\r\n\r\n<p>之后到了磁盘分区，可以选择全部磁盘。</p>\r\n\r\n<p>(没完成，之后继续时再补充)</p>\r\n\r\n<p>&nbsp;</p>','2019-12-07 10:25:00.000000','2019-12-07 10:25:00.000000',2,2,2,10),(88,'ubuntu里自启动时未执行virtualenv的原因','<p>我的服务器上有几套python相关的环境，目前在用virtualenv创建虚拟环境以避免冲突，比如django用一套，jupyter用一套。</p>\r\n\r\n<p>自己登陆上去肯定就直接执行了类似source virenv/bin/activate的命令来启动相关的环境，不过我也不想每次重启后还需要手动操作一遍，于是在/etc/rc.local中添加了相关命令来启动不同的服务，那么每次重启后就可以直接进入相关页面浏览。</p>\r\n\r\n<p>不过现在遇到一个问题，我在rc.local中添加了对应的操作，重启后却未能生效。比如我会先切换到django的路径下(cd /home/test/django)，启动虚拟环境(source ./virenv/bin/activate)，启动uwsgi(uwsgi -i conf/uwsgi.ini，nginx已经配置好对应的)。但是重启后发现uwsgi并没有启动起来。</p>\r\n\r\n<p>经过排查后发现是因为rc.local的顶端有一句&quot;#!/bin/sh -e&quot;，而source的命令不能执行，于是修改为&quot;#!/bin/bash -e&quot;保存，再次重启就一切正常，不同的服务都启动起来了。</p>','2019-12-08 12:02:00.000000','2019-12-08 12:02:00.000000',2,1,1,48),(89,'Python爬虫(一)基础准则和基本概念','<p>爬虫、网络机器人、spider、crawler，都是一个东西，就是一些程序对目标进行有规律有目的性的自动的信息收集。当然实际上爬虫并不会真正去到目的地，但是会发送请求过去，并拿到回复，回复可能是空，也可能是html、json等。</p>\r\n\r\n<p>收集到的信息数据可被人为使用或者被其他程序再次筛选和整理。使用爬虫有很多场景，比如我在xx网有个会员，但我懒得一页页翻，于是我把账号信息给爬虫程序，爬虫自动在xx网上把我想要的漫画章节分批下载下来，我睡个觉起来就可以看漫画了；比如google的搜索引擎会抓取我在知乎上的新回答，可能过几天后我去google就能搜索到我当时回答的网页快照。</p>\r\n\r\n<p><span style=\"font-size:16px\"><strong>行为准则：</strong></span></p>\r\n\r\n<p>爬虫很有用，但也需要有一些准则，以免对自己和他人造成不好的影响。正所谓练武先练德，我们也需要了解什么该做，什么不该做，把专业技术应用在合理的地方，给自己提供便利，也不造成破坏。</p>\r\n\r\n<p><strong>1）遵循robots协议</strong>。robots.txt是一种存放于网站根目录下的ASCII编码的文本文件，它会告诉爬虫该网站中哪些是不能被获取的，哪些是可以被获取的，哪些爬虫被禁止。那么当我们看到这个文件后，应遵循里面的内容，不要再探寻更多；当然如果你建立了一个新网站，想要搜搜引擎来抓取，那么就放开限定。</p>\r\n\r\n<p><strong>2) 不要获取机密信息和私人信息</strong>。如果因为兴趣写了爬虫却抓取了别人的身份信息或者私密信件等，这个可是违法的，搞不好就被关进去被狱头大哥修理了。所以要尽量避免有这类型操作。就像我们也不想自己的个人信息满天飞吧，我也非常讨厌那些骚扰推销电话。至少自己不作恶。</p>\r\n\r\n<p><strong>3) 不要请求过多或过于频繁</strong>。因为不同的网站负荷不一样，如果有好的硬件条件也不要请求太多太频繁，否则这种类似DDos的行为仍然会让你去拜会狱头大哥。轻微的结果会让你的账号或ip被封，比如你猛的去抓取淘宝，可能账号被封禁了，可能你的ip段在一段时间内就访问不了淘宝了。</p>\r\n\r\n<p>----------------------------</p>\r\n\r\n<p><span style=\"font-size:16px\"><strong>基本概念：</strong></span></p>\r\n\r\n<p>当我们用浏览器打开一个页面时，浏览器会记录此时我的一些信息，并帮助我发送请求，拿到回复并渲染展示。其实简单的爬虫也可以想象成这样的一个过程，只是省略了人和浏览器，爬虫可以伪造成不同的设备和个人信息去发送请求和接受回复。</p>\r\n\r\n<p>我们打开chrome，按F12弹出dev tool，再输入baidu.com去访问，在network tab下就能看到我们做了请求的操作，百度返回了html，图标，css样式文件等等。</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2019/12/11/image.png\" style=\"height:200px; width:300px\" /></p>\r\n\r\n<p>如图所示，我们做了http请求并受到回复。那么我们也就需要了解http的一些概念。参考：<a href=\"https://zh.wikipedia.org/wiki/%E8%B6%85%E6%96%87%E6%9C%AC%E4%BC%A0%E8%BE%93%E5%8D%8F%E8%AE%AE\">http维基百科</a></p>\r\n\r\n<p>这里介绍一部分常见的概念。</p>\r\n\r\n<p>百科里面提到了有八种方法，不过我们用得最多的就是四种：<strong>get/post/put/delete</strong>。</p>\r\n\r\n<p>Get：请求数据和读取数据；</p>\r\n\r\n<p>Post：发送数据，并交由服务器处理，并得到处理后的数据。比如我想查找淘宝上的卫衣，我就会把卫衣发送到淘宝对应的地址上，并拿到卫衣商品的数据。</p>\r\n\r\n<p>Put：put和post有些类似，不过put相当于更新，因为put每次请求后都会产生同样的效果，而post则不一定。</p>\r\n\r\n<p>Delete：执行删除操作。这个得地址或者api支持才行。</p>\r\n\r\n<p>另外不同的<strong>状态码</strong>可以供我们处理不同的逻辑，比如200是成功，302被重定向了，404找不到，500是内部错误，我们可以考虑是不是被禁止了还是地址出错。</p>\r\n\r\n<p><strong>Content-Type</strong>这个会告诉我们返回的内容类型和编码规格。比如Content-Type: text/html; charset=utf-8意味着返回的是html并且是utf-8的格式；image/png是png图片；application/json是json数据。</p>\r\n\r\n<p><strong>User-Agent</strong>在header中，这个用得挺多的，在发送请求时，我们可以告诉对方服务器目前就是一个python-requests程序，也可以伪造成chrome浏览器，还可以伪造成iphone safari并带上ios版本和操作系统版本。类似这个地址的字符串就可以替换user-agent的内容来伪造成对应的设备：<a href=\"https://developers.whatismybrowser.com/useragents/explore/operating_platform/iphone/\">iphone user agent</a>&nbsp;服务器会根据有些agent而返回不一样的数据，比如搜索引擎需要拿到你的网站的移动设备视图，那么user agent就会是移动设备。</p>\r\n\r\n<p><strong>Token</strong>是用来传递账户信息形成登录的效果，因为有的页面是需要登录账户才会返回数据的毕竟要判断用户权限。</p>\r\n\r\n<p>-----------------------</p>\r\n\r\n<p>接下来我会写一系列文章来记录用python写爬虫程序。跟python有关的已经有pyspider、scrapy这类优秀的工具存在，当然也可以用requests、urllib来简单实现自己需求。我会根据自己的一些小需求来介绍爬虫的编写和应用。</p>','2019-12-11 16:46:00.000000','2019-12-11 16:46:00.000000',2,1,1,63),(90,'Python爬虫(二)获取百度搜索收录结果','<p>前面一篇聊了一些基础的概念，在这篇里可以试一下基础的搜索和收集内容。</p>\r\n\r\n<p>当我们在用百度搜索时，我们会看到很多相关的信息。于是我们可以用爬虫来帮助我们搜索和收集相关的信息。</p>\r\n\r\n<p>比如我想查看百度收录的stackoverflow里爬虫相关的内容的前十条，打开浏览器比如firefox或chrome，按F12打开dev tool，再输入百度的地址访问并搜索时，在network tab下我们能看到请求的详细信息，如下图。当了解了这个过程和一些参数，我们便可以模拟这个过程。</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2019/12/14/image.png\" style=\"height:300px; width:400px\" /></p>\r\n\r\n<p>首先我们先用requests库来封装一下http的get。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\"># in utils\r\n\r\nimport requests\r\n\r\n\r\nclass HttpHelper:\r\n\r\n    default_headers = {\"Content-type\": \"text/html; charset=UTF-8\"}\r\n\r\n    @classmethod\r\n    def get_response_by_url(cls, url, data=None, headers={}):\r\n        headers = dict(cls.default_headers, **headers)\r\n        if data:\r\n            result = requests.get(url, headers=headers, params=data)\r\n        else:\r\n            result = requests.get(url, headers=headers)\r\n        return result</code></pre>\r\n\r\n<p>前面看到当我们搜索后的地址很长，是</p>\r\n\r\n<pre>\r\n<code>\"https://www.baidu.com/s?ie=utf-8&amp;f=8&amp;rsv_bp=1&amp;rsv_idx=1&amp;tn=baidu&amp;wd=%E7%88%AC%E8%99%AB%20site%3Astackoverflow.com&amp;rsv_pq=e46a4ffd003d9ffd&amp;rsv_t=b750PbHmT1mgiHfW6V8XLz6XgZ4BNsjAOvxidQN%2FXv%2BmzkQDG%2B%2BL%2B7lxyUo&amp;rqlang=cn&amp;rsv_enter=1&amp;rsv_dl=ib&amp;rsv_sug3=38&amp;rsv_sug1=9&amp;rsv_sug7=101&amp;rsv_sug2=0&amp;inputT=10432&amp;rsv_sug4=13294\"</code></pre>\r\n\r\n<p>我们实际用不了那么多的参数。比如我们的关键词是: 爬虫和stackoverflow，只要找到这两个关键词，把其他无关的去掉，那么url就变成了</p>\r\n\r\n<pre>\r\n<code>\"https://www.baidu.com/s?wd=%E7%88%AC%E8%99%AB%20site%3Astackoverflow.com\"</code></pre>\r\n\r\n<p>我们干脆也装成用firefox来访问(当然加这个并不能欺骗服务器，很容易被排查出来。完全伪装则放在后面讲)，并把返回的内容转成中文编码，再存储到文件里看看。如下。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\"># -*- coding: utf-8 -*-\r\nurl = \"https://www.baidu.com/s?wd=%E7%88%AC%E8%99%AB%20site%3Astackoverflow.com\"\r\nadditional_header = {\"User-Agent\": \"Mozilla/5.0 (Macintosh; Intel Mac OS X 10.14; rv:71.0) Gecko/20100101 Firefox/71.0\"} # 把firefox的agent换进去\r\nresponse = HttpHelper.get_response_by_url(url, data=None, headers=additional_header)\r\nprint(response.status_code)  # 得到状态码200，表示获取成功\r\nwith open(\"./temp/baidu.html\", \"w\") as f:\r\n    f.write(response.content.decode(\'utf-8\'))  # 存储内容</code></pre>\r\n\r\n<p>打开保存的文件，会发现只包含了html，没有样式，因为没有请求其他文件。</p>\r\n\r\n<p>另外如果想获得更多的结果怎么办？其实类似我们去点击下一页一样。我们看到url有变化，多了&amp;pn=10. 这个就是进入下一页的意思，因为百度默认一页展示10个结果。如果我们设置pn=2，那么第一页展示的结果就会从第三个开始。</p>\r\n\r\n<p>我们通过设置不同的url就能获取不同的展示结果。我们还可以通过解析返回数据是否包含下一页，来设定循环获取所有结果。对于一些会返回json数据包含了长度的，那么就更方便了。</p>\r\n\r\n<p>接下来我们就需要解析文件，获得我们想要的信息。放在下一篇讲。</p>\r\n\r\n<p>相关代码会放在<a href=\"https://github.com/bobjiangps/python-spider-example\">https://github.com/bobjiangps/python-spider-example</a></p>\r\n\r\n<p>&nbsp;</p>','2019-12-14 15:18:00.000000','2019-12-14 15:18:00.000000',2,1,1,80),(91,'Python爬虫(三)解析网页内容','<p>前一篇聊到了简单的请求和获取，这一篇会写关于网页内容的解析。</p>\r\n\r\n<p>我们如果是爬取的html，那么内容就会有很多是我们不需要的，我们就需要解析html并抽取到自己需要的内容部分。</p>\r\n\r\n<p>对于解析内容，有三种方法：</p>\r\n\r\n<p>1. 正则表达式匹配获取。</p>\r\n\r\n<p>2. 用lxml解析获取。</p>\r\n\r\n<p>3. 用beautifulsoap获取。</p>\r\n\r\n<p>对于第一种，匹配的效果不一定就好尤其是对于复杂的html结构，写正则表达式也可能漏掉或者多拿到内容。所以我还是比较推荐后面两种。</p>\r\n\r\n<p>lxml和beautifulsoap都是用来解析html/xml的，调用的方法不一样。还有就是beautifulsoap会加载整个DOM。</p>\r\n\r\n<p>比如我现在有个简单的需求：给予关键词，获取百度新闻上对应的内容前三页的网页标题。</p>\r\n\r\n<p>获取在前一篇已经写过了，这里就分别用lxml和beautifulsoap来解析。</p>\r\n\r\n<p>下面的代码是用lxml解析，先载入爬取到的网页html，再通过xpath定位到标题，取出文本。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\"># with lxml\r\n\r\nfrom utils.http_helper import HttpHelper\r\nfrom lxml import html as lh\r\n\r\n\r\nif __name__ == \"__main__\":\r\n    # capture the news titles recorded in baidu search\r\n    pages = 2\r\n    keyword = \"成都地铁\"\r\n    for page in range(pages+1):\r\n        url = \"https://www.baidu.com/s?tn=news&amp;rsv_dl=ns_pc&amp;word=%s&amp;pn=%d\" % (keyword, page*10)\r\n        additional_header = {\"User-Agent\": \"Mozilla/5.0 (Macintosh; Intel Mac OS X 10.14; rv:71.0) Gecko/20100101 Firefox/71.0\"}\r\n        response = HttpHelper.get_response_by_url(url, data=None, headers=additional_header)\r\n        if response.status_code == 200:\r\n            result = response.content.decode(\'utf-8\')\r\n            doc = lh.fromstring(result)\r\n            title_xpath = \"//div[@class=\'result\']/h3[@class=\'c-title\']/a\"\r\n            nodes = doc.xpath(title_xpath)\r\n            print(\"News title in page %d with the url %s: \" % (page, url))\r\n            for n in nodes:\r\n                print(n.text_content().strip())</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>下面的代码是用beautifulsoap解析，先加载爬取到的html，然后获取对应节点的内容取相应的子节点的文本。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\"># with beautifulsoap\r\n\r\nfrom utils.http_helper import HttpHelper\r\nfrom bs4 import BeautifulSoup as bs\r\n\r\n\r\nif __name__ == \"__main__\":\r\n    # capture the news titles recorded in baidu search\r\n    pages = 2\r\n    keyword = \"成都地铁\"\r\n    for page in range(pages+1):\r\n        url = \"https://www.baidu.com/s?tn=news&amp;rsv_dl=ns_pc&amp;word=%s&amp;pn=%d\" % (keyword, page*10)\r\n        additional_header = {\"User-Agent\": \"Mozilla/5.0 (Macintosh; Intel Mac OS X 10.14; rv:71.0) Gecko/20100101 Firefox/71.0\"}\r\n        response = HttpHelper.get_response_by_url(url, data=None, headers=additional_header)\r\n        if response.status_code == 200:\r\n            result = response.content.decode(\'utf-8\')\r\n            bs_result = bs(result, \"html.parser\")\r\n            title_h3_tag = bs_result.find_all(\"h3\", class_=\"c-title\")\r\n            print(\"News title in page %d with the url %s: \" % (page, url))\r\n            for title in title_h3_tag:\r\n                print(title.find(\"a\").text.strip())</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>最后都能得到同样的结果，于是我们达成了这个简单的需求，爬取百度新闻前三页并获取到标题内容。</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2019/12/16/image-20191216214046-1.png\" style=\"height:121px; width:328px\" /></p>\r\n\r\n<p>相关代码会放在<a href=\"https://github.com/bobjiangps/python-spider-example\">https://github.com/bobjiangps/python-spider-example</a></p>','2019-12-16 21:07:00.000000','2019-12-16 21:07:00.000000',2,1,1,35),(92,'常用的sql','<p>从前一天开始的数据：</p>\r\n\r\n<p>SELECT * FROM `visitor` WHERE record_date &gt; date_sub(curdate(), interval 1 day) order by id desc;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>今天内从zhihu来的访问数据</p>\r\n\r\n<p>SELECT * FROM `visitor` WHERE record_date &gt; curdate() and (agent like &#39;%zhihu%&#39; or referer like &#39;%zhihu%&#39;) order by id desc;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>新建数据库和用户并指定只访问该数据库</p>\r\n\r\n<pre>\r\n<code class=\"language-sql\">create database my_site;\r\n\r\ncreate user \'sitemanager\'@\'%\' identified by \'MyPermission\';\r\n\r\nalter user \'sitemanager\'@\'%\' identified WITH mysql_native_password by \'MyPermission\';\r\n\r\nGRANT SELECT, INSERT, UPDATE, REFERENCES, DELETE, CREATE, DROP, ALTER, INDEX, TRIGGER, CREATE VIEW, SHOW VIEW, EXECUTE, ALTER ROUTINE, CREATE ROUTINE, CREATE TEMPORARY TABLES, LOCK TABLES, EVENT ON `my_site`.* TO \'sitemanager\'@\'%\';</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>修改用户密码</p>\r\n\r\n<pre>\r\n<code class=\"language-sql\">use mysql;\r\nalter user \'sitemanager\'@\'%\' IDENTIFIED BY \'NewPermission\';</code></pre>\r\n\r\n<p>&nbsp;</p>','2019-12-17 17:58:00.000000','2019-12-17 17:58:00.000000',2,1,1,29),(93,'Django restframework加Vue打造前后端分离的网站(一)环境准备','<p>目前博客是用的python+django+bootstrap+uwsgi+nginx， 用的还是MVT模式(<strong>Model-View-Template</strong>)，现在想做一个前后端分离的网站，我会在多篇文章中记录这个过程。</p>\r\n\r\n<p>首先准备后端django。</p>\r\n\r\n<p>建立一个虚拟环境。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">virtualenv venv --no-site-packages\r\nsource venv/bin/activate</code></pre>\r\n\r\n<p>安装django。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">pip install django\r\npip install pymysql</code></pre>\r\n\r\n<p>新建项目和app。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">django-admin startproject automation_center\r\ncd automation_center\r\npython manage.py startapp center</code></pre>\r\n\r\n<p>把automation_center/settings.py里修改如下部分。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">\r\nALLOWED_HOSTS = [\'*\']  # 允许其他来源的访问\r\n\r\nINSTALLED_APPS = [\r\n    \'django.contrib.admin\',\r\n    \'django.contrib.auth\',\r\n    \'django.contrib.contenttypes\',\r\n    \'django.contrib.sessions\',\r\n    \'django.contrib.messages\',\r\n    \'django.contrib.staticfiles\',\r\n    \'center\'  # 新加的app\r\n]\r\n\r\nDATABASES = {\r\n    \'default\': {\r\n        \'ENGINE\': \'django.db.backends.mysql\',  # 换成mysql或其他\r\n        \'NAME\': \'db name\',\r\n        \'USER\': \'db account\',\r\n        \'PASSWORD\': \'db password\',\r\n        \'HOST\': \'127.0.0.1\',\r\n        \'PORT\': 3306,\r\n        \'OPTIONS\': {\r\n            \'autocommit\': True,\r\n        },\r\n    }\r\n}\r\n\r\nLANGUAGE_CODE = \'zh-hans\'\r\n\r\nTIME_ZONE = \'Asia/Shanghai\'\r\n\r\nUSE_TZ = False\r\n</code></pre>\r\n\r\n<p>在automation_center\\__init__.py中添加pymysql</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">import pymysql\r\npymysql.install_as_MySQLdb()\r\n\r\n</code></pre>\r\n\r\n<p>再migrate数据库</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">python manage.py migrate</code></pre>\r\n\r\n<p>此时对于django2.1以上的使用pymysql会出现错误提示: &quot;django.core.exceptions.ImproperlyConfigured: mysqlclient 1.3.13 or newer is required; you have 0.9.3.&quot;, 此时在虚拟环境中的venv/lib/python3.6/site-packages/django/db/backends/mysql/base.py中注释掉&quot;raise ImproperlyConfigured(&#39;mysqlclient 1.3.13 or newer is required; you have %s.&#39; % Database.__version__)&quot;即可。</p>\r\n\r\n<p>做了上述步骤后，此时运行</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">python manage.py runserver 8000</code></pre>\r\n\r\n<p>打开http://127.0.0.1:8000/即可看到django的提示。</p>\r\n\r\n<p>接着可以创建管理员账号，按照提示输入即可。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">python manage.py createsuperuser</code></pre>\r\n\r\n<p>现在开始加上django restframework，它可以帮助我们构建restful的类型的接口，可以方便的提供前后端交互的功能，已达成前后端分离的效果。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">pip install djangorestframework</code></pre>\r\n\r\n<p>到这里，后端基本环境就准备得差不多了。</p>\r\n\r\n<p>-------------------------------</p>\r\n\r\n<p>接着开始准备前端vue.js的环境。</p>\r\n\r\n<p>到nodejs的官网安装nodejs。安装完成后就能使用npm了。由于使用npm下载包时在国内的速度非常感人，于是往往会选择cnpm或者更改npm的资源地址。</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\"># if install cnpm\r\nnpm install cnpm -g --registry=https://registry.npm.taobao.org\r\n\r\n# if change resource url of npm\r\nnpm config set registry https://registry.npm.taobao.org</code></pre>\r\n\r\n<p>然后安装vue-cli，方便快速构建大型项目。</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">npm install -g vue-cli</code></pre>\r\n\r\n<p>然后初始化前端项目，webpack是指打包的方式。</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">vue init webpack front-end\r\n\r\n# output:\r\n# (venv) jiangbo-mbp:automation_center bobjames$ vue init webpack front-end\r\n# ? Project name front-end\r\n# ? Project description front-end of automation center\r\n# ? Author bobjiangps &lt;jbsv43@sina.com&gt;\r\n# ? Vue build standalone\r\n# ? Install vue-router? Yes\r\n# ? Use ESLint to lint your code? No\r\n# ? Set up unit tests Yes\r\n# ? Pick a test runner jest\r\n# ? Setup e2e tests with Nightwatch? Yes\r\n# ? Should we run `npm install` for you after the project has been created? (recommended) npm\r\n\r\n#   vue-cli · Generated \"front-end\".\r\n\r\n\r\n# Installing project dependencies ...</code></pre>\r\n\r\n<p>当安装完成后执行下面命令，就可以启动前端的测试环境了: http://localhost:8080</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">cd front-end\r\nnpm run dev</code></pre>\r\n\r\n<p>-------------------------------</p>\r\n\r\n<p>在下一篇会开始写简单的api用于检查restful的接口是否工作正常。接着就是写第一个页面。</p>\r\n\r\n<p>-------------------------------</p>\r\n\r\n<p>如果数据库是选择mongodb，那么推荐使用djongo，因为djongo能保留admin且仍保留所有的django contrib library，对于已经在开发过程中的项目修改会非常少；而mongoengine则需要引入它的一些model、field, 使用起来也不太稳定，有坑。</p>\r\n\r\n<p>比如用mongodb，创建过用户并需要验证身份的时候，settings.py中连接就可以写作：</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">DATABASES = {\r\n    \'default\': {\r\n        \'ENGINE\': \'djongo\',\r\n        \'NAME\': \'auto_center\',\r\n        \'AUTH_SOURCE\': \'auto_center\',\r\n        \'HOST\': 127.0.0.1,\r\n        \'PORT\': 27017,\r\n        \'USER\': \'admin\',\r\n        \'PASSWORD\': \'123456\'\r\n    }\r\n}</code></pre>\r\n\r\n<p>&nbsp;</p>','2019-12-20 16:08:00.000000','2019-12-20 16:08:00.000000',2,1,1,68),(94,'Django restframework加Vue打造前后端分离的网站(二)新建模块','<p>经过前一篇的步骤，后端基本上可以用了，那么需要开始新建一个能返回数据的模块。</p>\r\n\r\n<p>运行: python manage.py startapp projects</p>\r\n\r\n<p>在automation_center\\settings.py中加上刚创建的app。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">INSTALLED_APPS = [\r\n    ...\r\n    \'rest_framework\',\r\n    \'projects\',\r\n]</code></pre>\r\n\r\n<p>在projects\\models.py中增加一个model</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from django.db import models\r\nfrom django.utils import timezone\r\n\r\n\r\nclass Project(models.Model):\r\n    name = models.CharField(max_length=100)\r\n    create_time = models.DateTimeField(default=timezone.now)\r\n    update_time = models.DateTimeField(default=timezone.now)\r\n\r\n    def __str__(self):\r\n        return self.name\r\n</code></pre>\r\n\r\n<p>打算把所有的app放进一个目录(modules)管理，于是在settings.py中添加如下，并把新建的projects目录放进modules目录里面</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">import sys\r\n\r\nsys.path.insert(0,os.path.join(BASE_DIR, \'modules\'))</code></pre>\r\n\r\n<p>迁移数据表变动</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">python manage.py makemigrations\r\npython manage.py migrate\r\n\r\n# output：\r\n# Operations to perform:\r\n#   Apply all migrations: admin, auth, contenttypes, projects, sessions\r\n# Running migrations:\r\n#   Applying projects.0001_initial... OK</code></pre>\r\n\r\n<p>此时检查本地数据表时会发现多了一个表：projects_project。</p>\r\n\r\n<p>接下来添加一个文件serializers.py。serializers可以将queryset和model序列化转换成json格式用于api接口，也可以用于验证。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from .models import Project\r\nfrom rest_framework import serializers\r\n\r\nclass ProjectSerializer(serializers.ModelSerializer):\r\n\r\n    class Meta:\r\n        model = Project\r\n        fields = \"__all__\"\r\n\r\n## 下面的部分和上面的等价，ModelSerializer可以替代与model中重复的代码，并包含了create和update方法。如果我们需要自定义，则重写这两个方法\r\n# class ProjectSerializer(serializers.Serializer):\r\n#     id = serializers.IntegerField(read_only=True)\r\n#     name = serializers.CharField(max_length=100)\r\n#     create_time = serializers.DateTimeField()\r\n#     update_time = serializers.DateTimeField()\r\n#\r\n#     def create(self, validated_data):\r\n#         \"\"\"\r\n#         Create and return a new `project` instance, given the validated data.\r\n#         \"\"\"\r\n#         return Project.objects.create(**validated_data)\r\n#\r\n#     def update(self, instance, validated_data):\r\n#         \"\"\"\r\n#         Update and return an existing `project` instance, given the validated data.\r\n#         \"\"\"\r\n#         instance.name = validated_data.get(\'name\', instance.name)\r\n#         instance.create_time = validated_data.get(\'create_time\', instance.create_time)\r\n#         instance.update_time = validated_data.get(\'update_time\', instance.update_time)\r\n#         instance.save()\r\n#         return instance\r\n</code></pre>\r\n\r\n<p>在view.ps中添加相关的viewset</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from .models import Project\r\nfrom rest_framework import viewsets\r\nfrom .serializers import ProjectSerializer\r\n\r\n\r\nclass ProjectViewSet(viewsets.ModelViewSet):\r\n    \"\"\"\r\n    API endpoint that allows projects to be viewed or edited.\r\n    \"\"\"\r\n    queryset = Project.objects.all()\r\n    serializer_class = ProjectSerializer\r\n</code></pre>\r\n\r\n<p>在automation_center\\urls.py中添加对应的router</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from django.contrib import admin\r\nfrom django.urls import include, path\r\nfrom rest_framework import routers\r\nfrom projects.views import ProjectViewSet\r\n\r\n\r\nrouter = routers.DefaultRouter()\r\nrouter.register(r\'projects\', ProjectViewSet)\r\n\r\nurlpatterns = [\r\n    path(\'api/\', include(router.urls)),\r\n    path(\'admin/\', admin.site.urls),\r\n    path(\'api-auth/\', include(\'rest_framework.urls\', namespace=\'rest_framework\'))\r\n]</code></pre>\r\n\r\n<p>此时我们再度运行python manage.py runserver时，便可以访问到新加的简单api，比如：</p>\r\n\r\n<p><span style=\"font-size:10px\">http://127.0.0.1:8000/api/ 列出了目前的api列表</span></p>\r\n\r\n<p><span style=\"font-size:10px\">http://127.0.0.1:8000/api/projects/ Get方法，返回了目前所有的project信息</span></p>\r\n\r\n<p><span style=\"font-size:10px\">http://127.0.0.1:8000/api/projects/ Post方法，post数据并新建了一条数据列在project表中</span></p>\r\n\r\n<p><span style=\"font-size:10px\">{<br />\r\n&nbsp; &nbsp; &quot;name&quot;: &quot;debug&quot;,<br />\r\n&nbsp; &nbsp; &quot;create_time&quot;: &quot;2019-12-21T00:58:00&quot;,<br />\r\n&nbsp; &nbsp; &quot;update_time&quot;: &quot;2019-12-21T00:59:00&quot;<br />\r\n}</span></p>\r\n\r\n<p><span style=\"font-size:10px\">http://127.0.0.1:8000/api/projects/1/&nbsp; Get方法，返回了id为1的project信息</span></p>\r\n\r\n<p><span style=\"font-size:10px\">http://127.0.0.1:8000/api/projects/1/&nbsp; Put或Patch方法，传上面的部分修改的数据后可以更新该project信息</span></p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/12/21/postman-django-rest-api-project.png\" style=\"height:370px; width:400px\" /></p>\r\n\r\n<p>于是一个简单的api就已经可以工作啦。</p>','2019-12-21 11:32:00.000000','2019-12-21 11:32:00.000000',2,1,1,45),(95,'Django restframework加Vue打造前后端分离的网站(三)在View中自定义API','<p>前一篇写了新建一个简单的api，在这篇会记录一下在view中写自定义api的4种方法。</p>\r\n\r\n<p>比如我们还是用上一篇的project对象，需要能展示project列表和具体一个project信息，project可以新加、修改，但不应该被删除掉。</p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>第一种</strong></span></p>\r\n\r\n<p>通用型，适用于有model的对象，使用ModelViewSet，会包含所有可用的api方法。如果需要自定义比如禁用delete，则可以重写这个方法。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from .models import Project\r\nfrom .serializers import ProjectSerializer\r\nfrom rest_framework import viewsets\r\n\r\n\r\nclass ProjectViewSet(viewsets.ModelViewSet):\r\n\r\n    queryset = Project.objects.all()\r\n    serializer_class = ProjectSerializer\r\n\r\n    # 如果想禁用某一个方法，可以类似如下，但不如用generics.RetrieveUpdateAPIView\r\n    def destroy(self, request, *args, **kwargs):\r\n        return Response({\"message\": \"delete action is not allowed\", \"code\": \"200\"}, status=status.HTTP_200_OK)</code></pre>\r\n\r\n<p>使用这种方法，不需要在app内添加url.py。但是在项目的url.py中需要加入下面几行</p>\r\n\r\n<pre>\r\n<code>from projects.views import ProjectViewSet\r\n\r\nrouter = routers.DefaultRouter()\r\nrouter.register(r\'projects\', ProjectViewSet)\r\n\r\nurlpatterns = [\r\n    path(\'api/\', include(router.urls)),\r\n    ...\r\n]</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>第二种</strong></span></p>\r\n\r\n<p>使用APIView。这种的代码量会多一点，但如果引入了第三方比如支付相关的，没有具体的业务对象在model中定义，那么这种会比较适合一点。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from django.http import Http404\r\nfrom rest_framework.views import APIView\r\nfrom rest_framework.response import Response\r\nfrom rest_framework import status\r\n\r\n\r\nclass ProjectList(APIView):\r\n    # 定义 GET 请求的方法，内部实现相同 @api_view\r\n    def get(self, request):\r\n        projects = Project.objects.all()\r\n        serializer = ProjectSerializer(projects, many=True)\r\n        return Response(serializer.data, status=status.HTTP_200_OK)\r\n\r\n    # 定义 POST 请求的方法\r\n    def post(self, request):\r\n        serializer = ProjectSerializer(data=request.data)\r\n        if serializer.is_valid():\r\n            serializer.save()\r\n            return Response(serializer.data, status=status.HTTP_201_CREATED)\r\n        return Response(serializer.errors, status=status.HTTP_400_BAD_REQUEST)\r\n\r\n\r\nclass ProjectDetail(APIView):\r\n\r\n    def get_object(self, pk):\r\n        try:\r\n            return Project.objects.get(pk=pk)\r\n        except Project.DoesNotExist:\r\n            raise Http404\r\n\r\n    def get(self, request, pk):\r\n        project = self.get_object(pk)\r\n        serializer = ProjectSerializer(project)\r\n        return Response(serializer.data)\r\n\r\n    def put(self, request, pk):\r\n        project = self.get_object(pk)\r\n        serializer = ProjectSerializer(project, data=request.data)\r\n        if serializer.is_valid():\r\n            serializer.save()\r\n            return Response(serializer.data)\r\n        return Response(serializer.errors, status=status.HTTP_400_BAD_REQUEST)\r\n\r\n    ## to permit delete action or not\r\n    # def delete(self, request, pk):\r\n    #     project = self.get_object(pk)\r\n    #     project.delete()\r\n    #     return Response(status=status.HTTP_204_NO_CONTENT)</code></pre>\r\n\r\n<p>除了第一种，剩下的都需要添加app内url.py，并修改项目url.py。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\"># url.py in app\r\nfrom django.urls import path\r\nfrom . import views\r\n\r\nurlpatterns = [\r\n    path(\'\', views.ProjectList.as_view(), name=\'project_list\'),\r\n    path(r\'&lt;int:pk&gt;/\', views.ProjectDetail.as_view(), name=\'project_detail\'),\r\n]\r\n\r\n\r\n# url.py in your web project\r\nurlpatterns = [\r\n    ...\r\n    path(\'api/projects/\', include(\'projects.urls\')),\r\n    ...\r\n]</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>第三种</strong></span></p>\r\n\r\n<p>使用mixins。继承不同的mixins便可以获得不同的http方法，比如CreateModelMixin可以使用post，UpdateModelMixin可以使用put。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from rest_framework import mixins\r\nfrom rest_framework import generics\r\n\r\n\r\nclass ProjectList(mixins.ListModelMixin,\r\n                  mixins.CreateModelMixin,\r\n                  mixins.UpdateModelMixin,\r\n                  generics.GenericAPIView):\r\n    # 指定列表\r\n    queryset = Project.objects.all()\r\n    # 指定序列化类\r\n    serializer_class = ProjectSerializer\r\n\r\n    def get(self, request, *args, **kwargs):\r\n        # list 方法继承 ListModelMixin 而来\r\n        return self.list(self, request, *args, **kwargs)\r\n\r\n    def post(self, request, *args, **kwargs):\r\n        # create 方法继承 CreateModelMixin 而来\r\n        return self.create(self, request, *args, **kwargs)\r\n\r\n\r\n# detail 视图通过 mixins 和 generics 改造\r\nclass ProjectDetail(mixins.RetrieveModelMixin,\r\n                    mixins.UpdateModelMixin,\r\n                    mixins.DestroyModelMixin,\r\n                    generics.GenericAPIView):\r\n    queryset = Project.objects.all()\r\n    serializer_class = ProjectSerializer\r\n\r\n    def get(self, request, *args, **kwargs):\r\n        return self.retrieve(self, request, *args, **kwargs)\r\n\r\n    def put(self, request, *args, **kwargs):\r\n        return self.update(self, request, *args, **kwargs)\r\n\r\n    def delete(self, request, *args, **kwargs):\r\n        return self.destroy(self, request, *args, **kwargs)</code></pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>第四种</strong></span></p>\r\n\r\n<p>只使用generics，代替了mixins的功能。这种代码量最少。比如我希望包含get/put/delete则可以继承generics.RetrieveUpdateDestroyAPIView；如果我只希望有get/put不包含delete，那么可以继承generics.RetrieveUpdateAPIView。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from rest_framework import generics\r\n\r\n\r\nclass ProjectList(generics.ListCreateAPIView):\r\n    queryset = Project.objects.all()\r\n    serializer_class = ProjectSerializer\r\n\r\n\r\n# class ProjectDetail(generics.RetrieveUpdateDestroyAPIView):\r\nclass ProjectDetail(generics.RetrieveUpdateAPIView):\r\n    queryset = Project.objects.all()\r\n    serializer_class = ProjectSerializer</code></pre>\r\n\r\n<p>不得不说，django restframework实在是好用方便。</p>','2019-12-22 15:39:00.000000','2019-12-22 15:39:00.000000',2,1,1,36),(96,'Django restframework加Vue打造前后端分离的网站(四)生成接口文档','<p>经过前面的步骤，我们现在已经有了关于project的api，以后还会添加更多的api，那么接口文档就需要准备好，特别在有前后端分工的情况，这样其他人能知道目前已有的api以及支持的方法。</p>\r\n\r\n<p>我们可以先把project相关的接口文档做出来，这样在之后就形成了习惯，不用最后再来添加。打算用类似127.0.0.1:8000/api/docs/的地址来展示接口文档。</p>\r\n\r\n<p>swagger是一个不错的选择。</p>\r\n\r\n<p>安装rest-swagger</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">pip install django-rest-swagger</code></pre>\r\n\r\n<p>在settings.py中INSTALLED_APPS里添加&#39;rest-framework-swagger&#39;。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">INSTALLED_APPS = [\r\n    ...\r\n    \'rest_framework\',\r\n    \'rest_framework_swagger\',\r\n]</code></pre>\r\n\r\n<p>在app里的view.py中添加相应的注释。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from rest_framework import generics\r\n\r\n\r\nclass ProjectList(generics.ListCreateAPIView):\r\n    \"\"\"\r\n        get:\r\n            Return all projects.\r\n\r\n        post:\r\n            Create a new project.\r\n    \"\"\"\r\n    queryset = Project.objects.all()\r\n    serializer_class = ProjectSerializer\r\n\r\n\r\nclass ProjectDetail(generics.RetrieveUpdateAPIView):\r\n    \"\"\"\r\n        get:\r\n            Return a project instance.\r\n\r\n        put:\r\n            Update a project.\r\n\r\n        patch:\r\n            Update one or more fields on an existing project.\r\n\r\n    \"\"\"\r\n    queryset = Project.objects.all()\r\n    serializer_class = ProjectSerializer</code></pre>\r\n\r\n<p>在项目url.py中添加get_schema_view和对应的url</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from django.contrib import admin\r\nfrom django.urls import include, path\r\nfrom rest_framework import routers\r\nfrom center import views\r\nfrom rest_framework.schemas import get_schema_view\r\nfrom rest_framework_swagger.renderers import SwaggerUIRenderer, OpenAPIRenderer\r\n\r\n\r\nrouter = routers.DefaultRouter()\r\n\r\nschema_view = get_schema_view(title=\'API DOC\', renderer_classes=[SwaggerUIRenderer, OpenAPIRenderer])  # add\r\n\r\nurlpatterns = [\r\n    path(\'api/\', include(router.urls)),\r\n    path(\'api/projects/\', include(\'projects.urls\')),\r\n    path(\'admin/\', admin.site.urls),\r\n    path(\'api-auth/\', include(\'rest_framework.urls\', namespace=\'rest_framework\')),\r\n    path(\'api/docs/\', schema_view, name=\'docs\')  # add\r\n]\r\n</code></pre>\r\n\r\n<p>此时运行python manage.py runserver, 便可以在127.0.0.1:8000/api/docs/看到api的对应内容。</p>\r\n\r\n<p>如果遇到错误提示：&#39;Expected a `coreapi.Document` instance&#39;，那么可以检查下djangorestframework的版本，我是3.11.0，换成3.9.2就正常了。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2019/12/23/api_doc.png\" style=\"height:353px; width:350px\" /></p>\r\n\r\n<p>此时settings.py中debug为true，当以后正式部署时则会加载不了css,js，这时我们可以先运行python manage.py collect static来收集admin, rest framework, swagger的静态文件，之后用nginx代理来处理静态资源的访问，即使debug为false时也能够正常访问。nginx.conf的配置放之后再说。</p>','2019-12-23 17:54:00.000000','2019-12-23 17:54:00.000000',2,1,1,51),(97,'Dockerfile创建python+django+uwsgi+nginx相关的镜像','<p>在工作中刚好遇到需要做CI/CD的情况，需要把当前的web系统构建成docker镜像。经过一些折腾完成了，于是分享一下Dockerfile。</p>\r\n\r\n<p>需要的环境是python3, django, uwsgi, nginx。目前没有能直接满足的镜像，于是自己写了一份Dockerfile来构建。构建的步骤是拉取ubuntu，安装python3.6和nginx，再安装python依赖包，将nginx的配置文件拷进nginx目录，并在docker run时直接启动web服务。</p>\r\n\r\n<p>最后的部分是暴露出80端口，因为只能执行一个CMD，但我是需要先启动uwsgi再启动nginx，就不能按照常用的来</p>\r\n\r\n<p>CMD [&quot;nginx&quot;, &quot;-g&quot;, &quot;daemon off;&quot;]</p>\r\n\r\n<p>这样虽然能启动nginx并保证docker run不退出，但是还差了uwsgi的启动。于是需要把两个命令写在一起，这样也只有一个CMD，也能同时启动多个进程</p>\r\n\r\n<pre>\r\nCMD [&quot;sh&quot;, &quot;-c&quot;, &quot;uwsgi -i /mysite/config/uwsgi.ini &amp;&amp; nginx -g &#39;daemon off;&#39;&quot;]</pre>\r\n\r\n<p>文件内容如下</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">FROM ubuntu:18.04\r\n\r\nRUN apt-get update &amp;&amp; \\\r\n    apt-get upgrade -y &amp;&amp; \\\r\n    apt-get install -y vim &amp;&amp; \\\r\n    apt-get install -y \\\r\n        python3 \\\r\n        python3-dev \\\r\n        python3-setuptools \\\r\n        python3-pip \\\r\n        nginx &amp;&amp; \\\r\n    rm -rf /var/lib/apt/lists/*\r\n\r\nWORKDIR /mysite\r\nCOPY ./ ./\r\nRUN pip3 install -r requirement.txt\r\nRUN cp /etc/nginx/nginx.conf /etc/nginx/nginx.conf-default\r\nCOPY ./config/nginx.conf /etc/nginx/nginx.conf\r\n\r\nEXPOSE 80\r\nCMD [\"sh\", \"-c\", \"uwsgi -i /mysite/config/uwsgi.ini &amp;&amp; nginx -g \'daemon off;\'\"]</code></pre>\r\n\r\n<p>build完成后就可以运行并查看效果了。</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">docker images\r\n# REPOSITORY                 TAG                 IMAGE ID            CREATED             SIZE\r\n# &lt;none&gt;                     &lt;none&gt;              bf21da761d8f        8 seconds ago       605MB\r\n\r\ndocker run -p 80:80 bf21da761d8f\r\n# [uWSGI] getting INI configuration from /mysite/config/uwsgi.ini</code></pre>\r\n\r\n<p>此时打开localhost就能看到对应的页面了。</p>\r\n\r\n<p>也可以运行&#39;docker exec -it cbead25a54f7 /bin/bash&#39;进入container去查看和修改。</p>\r\n\r\n<p>------------------------------------</p>\r\n\r\n<p>上面的是用的ubuntu，也可以用centos+python36的镜像。</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">FROM centos/python-36-centos7\r\n\r\nUSER root\r\nRUN yum -y install epel-release &amp;&amp; \\\r\n    yum -y install nginx &amp;&amp; \\\r\n    yum clean all\r\n\r\nWORKDIR /mysite\r\nCOPY ./ ./\r\nRUN pip install --upgrade pip\r\nRUN pip install -r requirement.txt\r\nRUN cp /etc/nginx/nginx.conf /etc/nginx/nginx.conf-default\r\nCOPY ./config/nginx.conf /etc/nginx/nginx.conf\r\n\r\nEXPOSE 80\r\nCMD [\"sh\", \"-c\", \"uwsgi -i /mysite/config/uwsgi.ini &amp;&amp; nginx -g \'daemon off;\'\"]</code></pre>\r\n\r\n<p>&nbsp;</p>','2019-12-26 18:12:00.000000','2019-12-26 18:12:00.000000',2,1,1,51),(98,'Django restframework加Vue打造前后端分离的网站(五)rest和vue的初步结合','<p>经过前面几篇的操作，我们已经完成了第一个api和第一个vue页面，在这篇文章里会记录第一个api和第一个页面的初步结合，作为后续的基础。</p>\r\n\r\n<p>目前第一个project api可以直接访问和调用，第一个vue的默认页面也可以访问，不过两者还是分开的，现在就需要让vue这边请求project api，并把结果展现在页面上。</p>\r\n\r\n<p>首先需要安装axios。axios 是一个基于Promise的HTTP 客户端，可以交换转换json数据，也可以结合async/await。</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">npm install --save axios\r\n# 如果提示\"python2\" is not in PATH or produced an error，那么先运行一下类似这样的命令：pyenv shell 3.6.5 2.7.14</code></pre>\r\n\r\n<p>不过Vue访问Django的API会出现跨域错误，比如提示：&quot;Cross-Origin Request Blocked: The Same Origin Policy disallows reading the remote resource at http://127.0.0.1:8000/api/projects/. (Reason: CORS header &lsquo;Access-Control-Allow-Origin&rsquo; missing).&quot;</p>\r\n\r\n<p>此时需要安装django-cors-headers。</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">pip install django-cors-headers\r\n\r\n# 在settings.py中新增\r\nINSTALLED_APPS = [\r\n    ...\r\n    \'corsheaders\',\r\n    ...\r\n]\r\n\r\nMIDDLEWARE = [\r\n    ...\r\n    \'corsheaders.middleware.CorsMiddleware\',\r\n    \'django.middleware.common.CommonMiddleware\',\r\n    ...\r\n]\r\n\r\nCORS_ORIGIN_ALLOW_ALL = True</code></pre>\r\n\r\n<p>然后在/frontend/src/components中新增home.vue文件，内容如下:</p>\r\n\r\n<pre>\r\n<code class=\"language-html\">&lt;template&gt;\r\n  &lt;div&gt;\r\n    &lt;h3&gt;{{ msg }}&lt;/h3&gt;\r\n    &lt;button type=\"button\" @click=\'getProjects\' :style=\"{ margin: \'10px\', padding: \'5px\' }\"&gt;get projects&lt;/button&gt;\r\n    &lt;table :style=\"{ border: \'2px solid gray\', borderRadius: \'5px\', padding: \'10px\' }\" align=\'center\'&gt;\r\n      &lt;tr v-for=\'p in projects\'&gt;\r\n        &lt;td&gt;{{ p.id }}&lt;/td&gt;\r\n        &lt;td&gt;{{ p.name }}&lt;/td&gt;\r\n        &lt;td&gt;{{ p.create_time }}&lt;/td&gt;\r\n        &lt;td&gt;{{ p.update_time }}&lt;/td&gt;\r\n      &lt;/tr&gt;\r\n    &lt;/table&gt;\r\n  &lt;/div&gt;\r\n&lt;/template&gt;\r\n\r\n&lt;script&gt;\r\nimport axios from \'axios\'\r\nexport default {\r\n  name: \'Home\',\r\n  data () {\r\n    return {\r\n      msg: \'Projects in Automation Center\',\r\n      projects: []\r\n    }\r\n  },\r\n\r\n  methods: {\r\n    getProjects() {\r\n      axios.get(\'http://127.0.0.1:8000/api/projects/\').then(response =&gt; {this.projects = response.data[\"results\"], this.msg = \'get projects data from django api\'});\r\n    }\r\n  }\r\n}\r\n&lt;/script&gt;\r\n\r\n&lt;!-- Add \"scoped\" attribute to limit CSS to this component only --&gt;\r\n&lt;style scoped&gt;\r\nh1, h2 {\r\n  font-weight: normal;\r\n}\r\nul {\r\n  list-style-type: none;\r\n  padding: 0;\r\n}\r\nli {\r\n  display: inline-block;\r\n  margin: 0 10px;\r\n}\r\na {\r\n  color: #42b983;\r\n}\r\n&lt;/style&gt;\r\n</code></pre>\r\n\r\n<p>接着修改/frontend/src/router中的index.js文件</p>\r\n\r\n<pre>\r\n<code class=\"language-javascript\">import Vue from \'vue\'\r\nimport Router from \'vue-router\'\r\nimport Home from \'@/components/home\'\r\n\r\nVue.use(Router)\r\n\r\nexport default new Router({\r\n  routes: [\r\n    {\r\n      path: \'/\',\r\n      name: \'home\',\r\n      component: Home\r\n    }\r\n  ]\r\n})\r\n</code></pre>\r\n\r\n<p>此时运行npm run dev所看到的首页面就是新增的这个home.vue,</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2020/01/07/image-20200107165234-1.png\" style=\"height:200px; width:300px\" /></p>\r\n\r\n<p>当点击按钮时就会用get方法调用projects的api，展示project信息到页面上，并修改了文本。<br />\r\n<img src=\"/media/upload/Bo/2020/01/07/image-20200107165323-2.png\" style=\"height:250px; width:350px\" /></p>\r\n\r\n<p>到这里就实现了一个很简单的vue与django交互的例子。当然代码复用还有界面美化会在后续加上。</p>\r\n\r\n<p>我们发现打开的url中始终带有#，如果想去掉它，就在./frontend/src/router/index.js中加上&quot;mode: history&quot;.</p>\r\n\r\n<pre>\r\n<code class=\"language-javascript\">import Vue from \'vue\'\r\nimport Router from \'vue-router\'\r\nimport Home from \'@/components/home\'\r\n\r\nVue.use(Router)\r\n\r\nexport default new Router({\r\n  mode: \'history\',\r\n  routes: [\r\n    {\r\n      path: \'/\',\r\n      name: \'home\',\r\n      component: Home\r\n    }\r\n  ]\r\n})\r\n</code></pre>\r\n\r\n<p>如果需要做类似发布的操作，那么运行npm run build会构建并产生一个dist文件夹。但里面的index.html中打开是有加载问题的，因为需要一个http server，如下:</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">npm install -g serve\r\nserve -s dist/ # 默认监听5000端口，也可以改，比如serve -s dist/ -l 4555</code></pre>\r\n\r\n<p>此时打开localhost:5000或ip:5000就能看到和dev环境一样的页面和行为。</p>\r\n\r\n<p>当然正式环境还是用nginx，这里可以用来预览生产环境效果。部署相关的可以参考官方：<a href=\"https://cli.vuejs.org/zh/guide/deployment.html#%E9%80%9A%E7%94%A8%E6%8C%87%E5%8D%97\">https://cli.vuejs.org/zh/guide/deployment.html</a></p>','2020-01-07 14:27:00.000000','2020-01-07 14:27:00.000000',2,1,1,31),(99,'Django restframework加Vue打造前后端分离的网站(六)认证和权限','<p>经过前面文章记录的步骤，现在有页面可以展示，也有API可以调用。但是现在是任何人都可以查看、新增、更新，实在是不够安全谨慎，于是在这篇文章会记录加上认证和权限的步骤，用来限制访问者的行为。</p>\r\n\r\n<p>比如我打算设置3个角色：管理员，登录用户，匿名用户。</p>\r\n\r\n<p>对于管理员来说可以做任何操作，对于登录用户来说可以做大部分操作但是比较关键敏感的数据则没有权限，而匿名用户则只能read-only。</p>\r\n\r\n<p><span style=\"font-size:16px\"><strong>一) Token Authentication</strong></span></p>\r\n\r\n<p>在第一篇中已经创建过了用户(python manage.py createsuperuser)，这里便会用该用户的token来验证是否有操作权限。</p>\r\n\r\n<p>在添加修改前，我们先打开project的api地址，会看到没有登录的情况下，仍然可以做get, post, patch, put之类的操作。然后开始修改。</p>\r\n\r\n<p>在settings.py中添加如下内容:</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">INSTALLED_APPS = [\r\n    ...\r\n    \'rest_framework.authtoken\',\r\n    ...\r\n]\r\n\r\nREST_FRAMEWORK = {\r\n    \'DEFAULT_AUTHENTICATION_CLASSES\': [\r\n        \'rest_framework.authentication.TokenAuthentication\',\r\n    ],\r\n    ...\r\n}</code></pre>\r\n\r\n<p>接着迁移数据库变更</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">python manage.py migrate\r\npython manage.py drf_create_token your_user_name\r\n\r\n# output: Generated token f32fc8e6366422f8f1280388dde4e946e7955097</code></pre>\r\n\r\n<p>此时在数据库中能发现增加了一个表authtoken_token，里面就有对应用户的token信息。</p>\r\n\r\n<p>同时我们在目前的view中添加permission定义，设置只有登录的可以操作否则只读。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from .models import Project\r\nfrom .serializers import ProjectSerializer\r\nfrom rest_framework import generics\r\nfrom rest_framework.permissions import IsAuthenticatedOrReadOnly\r\n\r\n\r\nclass ProjectList(generics.ListCreateAPIView):\r\n    \"\"\"\r\n        get:\r\n            Return all projects.\r\n\r\n        post:\r\n            Create a new project.\r\n    \"\"\"\r\n    permission_classes = [IsAuthenticatedOrReadOnly]  # here\r\n    queryset = Project.objects.all().order_by(\"id\")\r\n    serializer_class = ProjectSerializer\r\n\r\n\r\nclass ProjectDetail(generics.RetrieveUpdateAPIView):\r\n    \"\"\"\r\n        get:\r\n            Return a project instance.\r\n\r\n        put:\r\n            Update a project.\r\n\r\n        patch:\r\n            Update one or more fields on an existing project.\r\n\r\n    \"\"\"\r\n    permission_classes = [IsAuthenticatedOrReadOnly]  # here\r\n    queryset = Project.objects.all()\r\n    serializer_class = ProjectSerializer\r\n</code></pre>\r\n\r\n<p>此时再次打开api的地址，就会发现没有post或者put的输入框以及按钮了，因为匿名用户变成只读权限了。</p>\r\n\r\n<p>当我们需要新建或更新project时，则需要带上自己账户的token: &#39;<span style=\"background-color:#ffffff; color:#505050; font-family:OpenSans,Helvetica,Arial,sans-serif; font-size:12px\">Authorization: Token </span>f32fc8e6366422f8f1280388dde4e946e7955097&#39;，例如如下用postman的截图。</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2020/01/08/image-20200108175452-1.png\" style=\"height:250px; width:350px\" /></p>\r\n\r\n<p>另外restframework也提供了相关获取token的接口，我们需要在url.py中定义，然后通过/api-token-auth即可获取token信息。不过这个接口不允许get方法，只能post用户名和密码。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from rest_framework.authtoken.views import obtain_auth_token\r\n\r\nurlpatterns = [\r\n    ...\r\n    path(\'api-token-auth/\', obtain_auth_token, name=\'api_token_auth\'),\r\n    ...\r\n]\r\n</code></pre>\r\n\r\n<p>如下图。</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2020/01/08/image-20200108182327-1.png\" style=\"height:250px; width:350px\" /></p>\r\n\r\n<p>***需要注意的是*** 当添加了token authentication后，打开/api/docs/会只能看到不需要登录的get方法，其他的post/put/patch/delete都看不到，因为设置了权限，也影响到了这里。并且还有一个坑，django-rest-swagger版本2.2.0有已知issue不能支持authentication，于是需要降级到2.1.2, pip install django-rest-swagger==2.1.2. 参考<a href=\"https://github.com/marcgibbons/django-rest-swagger/issues/708\">https://github.com/marcgibbons/django-rest-swagger/issues/708</a>&nbsp;. 需要更新settings.py，如下。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">REST_FRAMEWORK = {\r\n    \'DEFAULT_AUTHENTICATION_CLASSES\': [\r\n        \'rest_framework.authentication.BasicAuthentication\',\r\n        \'rest_framework.authentication.TokenAuthentication\'\r\n    ],\r\n    ...\r\n}\r\n\r\n# 如果没有添加BasicAuthentication，只想用TokenAuthentication，那么还需要添加下面的设置\r\nSWAGGER_SETTINGS = {\r\n    \'SECURITY_DEFINITIONS\': {\r\n        \'api_key\': {\r\n            \'type\': \'apiKey\',\r\n            \'in\': \'header\',\r\n            \'name\': \'Authorization\'\r\n        }\r\n    },\r\n    # \'LOGIN_URL\': getattr(settings, \'LOGIN_URL\', None),\r\n    # \'LOGOUT_URL\': getattr(settings, \'LOGOUT_URL\', None),\r\n    \'DOC_EXPANSION\': None,\r\n    \'APIS_SORTER\': None,\r\n    \'OPERATIONS_SORTER\': None,\r\n    \'JSON_EDITOR\': False,\r\n    \'SHOW_REQUEST_HEADERS\': False,\r\n    \'SUPPORTED_SUBMIT_METHODS\': [\r\n        \'get\',\r\n        \'post\',\r\n        \'put\',\r\n        \'delete\',\r\n        \'patch\'\r\n    ],\r\n    # \'VALIDATOR_URL\': \'\',\r\n}</code></pre>\r\n\r\n<p>此时再次打开并验证身份后就能看到所有支持的接口了。</p>\r\n\r\n<p><strong><span style=\"font-size:16px\">二) LDAP Authentication</span></strong></p>\r\n\r\n<p>有时会需要验证LDAP的用户信息，这样在公司内部就可以直接登录，而不用新建或修改用户。</p>\r\n\r\n<p>安装django-auth-ldap</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">pip install django-auth-ldap</code></pre>\r\n\r\n<p>在settings.py中需要配置如下信息，需要了解公司里LDAP里的信息结构</p>\r\n\r\n<p>o&ndash; organization（组织-公司）<br />\r\nou &ndash; organization unit（组织单元/部门）<br />\r\nc - countryName（国家）<br />\r\ndc - domainComponent（域名组件）<br />\r\nsn &ndash; suer name（真实名称）<br />\r\ncn - common name（常用名称）<br />\r\ndn - distinguished name（唯一标识）</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">import ldap\r\nfrom django_auth_ldap.config import LDAPSearch\r\n\r\n\r\nAUTHENTICATION_BACKENDS = [\"django_auth_ldap.backend.LDAPBackend\",\r\n                           \'django.contrib.auth.backends.ModelBackend\']  # 如果ldap验证不通过，则会用默认的验证来用本地建的用户来登录\r\n\r\nAUTH_LDAP_SERVER_URI = \"ldap://your_url:389\"  # 服务器地址\r\nAUTH_LDAP_BIND_DN = \"CN=cn_name,OU=Users,DC=domain,DC=com\"  # 一个样例，管理员的dn\r\nAUTH_LDAP_BIND_PASSWORD = \'your_pwd!\'    # 管理员密码\r\nAUTH_LDAP_BASEDN = \"OU=Users,DC=domain,DC=com\"  # 基础的dn信息\r\nAUTH_LDAP_USER_SEARCH = LDAPSearch(\"OU=_Sites,DC=domain,DC=com\", ldap.SCOPE_SUBTREE, \"(mail=%(user)s)\")  # 使用mail作为用户名搜索是否存在该mail名，且会验证用户名和密码\r\n# AUTH_LDAP_ALWAYS_UPDATE_USER = True   # 是否每次更新用户，默认为true\r\n\r\nAUTH_LDAP_USER_ATTR_MAP = {    # 与db中的字段做一个对应\r\n    \"username\": \"name\",\r\n    \"email\": \"mail\",\r\n}</code></pre>\r\n\r\n<p>此时在django的admin登录后会发现不成功，检查db会发现auth.user里已经存在该用户，不过is_staff字段为false。</p>\r\n\r\n<p>需要令is_staff为true，则需要添加group的信息。在上面的基础上再添加如下内容</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from django_auth_ldap.config import GroupOfNamesType\r\n\r\n\r\n# 以下内容都需要根据自己需要修改\r\nAUTH_LDAP_GROUP_SEARCH = LDAPSearch(\r\n    \'ou=django,ou=groups,dc=example,dc=com\',\r\n    ldap.SCOPE_SUBTREE,\r\n    \'(objectClass=groupOfNames)\',\r\n)\r\nAUTH_LDAP_GROUP_TYPE = GroupOfNamesType(name_attr=\'cn\')\r\n\r\nAUTH_LDAP_USER_FLAGS_BY_GROUP = {\r\n    \'is_active\': \"OU=Users,DC=domain,DC=com\",\r\n    \'is_staff\': \"OU=Users,DC=domain,DC=com\"\r\n    # 这里没有添加is_superuser字段内容，因为不希望添加多余的超级用户。\r\n}</code></pre>\r\n\r\n<p>如果发现在第一次能成功登陆，但是第二次登陆就报错：IntegrityError(1062, &quot;Duplicate entry &#39;admin&#39; for key &#39;username&#39;&quot;)，那么在settings.py中加上AUTH_LDAP_USER_QUERY_FIELD=&quot;email&quot;。</p>\r\n\r\n<p><strong><span style=\"font-size:16px\">三) Token expiration</span></strong></p>\r\n\r\n<p>这部分不是讲某种验证方式。</p>\r\n\r\n<p>因为token验证默认token是不会过期的，那么这就涉及到一个安全问题，如果有人抓到了token，那么就会有你的所有权限，于是需要修改token的过期和更新。</p>\r\n\r\n<p>我们在url.py中设置token验证的模块&#39;obtain_auth_token&#39;来源于restframework，我们需要修改其方法:&#39;authenticate_credentials&#39;。</p>\r\n\r\n<p>比如我可以在users的模块中的views.py中添加一个新的类，继承obtain_auth_token并重写方法。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">from django.utils import timezone\r\nfrom rest_framework import status\r\nfrom rest_framework.response import Response\r\nfrom rest_framework.authtoken.models import Token\r\nfrom rest_framework.authtoken.views import ObtainAuthToken\r\nimport datetime\r\n\r\n\r\nclass ObtainExpiringAuthToken(ObtainAuthToken):\r\n\r\n    def post(self, request, *args, **kwargs):\r\n        serializer = self.serializer_class(data=request.data,\r\n                                           context={\'request\': request})\r\n        if serializer.is_valid(raise_exception=True):\r\n            user = serializer.validated_data[\'user\']\r\n            token, created = Token.objects.get_or_create(user=user)\r\n\r\n            utc_now = datetime.datetime.utcnow().replace(tzinfo=timezone.utc)\r\n            if not created and token.created &lt; utc_now - datetime.timedelta(hours=24):\r\n                print(\"re-generate token for old one is expired\")\r\n                token.delete()\r\n                token = Token.objects.create(user=user)\r\n                token.created = datetime.datetime.utcnow()\r\n                token.save()\r\n            return Response({\'token\': token.key})\r\n        return Response(serializer.errors, status=status.HTTP_400_BAD_REQUEST)</code></pre>\r\n\r\n<p>然后更新url.py，加上:</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">path(\'automation/api/api-token-auth/\', u_views.ObtainExpiringAuthToken.as_view(), name=\'api_token_auth\'),</code></pre>\r\n\r\n<p>现在请求token时只要账户和密码正确就会返回可用的token，如果token过期了，就会删除并重新创建，之前的token即使有人拿到了也不可用了。</p>\r\n\r\n<p>不过还需要添加一个文件。因为当你登录时会更新token，那么如果几天不登录，此时token未更新，别人仍然可用。于是需要在需要token时都验证一遍有效性。</p>\r\n\r\n<p>在utils里创建文件authentication.py以替换TokenAuthentication，添加如下内容。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\"># authentication.py\r\n\r\nimport datetime\r\nfrom django.utils import timezone\r\nfrom rest_framework.authentication import TokenAuthentication\r\nfrom rest_framework import exceptions\r\n\r\n\r\nclass ExpiringTokenAuthentication(TokenAuthentication):\r\n\r\n    def authenticate_credentials(self, key):\r\n        model = self.get_model()\r\n        try:\r\n            token = model.objects.select_related(\'user\').get(key=key)\r\n        except model.DoesNotExist:\r\n            raise exceptions.AuthenticationFailed(\'Invalid token.\')\r\n\r\n        if not token.user.is_active:\r\n            raise exceptions.AuthenticationFailed(\'User inactive or deleted.\')\r\n\r\n        utc_now = datetime.datetime.utcnow().replace(tzinfo=timezone.utc)\r\n\r\n        if token.created &lt; utc_now - datetime.timedelta(hours=24):\r\n            raise exceptions.AuthenticationFailed(\'Token has expired\')\r\n\r\n        return token.user, token\r\n</code></pre>\r\n\r\n<p>并修改settings.py。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">REST_FRAMEWORK = {\r\n    \'DEFAULT_AUTHENTICATION_CLASSES\': [\r\n        ...\r\n        # \'rest_framework.authentication.TokenAuthentication\',\r\n        \'utils.authentication.ExpiringTokenAuthentication\',\r\n        ...\r\n    ],\r\n    ...\r\n}</code></pre>\r\n\r\n<p>到此就完成了token的过期和验证。token过期参考了<a href=\"https://stackoverflow.com/questions/14567586/token-authentication-for-restful-api-should-the-token-be-periodically-changed\">https://stackoverflow.com/questions/14567586/token-authentication-for-restful-api-should-the-token-be-periodically-changed</a></p>','2020-01-08 17:35:00.000000','2020-01-08 17:35:00.000000',2,1,1,46),(100,'Centos安装mongodb并配置用户和权限','<p>先创建文件用于yum安装mongodb community version。 &#39;vim /etc/yum.repos.d/mongodb-org-4.2.repo&#39;，粘贴如下内容并保存：</p>\r\n\r\n<p>[mongodb-org-4.2]<br />\r\nname=MongoDB Repository<br />\r\nbaseurl=https://repo.mongodb.org/yum/redhat/$releasever/mongodb-org/4.2/x86_64/<br />\r\ngpgcheck=1<br />\r\nenabled=1<br />\r\ngpgkey=https://www.mongodb.org/static/pgp/server-4.2.asc</p>\r\n\r\n<p>安装并启动服务</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">sudo yum install -y mongodb-org\r\n\r\nmkdir -p /var/lib/mongo\r\nmkdir -p /var/log/mongodb\r\n\r\nsudo service mongod start</code></pre>\r\n\r\n<p>当前不要求身份验证，于是进入并创建管理员</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">mongo\r\nuse admin\r\ndb.createUser({user: \"myadmin\", pwd: \"mypass\", roles:[\"root\"]})</code></pre>\r\n\r\n<p>在/etc/mongod.conf中添加如下内容并重启sudo service mongod restart</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">net:\r\n  port: 27017\r\n  bindIp: 0.0.0.0  # 允许其他ip访问，只允许本地访问则是127.0.0.1\r\n\r\nsecurity:\r\n  authorization: enabled  # 开启身份验证</code></pre>\r\n\r\n<p>重启mongod后就需要用户登录了，否则进入后什么都看不到</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">mongo -u myadmin -p mypass</code></pre>\r\n\r\n<p>此时可以创建其他用户等。</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">use web;\r\ndb.createUser({user: \"admin\", pwd: \"123456\", roles:[\"dbOwner\"]}) \r\ndb.createUser({user: \"user\", pwd: \"123456\", roles: [ { role: “readWrite”, db: \"web\" } ]})</code></pre>\r\n\r\n<p>&nbsp;</p>','2020-01-14 11:33:00.000000','2020-01-14 11:33:00.000000',2,1,1,17),(101,'为Django配置覆盖率检查并配置在gitlab上','<p>现在用gitlab做CI/CD，在测试阶段时会运行django的单元测试，也希望能看到当前覆盖率是多少，并且能设置一个指标，覆盖率未达标就报错，即使目前的测试全部通过。这样能尽量的提高测试覆盖率，把tdd做好，有助于代码质量。</p>\r\n\r\n<p>下面记录一下django是怎么检查覆盖率的还有gitlab怎么设置的。</p>\r\n\r\n<p>因为我用了pytest，于是需要安装pytest-cov。</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">pip install pytest-cov</code></pre>\r\n\r\n<p>运行后会装上coverage和pytest-cov的包。</p>\r\n\r\n<p>然后在pytest的配置文件中添加如下内容pytest.ini</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">[pytest]\r\nDJANGO_SETTINGS_MODULE = Site.settings\r\npython_files = tests.py test_*.py *_tests.py\r\naddopts = --nomigrations --reuse-db \r\n          --cov=modules/ --cov-report term-missing --color yes  # 这里是设置检查的目录和展示结果\r\n          --cov-fail-under 100  # 这个是设置覆盖率指标，未达到就会报错</code></pre>\r\n\r\n<p>此时运行pytest命令来代替&#39;python manage.py test -k&#39; 时就能看到覆盖率。但是我们发现连migrations里的都出现了，这个并不是我们希望检查的文件，反而会拉低目前的覆盖率。</p>\r\n\r\n<p>此时需要在coverage的配置文件中添加一些内容，不过无法添加到pytest.ini中，文件名可以自己指定，默认是.coveragerc。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\">[run]\r\nomit =                 # 过滤的文件\r\n    */migrations/*\r\n    */apps.py\r\n    */admin.py\r\n    */tests.py\r\n\r\n[report]\r\nexclude_lines =         # 过滤的代码内容\r\n    return self.name\r\n</code></pre>\r\n\r\n<p>此时提交后结合了.gitlab-ci.yml后就会在console中看到覆盖率的数字统计。</p>\r\n\r\n<p>如果想在gitlab的页面中也看到覆盖率的话，那么可以在.gitlab-ci.yml中配置一下以获取最后的覆盖率总数。如下。</p>\r\n\r\n<pre>\r\n<code class=\"language-python\"># .gitlab-ci.yml\r\n\r\n...\r\n  before_script:\r\n    - pip3 install -r requirement.txt\r\n    - python3 manage.py makemigrations\r\n    - python3 manage.py migrate\r\n  script:\r\n    - pytest\r\n  coverage: \'/TOTAL.*\\s+(\\d+%)$/\'   # here</code></pre>\r\n\r\n<p>再次提交后就能检查覆盖率的指标，也能获取到总的覆盖率数字啦。如下图。</p>\r\n\r\n<p><img alt=\"\" src=\"/media/upload/Bo/2020/01/14/gitlab_coverage.png\" style=\"height:199px; width:400px\" /></p>','2020-01-14 18:44:00.000000','2020-01-14 18:44:00.000000',2,1,1,20),(102,'Django restframework加Vue打造前后端分离的网站(七)登录并保持状态','<p>restful api是一种无状态的请求，每个请求与其他请求隔离，也不会记录交互的场景，不在意反馈请求的服务端是哪一个。restful架构要求服务器端不保有任何与特定HTTP请求相关的资源，所以应用状态必须由请求方在请求过程中提供。</p>\r\n\r\n<p>既然后端采用了restful api的实现方式，那么用了token验证方式也是一种无状态的，两者观念相符。</p>\r\n\r\n<p>token相比session来说有如下区别：</p>\r\n\r\n<p>1）减轻服务器压力，不用在服务器端维持用户session；</p>\r\n\r\n<p>2）session是浏览器特有的，如果后端服务也需要支持手机app，那么token则是好一点的选择。</p>\r\n\r\n<p>3）支持跨域，token可以少考虑CSRF跨站请求伪造的问题。</p>\r\n\r\n<p>4）token是无状态的(stateless)，session则是维持状态的(presist)</p>\r\n\r\n<p>5）当有多服务器时，token需要同步。不过session也是只维持在一个服务器上的。</p>\r\n\r\n<p>6）app或者单页面应用(SPA)或者第三方登录推荐用token，多页面应用(MPA)推荐用session。</p>\r\n\r\n<p>--------------------------------------------------</p>\r\n\r\n<p>前面说了这么多些，是因为打算用token验证，但是前端获取token后，刷新页面就会丢失登录状态。该篇文章会记录下如何集成登录以及保持状态。</p>\r\n\r\n<p>我们可以用vuex来管理全局状态，可随时读取和修改state，从后端获取token并记录，跳转新页面做新的后台请求时，就会带上该token，否则返回登录页面，如果token过期也会更新该状态。就能记录用户的登录状态并能判断是否需要再次登录。</p>\r\n\r\n<p>先安装vuex</p>\r\n\r\n<pre>\r\n<code class=\"language-bash\">npm install --save vuex</code></pre>\r\n\r\n<p>在frontend/src下创建store/index.js，分别有state / mutations / actions / getters, 在actions这里面写了login和logout两个方法，每次调用时会更新到state里的状态的值里面去，并存储在local storage中，因为虽然状态会保存在vuex中，但如果用户关闭浏览器状态就会丢失了，再次打开时若token仍然有效，应仍然让用户处于登录状态。</p>\r\n\r\n<pre>\r\n<code class=\"language-javascript\">// store/index.js\r\n\r\nimport Vue from \'vue\'\r\nimport Vuex from \'vuex\'\r\nimport axios from \'axios\'\r\n\r\nVue.use(Vuex)\r\n\r\nexport default new Vuex.Store({\r\n  state: {\r\n    status: \'\',\r\n    token: localStorage.getItem(\'token\') || \'\',\r\n    user : localStorage.getItem(\'user\') || \'\'\r\n  },\r\n\r\n  mutations: {\r\n    auth_request(state){\r\n      state.status = \'loading\'\r\n    },\r\n    auth_success_token(state, token){\r\n      state.status = \'success\'\r\n      state.token = token\r\n      // state.user = user // 这里传递第二个参数却会是undefined，未找到原因，所以将token和user分成两个\r\n    },\r\n    auth_success_user(state, user){\r\n      state.status = \'success\'\r\n      state.user = user\r\n    },\r\n    auth_error(state){\r\n      state.status = \'error\'\r\n    },\r\n    logout(state){\r\n      state.status = \'\'\r\n      state.token = \'\'\r\n      state.user = \'\'\r\n    },\r\n  },\r\n\r\n  actions: {\r\n    login({commit}, user){\r\n        return new Promise((resolve, reject) =&gt; {\r\n          commit(\'auth_request\')\r\n          axios({url: \'http://127.0.0.1:8000/automation/api/api-token-auth/\', data: user, method: \'POST\' })\r\n          .then(resp =&gt; {\r\n            const token = resp.data.token\r\n            const user = resp.data.username\r\n            localStorage.setItem(\'token\', token)\r\n            localStorage.setItem(\'user\', user)\r\n            axios.defaults.headers.common[\'Authorization\'] = \'Token \' + token  // 这里是在登录后将token加到默认的header中，便于后续调用需要登录权限的api\r\n            commit(\'auth_success_token\', token)\r\n            commit(\'auth_success_user\', user)\r\n            resolve(resp)\r\n          })\r\n          .catch(err =&gt; {\r\n            commit(\'auth_error\')\r\n            localStorage.removeItem(\'token\')\r\n            reject(err)\r\n          })\r\n        })\r\n    },\r\n\r\n    logout({commit}){\r\n      return new Promise((resolve, reject) =&gt; {\r\n        commit(\'logout\')\r\n        localStorage.removeItem(\'token\')\r\n        localStorage.removeItem(\'user\')\r\n        delete axios.defaults.headers.common[\'Authorization\']\r\n        resolve()\r\n      })\r\n    }\r\n  },\r\n\r\n  getters : {\r\n    isLoggedIn: state =&gt; !!state.token,\r\n    authStatus: state =&gt; state.status,\r\n  }\r\n})\r\n</code></pre>\r\n\r\n<p>在main.js中引用该文件，并设置如果token存在就会带上默认的header，便于调用需要登录权限的api。</p>\r\n\r\n<pre>\r\n<code class=\"language-javascript\">import Vue from \'vue\'\r\nimport App from \'./App\'\r\nimport router from \'./router\'\r\nimport store from \'./store\'\r\nimport axios from \'axios\'\r\n\r\nVue.prototype.$http = axios;\r\nconst token = localStorage.getItem(\'token\')\r\nconsole.log(token)\r\nif (token) {\r\n  Vue.prototype.$http.defaults.headers.common[\'Authorization\'] = \'Token \' + token\r\n}\r\n\r\nVue.config.productionTip = false\r\n\r\nnew Vue({\r\n  el: \'#app\',\r\n  router,\r\n  store,\r\n  components: { App },\r\n  template: \'&lt;App/&gt;\'\r\n})</code></pre>\r\n\r\n<p>修改home.vue文件，添加login入口和一些状态展示，当然还是测试用。当logout时，就会销毁记录的状态和token。</p>\r\n\r\n<pre>\r\n<code class=\"language-javascript\">&lt;template&gt;\r\n  &lt;div&gt;\r\n    &lt;h3&gt;{{ msg }}&lt;/h3&gt;\r\n    &lt;button type=\"button\" @click=\'getProjects\' :style=\"{ margin: \'10px\', padding: \'5px\' }\"&gt;get projects&lt;/button&gt;\r\n    &lt;a v-if=\"this.$store.state.token\" @click=\"logout\" :style=\"{ margin: \'10px\', padding: \'5px\' }\"&gt;Logout&lt;/a&gt;\r\n    &lt;router-link v-else to=\"/login\" :style=\"{ margin: \'10px\', padding: \'5px\' }\"&gt;Login&lt;/router-link&gt;\r\n    &lt;p&gt;{{ auth_text }}&lt;/p&gt;\r\n    &lt;p&gt;{{ this.$store.state.token }}&lt;/p&gt;\r\n    &lt;p&gt;{{ this.$store.state.status }}&lt;/p&gt;\r\n    &lt;p&gt;{{ this.$store.state.user }}&lt;/p&gt;\r\n    &lt;p&gt;{{ this.$store.getters.isLoggedIn }}&lt;/p&gt;\r\n    &lt;p&gt;{{ this.$store.getters.authStatus }}&lt;/p&gt;\r\n    &lt;table v-if=\"auth.length &gt; 0\" :style=\"{ border: \'2px solid gray\', borderRadius: \'5px\', padding: \'10px\' }\" align=\'center\'&gt;\r\n      &lt;tr v-for=\'a in auth\'&gt;\r\n        &lt;td&gt;{{ a.id }}&lt;/td&gt;\r\n        &lt;td&gt;{{ a.username }}&lt;/td&gt;\r\n        &lt;td&gt;{{ a.email }}&lt;/td&gt;\r\n        &lt;td&gt;{{ a.token }}&lt;/td&gt;\r\n      &lt;/tr&gt;\r\n    &lt;/table&gt;\r\n    &lt;table :style=\"{ border: \'2px solid gray\', borderRadius: \'5px\', padding: \'10px\' }\" align=\'center\'&gt;\r\n      &lt;tr v-for=\'p in projects\'&gt;\r\n        &lt;td&gt;{{ p.id }}&lt;/td&gt;\r\n        &lt;td&gt;{{ p.name }}&lt;/td&gt;\r\n        &lt;td&gt;{{ p.create_time }}&lt;/td&gt;\r\n        &lt;td&gt;{{ p.update_time }}&lt;/td&gt;\r\n      &lt;/tr&gt;\r\n    &lt;/table&gt;\r\n  &lt;/div&gt;\r\n&lt;/template&gt;\r\n\r\n&lt;script&gt;\r\nexport default {\r\n  name: \'Home\',\r\n  data () {\r\n    return {\r\n      msg: \'Projects in Automation Center\',\r\n      projects: [],\r\n      auth: [],\r\n      auth_text: \'\'\r\n    }\r\n  },\r\n\r\n created: function() {\r\n    if (this.$store.state.token) {\r\n      this.auth_text = \"user already logged in \";\r\n    }\r\n    else {\r\n      this.auth_text = \"no user logged in\";\r\n    }\r\n  },\r\n\r\n  methods: {\r\n    getProjects() {\r\n      this.$http.get(\'http://127.0.0.1:8000/automation/api/projects/\').then(response =&gt; {this.projects = response.data[\"results\"], this.msg = \'get projects data from django api\'});\r\n    },\r\n\r\n    logout: function () {\r\n      this.$store.dispatch(\'logout\')\r\n      .then(() =&gt; {\r\n        this.$router.push(\'/login\')\r\n      })\r\n    }\r\n\r\n  }\r\n}\r\n&lt;/script&gt;\r\n\r\n&lt;!-- Add \"scoped\" attribute to limit CSS to this component only --&gt;\r\n&lt;style scoped&gt;\r\nh1, h2 {\r\n  font-weight: normal;\r\n}\r\nul {\r\n  list-style-type: none;\r\n  padding: 0;\r\n}\r\nli {\r\n  display: inline-block;\r\n  margin: 0 10px;\r\n}\r\na {\r\n  color: #42b983;\r\n}\r\n&lt;/style&gt;\r\n</code></pre>\r\n\r\n<p>并添加一个login.vue文件作为登录用，login.vue会调用刚才store中的login方法，并修改全局的状态，以获取是否有登录。</p>\r\n\r\n<pre>\r\n<code class=\"language-javascript\">// login.vue\r\n\r\n&lt;template&gt;\r\n &lt;div&gt;\r\n   &lt;form class=\"login\" @submit.prevent=\"login\"&gt;\r\n     &lt;h1&gt;Sign in&lt;/h1&gt;\r\n     &lt;label&gt;username&lt;/label&gt;\r\n     &lt;input required v-model=\"username\" type=\"text\" placeholder=\"Name\"/&gt;\r\n     &lt;label&gt;Password&lt;/label&gt;\r\n     &lt;input required v-model=\"password\" type=\"password\" placeholder=\"Password\"/&gt;\r\n     &lt;button type=\"submit\"&gt;Login&lt;/button&gt;\r\n   &lt;/form&gt;\r\n &lt;/div&gt;\r\n&lt;/template&gt;\r\n\r\n&lt;script&gt;\r\nexport default {\r\n  data () {\r\n    return {\r\n      username : \"\",\r\n      password : \"\"\r\n    };\r\n  },\r\n\r\n  methods: {\r\n    login: function () {\r\n      const { username, password } = this\r\n      this.$store.dispatch(\'login\', { username, password })\r\n        .then(() =&gt; this.$router.push(\'/\'))\r\n        .catch(err =&gt; console.log(err))\r\n    }\r\n  }\r\n};\r\n&lt;/script&gt;\r\n</code></pre>\r\n\r\n<p>此时需要再router/index.js中添加login的路由。</p>\r\n\r\n<pre>\r\n<code class=\"language-javascript\">// router/index.js\r\n\r\nimport Vue from \'vue\'\r\nimport Router from \'vue-router\'\r\nimport Home from \'@/components/home\'\r\nimport Login from \'@/components/login\'\r\n\r\nVue.use(Router)\r\n\r\nexport default new Router({\r\n  mode: \'history\',\r\n  routes: [\r\n    {\r\n      path: \'/\',\r\n      name: \'home\',\r\n      component: Home\r\n    },\r\n    {\r\n      path: \'/login\',\r\n      name: \'login\',\r\n      component: Login\r\n    },\r\n  ]\r\n});\r\n</code></pre>\r\n\r\n<p>此时运行前端(npm run dev)和后端(python manage.py runserver)时，就能看到默认是未登录，也无法调用api。</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2020/01/19/image-20200119180308-1.png\" style=\"height:320px; width:380px\" /></p>\r\n\r\n<p>但是登录后即使刷新页面，也会有token和登录状态的保留，不会丢失。</p>\r\n\r\n<p><img src=\"/media/upload/Bo/2020/01/19/image-20200119180442-2.png\" style=\"height:350px; width:400px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>参考文章：</p>\r\n\r\n<p><a href=\"https://scotch.io/tutorials/handling-authentication-in-vue-using-vuex\">https://scotch.io/tutorials/handling-authentication-in-vue-using-vuex</a></p>\r\n\r\n<p><a href=\"https://blog.sqreen.com/authentication-best-practices-vue/\">https://blog.sqreen.com/authentication-best-practices-vue/</a></p>\r\n\r\n<p><a href=\"https://stackoverflow.com/questions/45384172/best-practice-for-storing-auth-tokens-in-vuejs\">https://stackoverflow.com/questions/45384172/best-practice-for-storing-auth-tokens-in-vuejs</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>','2020-01-16 16:00:00.000000','2020-01-16 16:00:00.000000',2,1,1,25);
